('087ffb54-780f-414c-9f40-81778322123b', 'live', NULL, '/sites/neosdemo/features/imagetext/main/node524c186f12740/column0/node524c1878dbb26', 'b5c89d6d-4c3e-fac0-b3d9-4f21a1bc5e22', 100, '{\n    \"text\": \"<p>\\n                                                    <\\/p><div>Alice was beginning to get very tired of\\n                                                    sitting by her sister on the bank, and of having nothing to do: once\\n                                                    or twice she had peeped into the book her sister was reading, but it\\n                                                    had no pictures or conversations in it, \\\"and what is the use of\\n                                                    a book,\\\" thought Alice, \\\"without pictures or\\n                                                    conversations?\\\"<\\/div><div>So she was considering in\\n                                                    her own mind (as well as she could, for the hot day made her feel\\n                                                    very sleepy and stupid) whether the pleasure of making a daisy-chain\\n                                                    would be worth the trouble of getting up and picking the daisies,\\n                                                    when suddenly a White Rabbit with pink eyes ran close by her.<\\/div><div><br\\/><\\/div>\"\n}', 'Neos.Demo:Content.Text', 0, 0, NULL, NULL, 0, '{}', 5, '/sites/neosdemo/features/imagetext/main/node524c186f12740/column0', '6a22b0e24646a5e9f8cc7f824a604842', '4f534b1eb0c1a785da31e681fb5e91ff', '{\n    \"language\": {\n        \"0\": \"en_US\"\n    }\n}', '27c2ddefd2dd5bc60542fc0f97cfd8cb', NULL, '2015-04-26 19:43:11', '2019-02-25 17:10:06', NULL),
('09070e44-bec6-4397-86b9-a524d1f30d6b', 'live', NULL, '/sites/neosdemo/features/multiple-columns/main/node524a9dc707b81/column1/node524a9e11c11b2', '83345593-6adc-4a4f-d9d5-bee93aed1f42', 100, '{\n    \"text\": \"<p>This speech caused a remarkable sensation\\n                                                    among the party. Some of the birds\\n                                                    hurried off at once; one old Magpie began wrapping itself up very\\n                                                    carefully,\\n                                                    remarking \\\"I really must be getting home; the night-air doesn\'t\\n                                                    suit my\\n                                                    throat!\\\" and a Canary called out in a trembling voice to its\\n                                                    children\\n                                                    \\\"Come away, my dears! It\'s high time you were all in bed!\\\"\\n                                                    On various\\n                                                    pretexts they all moved off, and Alice was soon left alone.\\n                                                    <\\/p>\"\n}', 'Neos.Demo:Content.Text', 0, 0, NULL, NULL, 0, '{}', 5, '/sites/neosdemo/features/multiple-columns/main/node524a9dc707b81/column1', '1dc72b350a8cb062e5e6f50fcb73eafd', '4f534b1eb0c1a785da31e681fb5e91ff', '{\n    \"language\": {\n        \"0\": \"en_US\"\n    }\n}', '9f737c844eee0efa1bf23beeb1783798', NULL, '2015-04-26 19:43:11', '2019-02-25 17:10:06', NULL),
('099140ad-6d62-4064-9510-50f7b3ba6aef', 'live', NULL, '/sites/neosdemo/download/main', '91872bb6-86dd-28f9-193d-19293378d758', 100, '{}', 'Neos.Demo:Collection.Content.Main', 0, 0, NULL, NULL, 0, '{}', 5, '/sites/neosdemo/download', 'bdf473f51e0bfdbf201395210372813f', '4f534b1eb0c1a785da31e681fb5e91ff', '{\n    \"language\": {\n        \"0\": \"en_US\"\n    }\n}', 'ba21484e00ea99ed17e03eca006beb4a', NULL, '2015-04-26 19:43:10', '2019-02-04 21:20:46', NULL),
('0aaed857-ea5f-444b-90fe-81e1d8b29dff', 'live', NULL, '/sites/neosdemo/features/imagetext/main/node524c186f12740/column2/node524c18beddbd0', '9835d866-affc-5d5c-60ae-6eb3594a5ed2', 100, '{\n    \"text\": \"<p>\\n                                                    <\\/p><div>In another moment down went Alice after it,\\n                                                    never once considering how in the world she was to get out again.<\\/div><div><br\\/><\\/div><div>The\\n                                                    rabbit-hole went straight on like a tunnel for some way, and then\\n                                                    dipped suddenly down, so suddenly that Alice had not a moment to\\n                                                    think about stopping herself before she found herself falling down\\n                                                    what seemed to be a very deep well.<\\/div>\"\n}', 'Neos.Demo:Content.Text', 0, 0, NULL, NULL, 0, '{}', 5, '/sites/neosdemo/features/imagetext/main/node524c186f12740/column2', '3780eb231836b298a7be9ef363e148a0', '4f534b1eb0c1a785da31e681fb5e91ff', '{\n    \"language\": {\n        \"0\": \"en_US\"\n    }\n}', 'f43534bdfaf48dce259d0d0e157d9b2f', NULL, '2015-04-26 19:43:11', '2019-02-25 17:10:06', NULL),
('0b165659-4728-4a79-a988-382d60a786b8', 'live', NULL, '/sites/neosdemo/try-me/main/node52a4394db3af3/column1', '4f717073-3aa3-3c89-3756-4f3670acd95a', 200, '{}', 'Neos.Demo:Collection.Content.Column', 0, 0, NULL, NULL, 0, '{}', 6, '/sites/neosdemo/try-me/main/node52a4394db3af3', 'c3c3d39fd606396e8a675cdd6e98b220', '4f534b1eb0c1a785da31e681fb5e91ff', '{\n    \"language\": {\n        \"0\": \"en_US\"\n    }\n}', 'fa21a28d5791733904f1b99fec5defda', NULL, '2015-04-26 19:43:12', '2019-03-08 09:29:18', NULL),
('0b2af91d-4ca9-40d9-a1e8-23428dcabac8', 'live', NULL, '/sites/neosdemo/features/forms/main/node52a7107ea17ec', 'eb6d3eb8-e639-45fc-c596-d652153721e1', 200, '{}', 'Neos.Demo:Content.Columns.Two', 0, 0, NULL, NULL, 0, '{}', 4, '/sites/neosdemo/features/forms/main', '33e74de52cc723fb25a955b664446512', '4f534b1eb0c1a785da31e681fb5e91ff', '{\n    \"language\": {\n        \"0\": \"en_US\"\n    }\n}', '45b306441ab067cdf207440d0754e6c4', NULL, '2015-04-26 19:43:11', '2019-02-25 17:17:22', NULL),
('0cb23dc0-69bf-414f-a161-c4ef6ad2f8b8', 'live', NULL, '/sites/neosdemo/features/multiple-columns/main/node524a9d2ab69b0/column2/node524a9dff228ac', '4bc02083-aef4-3dc3-9622-c764843a02b8', 100, '{\n    \"text\": \"<p>The next thing was to eat the comfits;\\n                                                    this caused some noise and confusion,\\n                                                    as the large birds complained that they could not taste theirs, and\\n                                                    the small\\n                                                    ones choked and had to be patted on the back. However, it was over\\n                                                    at last, and\\n                                                    they sat down again in a ring, and begged the Mouse to tell them\\n                                                    something more.\\n                                                    <\\/p>\"\n}', 'Neos.Demo:Content.Text', 0, 0, NULL, NULL, 0, '{}', 5, '/sites/neosdemo/features/multiple-columns/main/node524a9d2ab69b0/column2', '56d09ad440e187d4b3e555a2124b3add', '4f534b1eb0c1a785da31e681fb5e91ff', '{\n    \"language\": {\n        \"0\": \"en_US\"\n    }\n}', '644854830b787877f7222029e3c29fef', NULL, '2015-04-26 19:43:11', '2019-02-25 17:10:06', NULL),
