('275970d2-9603-476e-8f38-1083f0bf81ab', 'live', NULL, '/sites/neosdemo/features/main/node524d96f6b1348/column1/node524da282203b1', 'e5171e7f-8898-be7a-4c05-147ed00f7a00', 200, '{\n    \"text\": \"<p>\\n                                                <\\/p><p>Don\'t explain anymore how editing works. Just\\n                                                discover it yourself! All contents are directly edited on the page, just\\n                                                styled like the live content. Powered by CKEditor,\\n                                                you\'ll directly see what you write, just as the end-user does.<\\/p><p>Furthermore,\\n                                                the editing is based on semantic technologies such as RDFa, which we\\n                                                consume using VIE and CreateJS. This allows to expose the whole content\\n                                                of your website in a machine-readable way, should you ever need that.<\\/p><p>You\\n                                                also see Neos is not just developed by the core team, but we\'re also\\n                                                using and contributing to other, shared projects.<\\/p>\"\n}', 'Neos.Demo:Content.Text', 0, 0, NULL, NULL, 0, '{}', 5, '/sites/neosdemo/features/main/node524d96f6b1348/column1', '0d52cd023c05ccca2b21d1f3556cda05', '4f534b1eb0c1a785da31e681fb5e91ff', '{\n    \"language\": {\n        \"0\": \"en_US\"\n    }\n}', '628e15190d41e519a60f71b53766c6b0', NULL, '2015-04-26 19:43:11', '2019-02-25 17:10:06', NULL),
