('453f928d-516f-4ed7-9264-1aca9bfe714a', 'live', NULL, '/sites/neosdemo/the-book/xi-who-stole-the-tarts', 'e40275e7-109b-ba78-da74-0a71c10c2652', 1300, '{\n    \"layout\": \"chapter\",\n    \"title\": \"XI. Who Stole the Tarts?\",\n    \"chapterDescription\": \"The King and Queen of Hearts were seated on their throne when they arrived, with a great crowd assembled about them—all sorts of little birds and beasts, as well as the whole pack of cards: the Knave was standing before them, in chains, with a soldier on each side to guard him; \",\n    \"chapterImage\": {\n        \"__flow_object_type\": \"Neos\\\\Media\\\\Domain\\\\Model\\\\ImageVariant\",\n        \"__identifier\": \"f16e4228-5361-cccd-8c12-4733331e65eb\"\n    },\n    \"uriPathSegment\": \"xi-who-stole-the-tarts\"\n}', 'Neos.Demo:Document.Chapter', 0, 0, NULL, NULL, 0, '{}', 13, '/sites/neosdemo/the-book', '01105116cd31da60110be807e8648507', '4f534b1eb0c1a785da31e681fb5e91ff', '{\n    \"language\": {\n        \"0\": \"en_US\"\n    }\n}', 'ff7170df62e02ccc62f06663a3689785', NULL, '2015-04-26 19:43:12', '2019-09-05 18:12:50', '2019-09-05 18:12:50'),
