('4a8694ee-770d-416f-949f-7dce6aef43bf', 'live', NULL, '/sites/neosdemo/features/forms/main', '14d2acfe-d72f-a61b-b2b8-614158827a99', 100, '{}', 'Neos.Demo:Collection.Content.Main', 0, 0, NULL, NULL, 0, '{}', 5, '/sites/neosdemo/features/forms', '45b306441ab067cdf207440d0754e6c4', '4f534b1eb0c1a785da31e681fb5e91ff', '{\n    \"language\": {\n        \"0\": \"en_US\"\n    }\n}', '6c2f3b518bfae477925560b4df7d6644', NULL, '2015-04-26 19:43:11', '2019-02-04 21:20:46', NULL),
('4aabfd13-1e52-4d2e-93fe-c3bf89b82bbd', 'live', NULL, '/sites/neosdemo/member-area', 'fee74676-c42f-89da-208e-1741a66525d4', 850, '{\n    \"uriPathSegment\": \"member-area\",\n    \"title\": \"Member area\"\n}', 'Neos.Demo:Document.Page', 0, 0, NULL, NULL, 0, '{}', 11, '/sites/neosdemo', 'c66524b2ab7b4ea66acc1b621b013398', '4f534b1eb0c1a785da31e681fb5e91ff', '{\n    \"language\": {\n        \"0\": \"en_US\"\n    }\n}', 'a5c067917eca93271eb74d257aaf128d', NULL, '2015-04-30 23:15:01', '2019-03-08 09:22:05', NULL),
('4ac252c9-5906-46b3-ba25-b36769417bfb', 'live', NULL, '/sites/neosdemo/the-book/ix-the-mock-turtle-s-story/main/node52a3a3d174956', 'b9e38ee3-3b85-8829-5d6f-5ee885ffcaf6', 100, '{\n    \"text\": \"<p>YOU can\'t think how glad I am to see you again,\\n                                            you dear old thing!\\\" said the Duchess, as she tucked her arm\\n                                            affectionately into Alice\'s, and they walked off together.<br\\/>Alice\\n                                            was very glad to find her in such a pleasant temper, and thought to herself\\n                                            that perhaps it was only the pepper that had made her so savage when they\\n                                            met in the kitchen.<br\\/><\\/p><p>\\\"When I\'m a Duchess,\\\"\\n                                            she said to herself (not in a very hopeful tone though), \\\"I won\'t have\\n                                            any pepper in my kitchen at all. Soup does very well without—Maybe it\'s\\n                                            always pepper that makes people hot-tempered,\\\" she went on, very much\\n                                            pleased at having found out a new kind of rule, \\\"and vinegar that makes\\n                                            them sour—and camomile that makes them bitter—and—barley-sugar and such\\n                                            things that make children sweet-tempered. I only wish people knew that: then\\n                                            they wouldn\'t be so stingy about it, you know——\\\"<br\\/><\\/p><p>She\\n                                            had quite forgotten the Duchess by this time, and was a little startled when\\n                                            she heard her voice close to her ear. \\\"You\'re thinking about something,\\n                                            my dear, and that makes you forget to talk. I can\'t tell you just now what\\n                                            the moral of that is, but I shall remember it in a bit.\\\"<br\\/><\\/p><p>\\\"Perhaps\\n                                            it hasn\'t one,\\\" Alice ventured to remark.<br\\/><\\/p><p>\\\"Tut,\\n                                            tut, child!\\\" said the Duchess. \\\"Every thing\'s got a moral, if only\\n                                            you can find it.\\\" And she squeezed herself up closer to Alice\'s side as\\n                                            she spoke.<br\\/><\\/p><p>Alice did not much like her keeping\\n                                            so close to her: first, because the Duchess was very ugly; and secondly,\\n                                            because she was exactly the right height to rest her chin on Alice\'s\\n                                            shoulder, and it was an uncomfortably sharp chin. However, she did not like\\n                                            to be rude, so she bore it as well as she could. \\\"The game\'s going on\\n                                            rather better now,\\\" she said, by way of keeping up the conversation a\\n                                            little.<br\\/><\\/p><p>\\\"\'Tis so,\\\" said the Duchess:\\n                                            \\\"and the moral of that is—\'Oh, \'tis love, \'tis love, that makes the\\n                                            world go round!\'\\\"<br\\/><\\/p><p>\\\"Somebody said,\\\"\\n                                            Alice whispered, \\\"that it\'s done by everybody minding their own\\n                                            business!\\\"<br\\/><\\/p><p>\\\"Ah, well! It means much\\n                                            the same thing,\\\" said the Duchess, digging her sharp little chin into\\n                                            Alice\'s shoulder as she added, \\\"and the moral of that is—\'Take care of\\n                                            the sense, and the sounds will take care of themselves.\'\\\"<br\\/><\\/p><p>\\\"How\\n                                            fond she is of finding morals in things!\\\" Alice thought to herself.<br\\/><\\/p><p>\\\"I\\n                                            dare say you\'re wondering why I don\'t put my arm round your waist,\\\" the\\n                                            Duchess said after a pause: \\\"the reason is, that I\'m doubtful about the\\n                                            temper of your flamingo. Shall I try the experiment?\\\"<br\\/><\\/p><p>\\\"He\\n                                            might bite,\\\" Alice cautiously replied, not feeling at all anxious to\\n                                            have the experiment tried.<br\\/><\\/p><p>\\\"Very true,\\\"\\n                                            said the Duchess: \\\"flamingoes and mustard both bite. And the moral of\\n                                            that is—\'Birds of a feather flock together.\'\\\"<br\\/><\\/p><p>\\\"Only\\n                                            mustard isn\'t a bird,\\\" Alice remarked.<br\\/><\\/p><p>\\\"Right,\\n                                            as usual,\\\" said the Duchess: \\\"what a clear way you have of putting\\n                                            things!\\\"<br\\/><\\/p><p>\\\"It\'s a mineral, I think,\\\"\\n                                            said Alice.<\\/p><p>\\\"Of course it is,\\\" said the Duchess,\\n                                            who seemed ready to agree to everything that Alice said: \\\"there\'s a\\n                                            large mustard-mine near here. And the moral of that is—\'The more there is of\\n                                            mine, the less there is of yours.\'\\\"<br\\/><\\/p><p>\\\"Oh,\\n                                            I know!\\\" exclaimed Alice, who had not attended to this last remark.\\n                                            \\\"It\'s a vegetable. It doesn\'t look like one, but it is.\\\"<br\\/><\\/p><p>\\\"I\\n                                            quite agree with you,\\\" said the Duchess; \\\"and the moral of that\\n                                            is—\'Be what you would seem to be\'—or if you\'d like it put more simply—\'Never\\n                                            imagine yourself not to be otherwise than what it might appear to others\\n                                            that what you were or might have been was not otherwise than what you had\\n                                            been would have appeared to them to be otherwise.\'\\\"<br\\/><\\/p><p>\\\"I\\n                                            think I should understand that better,\\\" Alice said very politely,\\n                                            \\\"if I had it written down: but I can\'t quite follow it as you say it.\\\"<br\\/><\\/p><p>\\\"That\'s\\n                                            nothing to what I could say if I chose,\\\" the Duchess replied, in a\\n                                            pleased tone.<br\\/><\\/p><p>\\\"Pray don\'t trouble yourself\\n                                            to say it any longer than that,\\\" said Alice.<br\\/><\\/p><p>\\\"Oh,\\n                                            don\'t talk about trouble!\\\" said the Duchess. \\\"I make you a present\\n                                            of everything I\'ve\\n                                            said as yet.\\\"<br\\/><\\/p><p>\\\"A cheap sort of\\n                                            present!\\\" thought Alice. \\\"I\'m glad they don\'t give birthday\\n                                            presents like that!\\\" But she did not venture to say it out loud.<br\\/><\\/p><p>\\\"Thinking\\n                                            again?\\\" the Duchess asked with another dig of her sharp little chin.<br\\/><\\/p><p>\\\"I\'ve\\n                                            a right to think,\\\" said Alice sharply, for she was beginning to feel a\\n                                            little worried.<br\\/><\\/p><p>\\\"Just about as much right,\\\"\\n                                            said the Duchess, \\\"as pigs have to fly; and the m——\\\"<br\\/><\\/p><p>But\\n                                            here, to Alice\'s great surprise, the Duchess\'s voice died away, even in the\\n                                            middle of her favourite word \\\"moral,\\\" and the arm that was linked\\n                                            into hers began to tremble. Alice looked up, and there stood the Queen in\\n                                            front of them, with her arms folded, frowning like a thunderstorm.<br\\/><\\/p><p>\\\"A\\n                                            fine day, your Majesty!\\\" the Duchess began in a low, weak voice.<br\\/><\\/p><p>\\\"Now,\\n                                            I give you fair warning,\\\" shouted the Queen, stamping on the ground as\\n                                            she spoke; \\\"either you or your head must be off, and that in about half\\n                                            no time! Take your choice!\\\"<br\\/><\\/p><p>The Duchess\\n                                            took her choice, and was gone in a moment.<br\\/><\\/p><p>\\\"Let\'s\\n                                            go on with the game,\\\" the Queen said to Alice; and Alice was too much\\n                                            frightened to say a word, but slowly followed her back to the\\n                                            croquet-ground.<br\\/><\\/p><p>The other guests had taken\\n                                            advantage of the Queen\'s absence, and were resting in the shade: however,\\n                                            the moment they saw her, they hurried back to the game, the Queen merely\\n                                            remarking that a moment\'s delay would cost them their lives.<\\/p><p>All\\n                                            the time they were playing the Queen never left off quarrelling with the\\n                                            other players, and shouting \\\"Off with his head!\\\" or \\\"Off with\\n                                            her head!\\\" Those whom she sentenced were taken into custody by the\\n                                            soldiers, who of course had to leave off being arches to do this, so that by\\n                                            the end of half an hour or so there were no arches left, and all the\\n                                            players, except the King, the Queen, and Alice, were in custody and under\\n                                            sentence of execution.<br\\/><\\/p><p>Then the Queen left off,\\n                                            quite out of breath, and said to Alice, \\\"Have you seen the Mock Turtle\\n                                            yet?\\\"<br\\/><\\/p><p>\\\"No,\\\" said Alice. \\\"I\\n                                            don\'t even know what a Mock Turtle is.\\\"<br\\/><\\/p><p>\\\"It\'s\\n                                            the thing Mock Turtle Soup is made from,\\\" said the Queen.<br\\/><\\/p><p>\\\"I\\n                                            never saw one, or heard of one,\\\" said Alice.<br\\/><\\/p><p>\\\"Come\\n                                            on then,\\\" said the Queen, \\\"and he shall tell you his history.\\\"<br\\/><\\/p><p>As\\n                                            they walked off together, Alice heard the King say in a low voice, to the\\n                                            company generally, \\\"You are all pardoned.\\\" \\\"Come, that\'s a\\n                                            good thing!\\\" she said to herself, for she had felt quite unhappy at the\\n                                            number of executions the Queen had ordered.<br\\/><\\/p><p>They\\n                                            very soon came upon a Gryphon, lying fast asleep in the sun. (If you don\'t\\n                                            know what a Gryphon is, look at the picture.) \\\"Up, lazy thing!\\\"\\n                                            said the Queen, \\\"and take this young lady to see the Mock Turtle, and\\n                                            to hear his history. I must go back and see after some executions I have\\n                                            ordered,\\\" and she walked off, leaving Alice alone with the Gryphon.\\n                                            Alice did not quite like the look of the creature, but on the whole she\\n                                            thought it would be quite as safe to stay with it as to go after that savage\\n                                            Queen: so she waited.<br\\/><\\/p><p>The Gryphon sat up and\\n                                            rubbed its eyes: then it watched the Queen till she was out of sight: then\\n                                            it chuckled. \\\"What fun!\\\" said the Gryphon, half to itself, half to\\n                                            Alice.<br\\/><\\/p><p>\\\"What is the fun?\\\" said Alice.<br\\/><\\/p><p>\\\"Why,\\n                                            she,\\\" said the Gryphon. \\\"It\'s all her fancy, that: they never\\n                                            executes nobody, you know. Come on!\\\"<br\\/><\\/p><p>\\\"Everybody\\n                                            says \'come on!\' here,\\\" thought Alice, as she went slowly after it:\\n                                            \\\"I never was so ordered about in my life, never!\\\"<\\/p><p>They\\n                                            had not gone far before they saw the Mock Turtle in the distance, sitting\\n                                            sad and lonely on a little ledge of rock, and, as they came nearer, Alice\\n                                            could hear him sighing as if his heart would break. She pitied him deeply.\\n                                            \\\"What is his sorrow?\\\" she asked the Gryphon, and the Gryphon\\n                                            answered, very nearly in the same words as before, \\\"It\'s all his fancy,\\n                                            that: he hasn\'t got no sorrow, you know. Come on!\\\"<br\\/><\\/p><p>So\\n                                            they went up to the Mock Turtle, who looked at them with large eyes full of\\n                                            tears, but said nothing.<br\\/><\\/p><p>\\\"This here\\n                                            young lady,\\\" said the Gryphon, \\\"she wants to know your history,\\n                                            she do.\\\"<br\\/><\\/p><p>\\\"I\'ll tell it her,\\\"\\n                                            said the Mock Turtle in a deep, hollow tone; \\\"sit down, both of you,\\n                                            and don\'t speak a word till I\'ve finished.\\\"<br\\/><\\/p><p>So\\n                                            they sat down, and nobody spoke for some minutes. Alice thought to herself,\\n                                            \\\"I don\'t see how he can ever finish, if he doesn\'t begin.\\\" But she\\n                                            waited patiently.<br\\/><\\/p><p>\\\"Once,\\\" said the\\n                                            Mock Turtle at last, with a deep sigh, \\\"I was a real Turtle.\\\"<br\\/><\\/p><p>These\\n                                            words were followed by a very long silence, broken only by an occasional\\n                                            exclamation of \\\"Hjckrrh!\\\" from the Gryphon, and the constant heavy\\n                                            sobbing of the Mock Turtle. Alice was very nearly getting up and saying\\n                                            \\\"Thank you, sir, for your interesting story,\\\" but she could not\\n                                            help thinking there must be more to come, so she sat still and said nothing.<br\\/><\\/p><p>\\\"When\\n                                            we were little,\\\" the Mock Turtle went on at last, more calmly, though\\n                                            still sobbing a little now and then, \\\"we went to school in the sea. The\\n                                            master was an old Turtle—we used to call him Tortoise——\\\"<br\\/><\\/p><p>\\\"Why\\n                                            did you call him Tortoise, if he wasn\'t one?\\\" Alice asked.<br\\/><\\/p><p>\\\"We\\n                                            called him Tortoise because he taught us,\\\" said the Mock Turtle\\n                                            angrily: \\\"really you are very dull!\\\"<br\\/><\\/p><p>\\\"You\\n                                            ought to be ashamed of yourself for asking such a simple question,\\\"\\n                                            added the Gryphon; and then they both sat silent and looked at poor Alice,\\n                                            who felt ready to sink into the earth. At last the Gryphon said to the Mock\\n                                            Turtle, \\\"Drive on, old fellow. Don\'t be all day about it!\\\" and he\\n                                            went on in these words:<br\\/><\\/p><p>\\\"Yes, we went to\\n                                            school in the sea, though you mayn\'t believe it——\\\"<br\\/><\\/p><p>\\\"I\\n                                            never said I didn\'t!\\\" interrupted Alice.<br\\/><\\/p><p>\\\"You\\n                                            did,\\\" said the Mock Turtle.<br\\/><\\/p><p>\\\"Hold\\n                                            your tongue!\\\" added the Gryphon, before Alice could speak again. The\\n                                            Mock Turtle went on:—<br\\/><\\/p><p>\\\"We had the best of\\n                                            educations—in fact, we went to school every day——\\\"<br\\/><\\/p><p>\\\"I\'ve\\n                                            been to a day-school, too,\\\" said Alice; \\\"you needn\'t be so proud\\n                                            as all that.\\\"<br\\/><\\/p><p>\\\"With extras?\\\"\\n                                            asked the Mock Turtle a little anxiously.<br\\/><\\/p><p>\\\"Yes,\\\"\\n                                            said Alice, \\\"we learned French and music.\\\"<br\\/><\\/p><p>\\\"And\\n                                            washing?\\\" said the Mock Turtle.<br\\/><\\/p><p>\\\"Certainly\\n                                            not!\\\" said Alice indignantly.<\\/p><p>\\\"Ah! then yours\\n                                            wasn\'t a really good school,\\\" said the Mock Turtle in a tone of relief.\\n                                            \\\"Now at ours they had at the end of the bill, \'French, music, and\\n                                            washing—extra.\'\\\"<br\\/><\\/p><p>\\\"You couldn\'t have\\n                                            wanted it much,\\\" said Alice; \\\"living at the bottom of the sea.\\\"<br\\/><\\/p><p>\\\"I\\n                                            couldn\'t afford to learn it,\\\" said the Mock Turtle with a sigh. \\\"I\\n                                            only took the regular course.\\\"<br\\/><\\/p><p>\\\"What\\n                                            was that?\\\" inquired Alice.<br\\/><\\/p><p>\\\"Reeling\\n                                            and Writhing, of course, to begin with,\\\" the Mock Turtle replied;\\n                                            \\\"and then the different branches of Arithmetic—Ambition, Distraction,\\n                                            Uglification, and Derision.\\\"<br\\/><\\/p><p>\\\"I never\\n                                            heard of \'Uglification,\'\\\" Alice ventured to say. \\\"What is it?\\\"<br\\/><\\/p><p>The\\n                                            Gryphon lifted up both its paws in surprise. \\\"Never heard of uglifying!\\\"\\n                                            it exclaimed. \\\"You know what to beautify is, I suppose?\\\"<br\\/><\\/p><p>\\\"Yes,\\\"\\n                                            said Alice doubtfully: \\\"it means—to—make—anything—prettier.\\\"<br\\/><\\/p><p>\\\"Well,\\n                                            then,\\\" the Gryphon went on, \\\"if you don\'t know what to uglify is,\\n                                            you are a simpleton.\\\"<br\\/><\\/p><p>Alice did not feel\\n                                            encouraged to ask any more questions about it, so she turned to the Mock\\n                                            Turtle and said, \\\"What else had you to learn?\\\"<br\\/><\\/p><p>\\\"Well,\\n                                            there was Mystery,\\\" the Mock Turtle replied, counting off the subjects\\n                                            on his flappers, \\\"—Mystery, ancient and modern, with Seaography: then\\n                                            Drawling—the Drawling-master was an old conger-eel, that used to come once a\\n                                            week: he taught us Drawling, Stretching, and Fainting in Coils.\\\"<br\\/><\\/p><p>\\\"What\\n                                            was that like?\\\" said Alice.<br\\/><\\/p><p>\\\"Well, I\\n                                            can\'t show it you myself,\\\" the Mock Turtle said: \\\"I\'m too stiff.\\n                                            And the Gryphon never\\n                                            learnt it.\\\"<br\\/><\\/p><p>\\\"Hadn\'t time,\\\" said\\n                                            the Gryphon: \\\"I went to the Classical master, though. He was an old\\n                                            crab, he was.\\\"<br\\/><\\/p><p>\\\"I never went to him,\\\"\\n                                            the Mock Turtle said with a sigh: \\\"he taught Laughing and Grief, they\\n                                            used to say.\\\"<br\\/><\\/p><p>\\\"So he did, so he did,\\\"\\n                                            said the Gryphon, sighing in his turn; and both creatures hid their faces in\\n                                            their paws.<br\\/><\\/p><p>\\\"And how many hours a day did\\n                                            you do lessons?\\\" said Alice, in a hurry to change the subject.<br\\/><\\/p><p>\\\"Ten\\n                                            hours the first day,\\\" said the Mock Turtle: \\\"nine the next, and so\\n                                            on.\\\"<br\\/><\\/p><p>\\\"What a curious plan!\\\"\\n                                            exclaimed Alice.<br\\/><\\/p><p>\\\"That\'s the reason\\n                                            they\'re called lessons,\\\" the Gryphon remarked: \\\"because they\\n                                            lessen from day to day.\\\"<br\\/><\\/p><p>This was quite a\\n                                            new idea to Alice, and she thought over it a little before she made her next\\n                                            remark. \\\"Then the eleventh day must have been a holiday.\\\"<br\\/><\\/p><p>\\\"Of\\n                                            course it was,\\\" said the Mock Turtle.<br\\/><\\/p><p>\\\"And\\n                                            how did you manage on the twelfth?\\\" Alice went on eagerly.<br\\/><\\/p><p>\\\"That\'s\\n                                            enough about lessons,\\\" the Gryphon interrupted in a very decided tone:\\n                                            \\\"tell her something about the games now.\\\"<br\\/>\\n                                            <\\/p>\"\n}', 'Neos.Demo:Content.Text', 0, 0, NULL, NULL, 0, '{}', 4, '/sites/neosdemo/the-book/ix-the-mock-turtle-s-story/main', 'c19a0961c180c6c7c3b5ac2fdf412e3f', '4f534b1eb0c1a785da31e681fb5e91ff', '{\n    \"language\": {\n        \"0\": \"en_US\"\n    }\n}', '6484ccf3e054d2e0f3b2dc973e7008e2', NULL, '2015-04-26 19:43:12', '2019-02-25 17:10:06', NULL),
('4c93450c-7a8c-4c34-8050-c896549b7edc', 'live', NULL, '/sites/neosdemo/main/node-i85lwfh1f7qxf/column1/node-d73k9az69grwm', '3df73ac5-375a-4bfd-bb30-8f6bd4ed0685', 100, '{\n    \"caption\": \"\",\n    \"image\": {\n        \"__flow_object_type\": \"Neos\\\\Media\\\\Domain\\\\Model\\\\Image\",\n        \"__identifier\": \"bbc90ad7-1a0c-4dc9-8cfb-0823acae458f\"\n    }\n}', 'Neos.Demo:Content.ImageRoundedLeftRight', 0, 0, NULL, NULL, 0, '{}', 2, '/sites/neosdemo/main/node-i85lwfh1f7qxf/column1', '7758797ba65e938da399041b3b62e44f', '4f534b1eb0c1a785da31e681fb5e91ff', '{\n    \"language\": {\n        \"0\": \"en_US\"\n    }\n}', '917f02bcb1acc0d1c76eecf0c66c9ce7', NULL, '2022-09-21 12:00:35', '2022-09-21 12:03:39', '2022-09-21 12:03:38');
INSERT INTO `neos_contentrepository_domain_model_nodedata` (`persistence_object_identifier`, `workspace`, `contentobjectproxy`, `path`, `identifier`, `sortingindex`, `properties`, `nodetype`, `removed`, `hidden`, `hiddenbeforedatetime`, `hiddenafterdatetime`, `hiddeninindex`, `accessroles`, `version`, `parentpath`, `pathhash`, `dimensionshash`, `dimensionvalues`, `parentpathhash`, `movedto`, `creationdatetime`, `lastmodificationdatetime`, `lastpublicationdatetime`) VALUES
('4cbd3d1d-59b6-41dd-ab1a-74ae837cdca8', 'live', NULL, '/sites/neosdemo/the-book/vii-a-mad-tea-party/main/node52a39d015051d', '037e4a67-a80d-d05a-ba37-11ae18515f38', 100, '{\n    \"text\": \"<p>T HERE was a table set out under a tree in front\\n                                            of the house, and the March Hare and the Hatter were having tea at it: a\\n                                            Dormouse was sitting between them, fast asleep, and the other two were using\\n                                            it as a cushion resting their elbows on it, and talking over its head.\\n                                            \\\"Very uncomfortable for the Dormouse,\\\" thought Alice; \\\"only\\n                                            as it\'s asleep, suppose it doesn\'t mind.\\\"<br\\/>The table was a\\n                                            large one, but the three were all crowded together at one corner of it.\\n                                            \\\"No room! No room!\\\" they cried out when they saw Alice coming.\\n                                            \\\"There\'s plenty of room!\\\" said Alice indignantly, and she sat down\\n                                            in a large arm-chair at one end of the table.<br\\/><\\/p><p>\\\"Have\\n                                            some wine,\\\" the March Hare said in an encouraging tone.<br\\/><\\/p><p>Alice\\n                                            looked all round the table, but there was nothing on it but tea. \\\"I\\n                                            don\'t see any wine,\\\" she remarked.<br\\/><\\/p><p>\\\"There\\n                                            isn\'t any,\\\" said the March Hare.<br\\/><\\/p><p>\\\"Then\\n                                            it wasn\'t very civil of you to offer it,\\\" said Alice angrily.<br\\/><\\/p><p>\\\"It\\n                                            wasn\'t very civil of you to sit down without being invited,\\\" said the\\n                                            March Hare.<br\\/><\\/p><p>\\\"I didn\'t know it was your\\n                                            table,\\\" said Alice; \\\"it\'s laid for a great many more than three.\\\"<br\\/><\\/p><p>\\\"Your\\n                                            hair wants cutting,\\\" said the Hatter. He had been looking at Alice for\\n                                            some time with great curiosity, and this was his first speech.<br\\/><\\/p><p>\\\"You\\n                                            should learn not to make personal remarks,\\\" Alice said with some\\n                                            severity; \\\"it\'s very rude.\\\"<br\\/><\\/p><p>The\\n                                            Hatter opened his eyes very wide on hearing this; but all he said was \\\"Why\\n                                            is a raven like a writing-desk?\\\"<br\\/><\\/p><p>\\\"Come,\\n                                            we shall have some fun now!\\\" thought Alice. \\\"I\'m glad they\'ve\\n                                            begun asking riddles.—I believe I can guess that,\\\" she added aloud.<br\\/><\\/p><p>\\\"Do\\n                                            you mean that you think you can find out the answer to it?\\\" said the\\n                                            March Hare.<br\\/><\\/p><p>\\\"Exactly so,\\\" said Alice.<br\\/><\\/p><p>\\\"Then\\n                                            you should say what you mean,\\\" the March Hare went on.<br\\/><\\/p><p>\\\"I\\n                                            do,\\\" Alice hastily replied; \\\"at least—at least I mean what I\\n                                            say—that\'s the same thing, you know.\\\"<br\\/><\\/p><p>\\\"Not\\n                                            the same thing a bit!\\\" said the Hatter. \\\"Why, you might just as\\n                                            well say that \'I see what I eat\' is the same thing as \'I eat what I see\'!\\\"<br\\/><\\/p><p>\\\"You\\n                                            might just as well say,\\\" added the March Hare, \\\"that \'I like what\\n                                            I get\' is the same thing as \'I get what I like\'!\\\"<br\\/><\\/p><p>\\\"You\\n                                            might just as well say,\\\" added the Dormouse, which seemed to be talking\\n                                            in his sleep, \\\"that \'I breathe when I sleep\' is the same thing as \'I\\n                                            sleep when I breathe\'!\\\"<br\\/><\\/p><p>\\\"It is the\\n                                            same thing with you,\\\" said the Hatter; and here the conversation\\n                                            dropped, and the party sat silent for a minute, while Alice thought over all\\n                                            she could remember about ravens and writing-desks, which wasn\'t much.<\\/p><p>The\\n                                            Hatter was the first to break the silence. \\\"What day of the month is\\n                                            it?\\\" he said, turning to Alice: he had taken his watch out of his\\n                                            pocket, and was looking at it uneasily, shaking it every now and then, and\\n                                            holding it to his ear.<br\\/><\\/p><p>Alice considered a\\n                                            little, and then said \\\"The fourth.\\\"<br\\/><\\/p><p>\\\"Two\\n                                            days wrong!\\\" sighed the Hatter. \\\"I told you butter would not suit\\n                                            the works!\\\" he added, looking angrily at the March Hare.<br\\/><\\/p><p>\\\"It\\n                                            was the best butter,\\\" the March Hare meekly replied.<br\\/><\\/p><p>\\\"Yes,\\n                                            but some crumbs must have got in as well,\\\" the Hatter grumbled: \\\"you\\n                                            shouldn\'t have put it in with the bread-knife.\\\"<br\\/><\\/p><p>The\\n                                            March Hare took the watch and looked at it gloomily: then he dipped it into\\n                                            his cup of tea, and looked at it again: but he could think of nothing better\\n                                            to say than his first remark, \\\"It was the best butter, you know.\\\"<br\\/><\\/p><p>Alice\\n                                            had been looking over his shoulder with some curiosity. \\\"What a funny\\n                                            watch!\\\" she remarked. \\\"It tells the day of the month, and doesn\'t\\n                                            tell what o\'clock it is!\\\"<br\\/><\\/p><p>\\\"Why should\\n                                            it?\\\" muttered the Hatter. \\\"Does your watch tell you what year it\\n                                            is?\\\"<br\\/><\\/p><p>\\\"Of course not,\\\" Alice\\n                                            replied very readily: \\\"but that\'s because it stays the same year for\\n                                            such a long time together.\\\"<br\\/><\\/p><p>\\\"Which\\n                                            is just the case with mine,\\\" said the Hatter.<br\\/><\\/p><p>Alice\\n                                            felt dreadfully puzzled. The Hatter\'s remark seemed to have no meaning in\\n                                            it, and yet it was certainly English. \\\"I don\'t quite understand,\\\"\\n                                            she said, as politely as she could.<br\\/><\\/p><p>\\\"The\\n                                            Dormouse is asleep again,\\\" said the Hatter, and he poured a little hot\\n                                            tea upon its nose.<br\\/><\\/p><p>The Dormouse shook its head\\n                                            impatiently, and said, without opening its eyes, \\\"Of course, of course;\\n                                            just what I was going to remark myself.\\\"<br\\/><\\/p><p>\\\"Have\\n                                            you guessed the riddle yet?\\\" the Hatter said, turning to Alice again.<br\\/><\\/p><p>\\\"No,\\n                                            I give it up,\\\" Alice replied: \\\"what\'s the answer?\\\"<br\\/><\\/p><p>\\\"I\\n                                            haven\'t the slightest idea,\\\" said the Hatter.<br\\/><\\/p><p>\\\"Nor\\n                                            I,\\\" said the March Hare.<br\\/><\\/p><p>Alice sighed\\n                                            wearily. \\\"I think you might do something better with the time,\\\"\\n                                            she said, \\\"than wasting it asking riddles with no answers.\\\"<br\\/><\\/p><p>\\\"If\\n                                            you knew Time as well as I do,\\\" said the Hatter, \\\"you wouldn\'t\\n                                            talk about wasting it. It\'s him.\\\"<br\\/><\\/p><p>\\\"I\\n                                            don\'t know what you mean,\\\" said Alice.<br\\/><\\/p><p>\\\"Of\\n                                            course you don\'t!\\\" the Hatter said, tossing his head contemptuously.\\n                                            \\\"I daresay you never spoke to Time!\\\"<br\\/><\\/p><p>\\\"Perhaps\\n                                            not,\\\" Alice cautiously replied: \\\"but I know I have to beat time\\n                                            when I learn music.\\\"<br\\/><\\/p><p>\\\"Ah! that\\n                                            accounts for it,\\\" said the Hatter. \\\"He won\'t stand beating. Now,\\n                                            if you only kept on good terms with him, he\'d do almost anything you liked\\n                                            with the clock. For instance, suppose it were nine o\'clock in the morning,\\n                                            just time to begin lessons: you\'d only have to whisper a hint to Time, and\\n                                            round goes the clock in a twinkling! Half-past one, time for dinner!\\\"<\\/p><p>(\\\"I\\n                                            only wish it was,\\\" the March Hare said to itself in a whisper.)<br\\/><\\/p><p>\\\"That\\n                                            would be grand, certainly,\\\" said Alice thoughtfully: \\\"but then—I\\n                                            shouldn\'t be hungry for it, you know.\\\"<br\\/><\\/p><p>\\\"Not\\n                                            at first, perhaps,\\\" said the Hatter: \\\"but you could keep it to\\n                                            half-past one as long as you liked.\\\"<br\\/><\\/p><p>\\\"Is\\n                                            that the way you manage?\\\" Alice asked.<br\\/><\\/p><p>The\\n                                            Hatter shook his head mournfully. \\\"Not I!\\\" he replied. \\\"We\\n                                            quarrelled last March——just before he went mad, you know——\\\" (pointing\\n                                            with his teaspoon to the March Hare), \\\"it was at the great concert\\n                                            given by the Queen of Hearts, and I had to sing<br\\/><\\/p><p>\'Twinkle,\\n                                            twinkle, little bat!<br\\/>How I wonder what you\'re at!\'<br\\/>You\\n                                            know that song, perhaps?\\\"<br\\/>\\\"I\'ve heard something like it,\\\"\\n                                            said Alice.<br\\/><\\/p><p>\\\"It goes on, you know,\\\"\\n                                            the Hatter continued, \\\"in this way:—<br\\/><\\/p><p>\'Up\\n                                            above the world you fly,<br\\/>Like a tea-tray in the sky.<br\\/>Twinkle,\\n                                            twinkle——\'\\\"<\\/p><p>Here the Dormouse shook itself, and began\\n                                            singing in its sleep \\\"Twinkle, twinkle, twinkle, twinkle——\\\" and\\n                                            went on so long that they had to pinch it to make it stop.<br\\/><\\/p><p>\\\"Well,\\n                                            I\'d hardly finished the first verse,\\\" said the Hatter, \\\"when the\\n                                            Queen jumped up and bawled out \'He\'s murdering the time! Off with his head!\'\\\"<br\\/><\\/p><p>\\\"How\\n                                            dreadfully savage!\\\" exclaimed Alice.<br\\/><\\/p><p>\\\"And\\n                                            ever since that,\\\" the Hatter went on in a mournful tone, \\\"he won\'t\\n                                            do a thing I ask! It\'s always six o\'clock now.\\\"<br\\/><\\/p><p>A\\n                                            bright idea came into Alice\'s head. \\\"Is that the reason so many\\n                                            tea-things are put out here?\\\" she asked.<br\\/><\\/p><p>\\\"Yes,\\n                                            that\'s it,\\\" said the Hatter with a sigh: \\\"it\'s always tea-time,\\n                                            and we\'ve no time to wash the things between whiles.\\\"<br\\/><\\/p><p>\\\"Then\\n                                            you keep moving round, I suppose?\\\" said Alice.<br\\/><\\/p><p>\\\"Exactly\\n                                            so,\\\" said the Hatter: \\\"as the things get used up.\\\"<br\\/><\\/p><p>\\\"But\\n                                            what happens when you come to the beginning again?\\\" Alice ventured to\\n                                            ask.<br\\/><\\/p><p>\\\"Suppose we change the subject,\\\"\\n                                            the March Hare interrupted, yawning. \\\"I\'m getting tired of this. I vote\\n                                            the young lady tells us a story.\\\"<br\\/><\\/p><p>\\\"I\'m\\n                                            afraid I don\'t know one,\\\" said Alice, rather alarmed at the proposal.<br\\/><\\/p><p>\\\"Then\\n                                            the Dormouse shall!\\\" they both cried. \\\"Wake up, Dormouse!\\\"\\n                                            And they pinched it on both sides at once.<br\\/><\\/p><p>The\\n                                            Dormouse slowly opened his eyes. \\\"I wasn\'t asleep,\\\" he said in a\\n                                            hoarse, feeble voice: \\\"I heard every word you fellows were saying.\\\"<br\\/><\\/p><p>\\\"Tell\\n                                            us a story!\\\" said the March Hare.<br\\/><\\/p><p>\\\"Yes,\\n                                            please do!\\\" pleaded Alice.<br\\/><\\/p><p>\\\"And be\\n                                            quick about it,\\\" added the Hatter, \\\"or you\'ll be asleep again\\n                                            before it\'s done.\\\"<br\\/><\\/p><p>\\\"Once upon a time\\n                                            there were three little sisters,\\\" the Dormouse began in a great hurry;\\n                                            \\\"and their names were Elsie, Lacie, and Tillie; and they lived at the\\n                                            bottom of a well——\\\"<br\\/><\\/p><p>\\\"What did they\\n                                            live on?\\\" said Alice, who always took a great interest in questions of\\n                                            eating and drinking.<br\\/><\\/p><p>\\\"They lived on\\n                                            treacle,\\\" said the Dormouse, after thinking a minute or two.<br\\/><\\/p><p>\\\"They\\n                                            couldn\'t have done that, you know,\\\" Alice gently remarked; \\\"they\'d\\n                                            have been ill.\\\"<br\\/><\\/p><p>\\\"So they were,\\\"\\n                                            said the Dormouse; \\\"very ill.\\\"<br\\/><\\/p><p>Alice\\n                                            tried a little to fancy to herself what such an extraordinary way of living\\n                                            would be like, but it puzzled her too much, so she went on: \\\"But why\\n                                            did they live at the bottom of a well?\\\"<br\\/><\\/p><p>\\\"Take\\n                                            some more tea,\\\" the March Hare said to Alice, very earnestly.<br\\/><\\/p><p>\\\"I\'ve\\n                                            had nothing yet,\\\" Alice replied in an offended tone, \\\"so I can\'t\\n                                            take more.\\\"<br\\/><\\/p><p>\\\"You mean you can\'t take\\n                                            less,\\\" said the Hatter; \\\"it\'s very easy to take more than nothing.\\\"<br\\/><\\/p><p>\\\"Nobody\\n                                            asked your opinion,\\\" said Alice.<br\\/><\\/p><p>\\\"Who\'s\\n                                            making personal remarks now?\\\" the Hatter asked triumphantly.<\\/p><p>Alice\\n                                            did not quite know what to say to this: so she helped herself to some tea\\n                                            and bread-and-butter, and then turned to the Dormouse, and repeated her\\n                                            question. \\\"Why did they live at the bottom of a well?\\\"<br\\/><\\/p><p>The\\n                                            Dormouse again took a minute or two to think about it, and then said, \\\"It\\n                                            was a treacle-well.\\\"<br\\/><\\/p><p>\\\"There\'s no such\\n                                            thing!\\\" Alice was beginning very angrily, but the Hatter and the March\\n                                            Hare went \\\"Sh! sh!\\\" and the Dormouse sulkily remarked: \\\"If\\n                                            you can\'t be civil, you\'d better finish the story for yourself.\\\"<br\\/><\\/p><p>\\\"No,\\n                                            please go on!\\\" Alice said very humbly. \\\"I won\'t interrupt you\\n                                            again. I dare say there may be one.\\\"<br\\/><\\/p><p>\\\"One,\\n                                            indeed!\\\" said the Dormouse indignantly. However, he consented to go on.\\n                                            \\\"And so these three little sisters—they were learning to draw, you\\n                                            know——\\\"<br\\/><\\/p><p>\\\"What did they draw?\\\"\\n                                            said Alice, quite forgetting her promise.<br\\/><\\/p><p>\\\"Treacle,\\\"\\n                                            said the Dormouse, without considering at all this time.<br\\/><\\/p><p>\\\"I\\n                                            want a clean cup,\\\" interrupted the Hatter: \\\"let\'s all move one\\n                                            place on.\\\"<br\\/><\\/p><p>He moved as he spoke, and the\\n                                            Dormouse followed him: the March Hare moved into the Dormouse\'s place, and\\n                                            Alice rather unwillingly took the place of the March Hare. The Hatter was\\n                                            the only one who got any advantage from the change: and Alice was a good\\n                                            deal worse off than before, as the March Hare had just upset the milk-jug\\n                                            into his plate.<br\\/><\\/p><p>Alice did not wish to offend\\n                                            the Dormouse again, so she began very cautiously: \\\"But I don\'t\\n                                            understand. Where did they draw the treacle from?\\\"<br\\/><\\/p><p>\\\"You\\n                                            can draw water out of a water-well,\\\" said the Hatter; \\\"so I should\\n                                            think you could draw treacle out of a treacle-well—eh, stupid!\\\"<br\\/><\\/p><p>\\\"But\\n                                            they were in the well,\\\" Alice said to the Dormouse, not choosing to\\n                                            notice this last remark.<br\\/><\\/p><p>\\\"Of course they\\n                                            were,\\\" said the Dormouse; \\\"——well in.\\\"<br\\/><\\/p><p>This\\n                                            answer so confused poor Alice that she let the Dormouse go on for some time\\n                                            without interrupting it.<br\\/><\\/p><p>\\\"They were\\n                                            learning to draw,\\\" the Dormouse went on, yawning and rubbing its eyes,\\n                                            for it was getting very sleepy; \\\"and they drew all manner of\\n                                            things—everything that begins with an M——\\\"<br\\/><\\/p><p>\\\"Why\\n                                            with an M?\\\" said Alice.<br\\/><\\/p><p>\\\"Why not?\\\"\\n                                            said the March Hare.<br\\/><\\/p><p>Alice\\n                                            was silent.<\\/p><p>The Dormouse had closed its eyes by this time,\\n                                            and was going off into a dose; but, on being pinched by the Hatter, it woke\\n                                            up again with a little shriek, and went on: \\\"—— that begins with an M,\\n                                            such as mouse-traps, and the moon, and memory, and muchness—you know you say\\n                                            things are \'much of a muchness\'—did you ever see such a thing as a drawing\\n                                            of a muchness?\\\"<br\\/><\\/p><p>\\\"Really, now you ask\\n                                            me,\\\" said Alice, very much confused, \\\"I don\'t think——\\\"<br\\/><\\/p><p>\\\"Then\\n                                            you shouldn\'t talk,\\\" said the Hatter.<br\\/><\\/p><p>This\\n                                            piece of rudeness was more than Alice could bear: she got up in great\\n                                            disgust and walked off; the Dormouse fell asleep instantly, and neither of\\n                                            the others took the least notice of her going, though she looked back once\\n                                            or twice, half hoping that they would call after her: the last time she saw\\n                                            them, they were trying to put the Dormouse into the teapot.<br\\/><\\/p><p>\\\"At\\n                                            any rate I\'ll never go there again!\\\" said Alice as she picked her way\\n                                            through the wood. \\\"It\'s the stupidest tea-party I ever was at in all my\\n                                            life!\\\"<br\\/><\\/p><p>Just as she said this, she noticed\\n                                            that one of the trees had a door leading right into it. \\\"That\'s very\\n                                            curious!\\\" she thought. \\\"But everything\'s curious to-day. I think I\\n                                            may as well go in at once.\\\" And in she went.<br\\/><\\/p><p>Once\\n                                            more she found herself in the long hall, and close to the little glass\\n                                            table. \\\"Now I\'ll manage better this time,\\\" she said to herself,\\n                                            and began by taking the little golden key, and unlocking the door that led\\n                                            into the garden. Then she set to work nibbling at the mushroom (she had kept\\n                                            a piece of it in her pocket) till she was about a foot high: then she walked\\n                                            down the little passage: and then—she found herself at last in the beautiful\\n                                            garden, among the bright flower-beds and the cool fountains.<br\\/> <\\/p>\"\n}', 'Neos.Demo:Content.Text', 0, 0, NULL, NULL, 0, '{}', 4, '/sites/neosdemo/the-book/vii-a-mad-tea-party/main', '5e79419af234c9562c004933d29c9a9a', '4f534b1eb0c1a785da31e681fb5e91ff', '{\n    \"language\": {\n        \"0\": \"en_US\"\n    }\n}', '2b3558ba35f4a5df08e97775c12d4fd6', NULL, '2015-04-26 19:43:12', '2019-02-25 17:10:06', NULL),
('4cbeb1de-a23a-4178-a049-192a31f3fd2f', 'live', NULL, '/sites/neosdemo/features/multiple-columns/main/node5249b021e9b20', '2f2adcb3-aec2-a4fa-bcb4-cb6e350944ca', 200, '{}', 'Neos.Demo:Content.Columns.Two', 0, 0, NULL, NULL, 0, '{}', 4, '/sites/neosdemo/features/multiple-columns/main', '8733cc9bf60c18a1a8af0c56970b9ee6', '4f534b1eb0c1a785da31e681fb5e91ff', '{\n    \"language\": {\n        \"0\": \"en_US\"\n    }\n}', 'ce3efeafd5182e2a8bca3220209b813c', NULL, '2015-04-26 19:43:11', '2019-02-25 17:17:22', NULL),
('4cdc8ad9-64d9-43e0-aa7e-b554fb9504e8', 'live', NULL, '/sites/neosdemo/the-book/i-down-the-rabbit-hole/main/node52a31523cce3c', '490a4be2-624e-4d34-1406-d87925604349', 100, '{\n    \"text\": \"<p>ALICE was beginning to get very tired of sitting\\n                                            by her sister on the bank, and of having nothing to do: once or twice she\\n                                            had peeped into the book her sister was reading, but it had no pictures or\\n                                            conversations in it, \\\"and what is the use of a book,\\\" thought\\n                                            Alice, \\\"without pictures or conversations?\\\"<br\\/>So she was\\n                                            considering in her own mind (as well as she could, for the hot day made her\\n                                            feel very sleepy and stupid) whether the pleasure of making a daisy-chain\\n                                            would be worth the trouble of getting up and picking the daisies, when\\n                                            suddenly a White Rabbit with pink eyes ran close by her.<\\/p><p>There\\n                                            was nothing so very remarkable in that; nor did Alice think it so very much\\n                                            out of the way to hear the Rabbit say to itself, \\\"Oh dear! Oh dear! I\\n                                            shall be too late!\\\" (when she thought it over afterwards, it occurred\\n                                            to her that she ought to have wondered at this, but at the time it all\\n                                            seemed quite natural); but when the Rabbit actually took a watch out of its\\n                                            waistcoat-pocket, and looked at it, and then hurried on, Alice started to\\n                                            her feet, for it flashed across her mind that she had never before seen a\\n                                            rabbit with either a waistcoat-pocket, or a watch to take out of it, and\\n                                            burning with curiosity, she ran across the field after it, and was just in\\n                                            time to see it pop down a large rabbit-hole under the hedge.<\\/p><p>In\\n                                            another moment down went Alice after it, never once considering how in the\\n                                            world she was to get out again.<\\/p><p>The rabbit-hole went\\n                                            straight on like a tunnel for some way, and then dipped suddenly down, so\\n                                            suddenly that Alice had not a moment to think about stopping herself before\\n                                            she found herself falling down what seemed to be a very deep well.<\\/p><p>Either\\n                                            the well was very deep, or she fell very slowly, for she had plenty of time\\n                                            as she went down to look about her, and to wonder what was going to happen\\n                                            next. First, she tried to look down and make out what she was coming to, but\\n                                            it was too dark to see anything; then she looked at the sides of the well\\n                                            and noticed that they were filled with cupboards and book-shelves: here and\\n                                            there she saw maps and pictures hung upon pegs. She took down a jar from one\\n                                            of the shelves as she passed; it was labelled \\\"ORANGE MARMALADE,\\\"\\n                                            but to her disappointment it was empty; she did not like to drop the jar for\\n                                            fear of killing somebody underneath, so managed to put it into one of the\\n                                            cupboards as she fell past it.<\\/p><p>\\\"Well!\\\" thought\\n                                            Alice to herself. \\\"After such a fall as this, I shall think nothing of\\n                                            tumbling down stairs! How brave they\'ll all think me at home! Why, I\\n                                            wouldn\'t say anything about it, even if I fell off the top of the house!\\\"\\n                                            (Which was very likely true.)<\\/p><p>Down, down, down. Would the\\n                                            fall never come to an end? \\\"I wonder how many miles I\'ve fallen by this\\n                                            time?\\\" she said aloud. \\\"I must be getting somewhere near the\\n                                            centre of the earth. Let me see: that would be four thousand miles down. I\\n                                            think—\\\" (for, you see, Alice had learnt several things of this sort in\\n                                            her lessons in the schoolroom, and though this was not a very good\\n                                            opportunity for showing off her knowledge, as there was no one to listen to\\n                                            her, still it was good practice to say it over) \\\"—yes, that\'s about the\\n                                            right distance—but then I wonder what Latitude or Longitude I\'ve got to?\\\"\\n                                            (Alice had no idea what Latitude was, or Longitude either, but thought they\\n                                            were nice grand words to say.)<\\/p><p>Presently she began again.\\n                                            \\\"I wonder if I shall fall right through the earth! How funny it\'ll seem\\n                                            to come out among the people that walk with their heads downwards! The\\n                                            Antipathies, I think—\\\" (she was rather glad there was no one listening,\\n                                            this time, as it didn\'t sound at all the right word) \\\"—but I shall have\\n                                            to ask them what the name of the country is, you know. Please, Ma\'am, is\\n                                            this New Zealand or Australia?\\\" (and she tried to curtsey as she\\n                                            spoke—fancy curtseying as you\'re falling through the air! Do you think you\\n                                            could manage it?) \\\"And what an ignorant little girl she\'ll think me!\\n                                            No, it\'ll never do to ask: perhaps I shall see it written up somewhere.\\\"<\\/p><p>Down,\\n                                            down, down. There was nothing else to do, so Alice soon began talking again.\\n                                            \\\"Dinah\'ll miss me very much to-night, I should think!\\\" (Dinah was\\n                                            the cat.) \\\"I hope they\'ll remember her saucer of milk at tea-time.\\n                                            Dinah, my dear, I wish you were down here with me! There are no mice in the\\n                                            air, I\'m afraid, but you might catch a bat, and that\'s very like a mouse,\\n                                            you know. But do cats eat bats, I wonder?\\\" And here Alice began to get\\n                                            rather sleepy, and went on saying to herself, in a dreamy sort of way,\\n                                            \\\"Do cats eat bats? Do cats eat bats?\\\" and sometimes, \\\"Do bats\\n                                            eat cats?\\\" for, you see, as she\\n                                            couldn\'t answer either question, it didn\'t much matter which way she put it.\\n                                            She felt that she was dozing off, and had just begun to dream that she was\\n                                            walking hand in hand with Dinah, and saying to her very earnestly, \\\"Now,\\n                                            Dinah, tell me the truth: did you ever eat a bat?\\\" when suddenly,\\n                                            thump! thump! down she came upon a heap of sticks and dry leaves, and the\\n                                            fall was over.<\\/p><p>Alice was not a bit hurt, and she jumped up\\n                                            on to her feet in a moment: she looked up, but it was all dark overhead;\\n                                            before her was another long passage, and the White Rabbit was still in\\n                                            sight, hurrying down it. There was not a moment to be lost: away went Alice\\n                                            like the wind, and was just in time to hear it say, as it turned a corner,\\n                                            \\\"Oh my ears and whiskers, how late it\'s getting!\\\" She was close\\n                                            behind it when she turned the corner, but the Rabbit was no longer to be\\n                                            seen: she found herself in a long, low hall, which was lit up by a row of\\n                                            lamps hanging from the roof.<\\/p><p>There were doors all round\\n                                            the hall, but they were all locked; and when Alice had been all the way down\\n                                            one side and up the other, trying every door, she walked sadly down the\\n                                            middle, wondering how she was ever to get out again.<\\/p><p>Suddenly\\n                                            she came upon a little three-legged table, all made of solid glass; there\\n                                            was nothing on it but a tiny golden key, and Alice\'s first idea was that\\n                                            this might belong to one of the doors of the hall; but, alas! either the\\n                                            locks were too large, or the key was too small, but at any rate it would not\\n                                            open any of them. However, on the second time round, she came upon a low\\n                                            curtain she had not noticed before, and behind it was a little door about\\n                                            fifteen inches high: she tried the little golden key in the lock, and to her\\n                                            great delight it fitted!<\\/p><p>Alice opened the door and found\\n                                            that it led into a small passage, not much larger than a rat-hole: she knelt\\n                                            down and looked along the passage into the loveliest garden you ever saw.\\n                                            How she longed to get out of that dark hall, and wander about among those\\n                                            beds of bright flowers and those cool fountains, but she could not even get\\n                                            her head through the doorway; Mollie even if my head would go through,\\\"\\n                                            thought poor Alice, \\\"it would be of very little use without my\\n                                            shoulders. Oh, how I wish I could shut up like a telescope! I think I could,\\n                                            if I only knew how to begin.\\\" For, you see, so many out-of-the-way\\n                                            things had happened lately, that Alice had begun to think that very few\\n                                            things indeed were really impossible.<\\/p><p>There seemed to be\\n                                            no use in waiting by the little door, so she went back to the table, half\\n                                            hoping she might find another key on it, or at any rate a book of rules for\\n                                            shutting people up like telescopes: this time she found a little bottle on\\n                                            it (\\\"which certainly was not here before,\\\" said Alice,) and tied\\n                                            round the neck of the bottle was a paper label, with the words \\\"DRINK\\n                                            ME\\\" beautifully printed on it in large letters.<\\/p><p>It\\n                                            was all very well to say \\\"Drink me,\\\" but the wise little Alice was\\n                                            not going to do that in a hurry. \\\"No, I\'ll look first,\\\" she said,\\n                                            \\\"and see whether it\'s marked \'poison\' or not;\\\" for she had read\\n                                            several nice little stories about children who had got burnt, and eaten up\\n                                            by wild beasts, and other unpleasant things, all because they would not\\n                                            remember the simple rules their friends had taught them: such as, that a\\n                                            red-hot poker will burn you if you hold it too long; and that, if you cut\\n                                            your finger very deeply with a knife, it usually bleeds; and she had never\\n                                            forgotten that, if you drink much from a bottle marked \\\"poison,\\\"\\n                                            it is almost certain to disagree with you, sooner or later.<\\/p><p>However,\\n                                            this bottle was not marked \\\"poison,\\\" so Alice ventured to taste\\n                                            it, and finding it very nice (it had, in fact, a sort of mixed flavour of\\n                                            cherry-tart, custard, pineapple, roast turkey, coffee, and hot buttered\\n                                            toast,) she very soon finished it off.<\\/p><p>\\\"What a\\n                                            curious feeling!\\\" said Alice. \\\"I must be shutting up like a\\n                                            telescope.\\\"<\\/p><p>And so it was indeed: she was now only\\n                                            ten inches high, and her face brightened up at the thought that she was now\\n                                            the right size for going through that little door into that lovely garden.\\n                                            First, however, she waited for a few minutes to see if she was going to\\n                                            shrink any further: she felt a little nervous about this: \\\"for it might\\n                                            end, you know,\\\" said Alice to herself, \\\"in my going out\\n                                            altogether, like a candle. I wonder what I should be like then?\\\" And\\n                                            she tried to fancy what the flame of a candle looks like after the candle is\\n                                            blown out, for she could not remember ever having seen such a thing.<\\/p><p>After\\n                                            a while, finding that nothing more happened, she decided on going into the\\n                                            garden at once; but,\\n                                            alas for poor Alice! when she got to the door, she found she had forgotten\\n                                            the little golden key, and when she went back to the table for it, she found\\n                                            she could not possibly reach it: she could see it quite plainly through the\\n                                            glass, and she tried her best to climb up one of the legs of the table, but\\n                                            it was too slippery; and when she had tired herself out with trying, the\\n                                            poor little thing sat down and cried.<\\/p><p>\\\"Come, there\'s\\n                                            no use in crying like that!\\\" said Alice to herself, rather sharply.\\n                                            \\\"I advise you to leave off this minute!\\\" She generally gave\\n                                            herself very good advice (though she very seldom followed it), and sometimes\\n                                            she scolded herself so severely as to bring tears into her eyes; and once\\n                                            she remembered trying to box her own ears for having cheated herself in a\\n                                            game of croquet she was playing against herself, for this curious child was\\n                                            very fond of pretending to be two people. \\\"But it\'s no use now,\\\"\\n                                            thought poor Alice, \\\"to pretend to be two people! Why there\'s hardly\\n                                            enough of me left to make one respectable person!\\\"<\\/p><p>Soon\\n                                            her eye fell on a little glass box that was lying under the table: she\\n                                            opened it, and found in it a very small cake, on which the words \\\"EAT\\n                                            ME\\\" were beautifully marked in currants. \\\"Well, I\'ll eat it,\\\"\\n                                            said Alice, \\\"and if it makes me grow larger, I can reach the key; and\\n                                            if it makes me grow smaller, I can creep under the door; so either way I\'ll\\n                                            get into the garden, and I don\'t care which happens!\\\"<\\/p><p>She\\n                                            ate a little bit, and said anxiously to herself, \\\"Which way? Which way?\\\"\\n                                            holding her hand on the top of her head to feel which way it was growing,\\n                                            and she was quite surprised to find that she remained the same size; to be\\n                                            sure, this is what generally happens when one eats cake, but Alice had got\\n                                            so much into the way of expecting nothing but out-of-the-way things to\\n                                            happen, that it seemed quite dull and stupid for life to go on in the common\\n                                            way.<\\/p><p>So she set to work, and very soon finished off the\\n                                            cake.<\\/p>\"\n}', 'Neos.Demo:Content.Text', 0, 0, NULL, NULL, 0, '{}', 4, '/sites/neosdemo/the-book/i-down-the-rabbit-hole/main', '4ba65c4e494aa001b882666de7e383f5', '4f534b1eb0c1a785da31e681fb5e91ff', '{\n    \"language\": {\n        \"0\": \"en_US\"\n    }\n}', '6dc0420ef1be73a86cec22fc50373d09', NULL, '2015-04-26 19:43:11', '2019-02-25 17:10:06', NULL),
('4cea7f01-b542-4db8-8e21-d5e9e15de82d', 'live', NULL, '/sites/neosdemo/features/other-elements/main/node53a18f52e9726', '0c252a29-4e18-a4e6-adf7-acc272a4f41d', 100, '{\n    \"title\": \"<h1>Other elements<\\/h1>\"\n}', 'Neos.Demo:Content.Headline', 0, 0, NULL, NULL, 0, '{}', 4, '/sites/neosdemo/features/other-elements/main', '5e392ad1a9856d04e2275063e4a70e6b', '4f534b1eb0c1a785da31e681fb5e91ff', '{\n    \"language\": {\n        \"0\": \"en_US\"\n    }\n}', 'e56bd19d773407ec7b49a0235898e7a2', NULL, '2015-04-26 19:43:11', '2019-02-25 17:10:06', NULL),
('4d23204f-a101-4dc8-8931-940199ab0207', 'live', NULL, '/sites/neosdemo/features/main/node524d971adfa12/column0/node524dac43689e7', '8ce8529b-6ae9-0420-f58b-c2f7e18527ec', 200, '{\n    \"text\": \"<p>\\n                                                <\\/p><p>While Neos still stores its data in a relational\\n                                                database, you won\'t access this directly when working with content.\\n                                                Instead, we\'re using a tree-based approach of storing content which we\\n                                                call the Neos Content Repository (CR). This tree enables you to not only\\n                                                structure your content using a page tree, but also nest content into\\n                                                other content in a page.<\\/p><p>Furthermore, the Content\\n                                                Repository allows you to easily create new content elements, just using\\n                                                a Fluid Template, one line of Fusion Code and a few lines of\\n                                                configuration.<\\/p>\"\n}', 'Neos.Demo:Content.Text', 0, 0, NULL, NULL, 0, '{}', 5, '/sites/neosdemo/features/main/node524d971adfa12/column0', '66505416f8c1771226ff8cd2955a7565', '4f534b1eb0c1a785da31e681fb5e91ff', '{\n    \"language\": {\n        \"0\": \"en_US\"\n    }\n}', 'b0b5eae530eca7c6ef2e6c446127f674', NULL, '2015-04-26 19:43:11', '2019-02-25 17:10:06', NULL),
('4db1c190-78a6-41a1-96d8-ffe381d0e1d2', 'live', NULL, '/sites/neosdemo/main/node-trhl1ft3gf3ju/column2/node-r11ph6m5dcj5o', '9c353994-e282-4af6-a516-da0428758068', 100, '{\n    \"text\": \"<p>jeden Donnerstag ab 14:00 Uhr<\\/p>\",\n    \"caption\": \"\",\n    \"image\": {\n        \"__flow_object_type\": \"Neos\\\\Media\\\\Domain\\\\Model\\\\Image\",\n        \"__identifier\": \"60a2bbb0-a1b8-4d7e-8f55-5bffb0078879\"\n    },\n    \"linkTarget\": true,\n    \"link\": \"#\",\n    \"title\": \"<h3>Elisabethinen<\\/h3>\"\n}', 'Neos.Demo:Content.TextWithImageGruppe', 0, 0, NULL, NULL, 0, '{}', 4, '/sites/neosdemo/main/node-trhl1ft3gf3ju/column2', '44701f107320254ee0a3b75f479e72a5', '4f534b1eb0c1a785da31e681fb5e91ff', '{\n    \"language\": {\n        \"0\": \"en_US\"\n    }\n}', 'df338db6bcf00b742180fdf35a5af6e3', NULL, '2022-09-21 14:03:11', '2022-09-21 14:04:33', '2022-09-21 14:04:32'),
('4e1c4d67-092b-4cab-acac-aff06b666d28', 'live', NULL, '/sites/neosdemo/try-me/main', 'ae7708fa-385d-6a5b-8fe1-6d3e3687fa6d', 100, '{}', 'Neos.Demo:Collection.Content.Main', 0, 0, NULL, NULL, 0, '{}', 5, '/sites/neosdemo/try-me', '9bfb8e9e572cca52d75639b7c17a9e71', '4f534b1eb0c1a785da31e681fb5e91ff', '{\n    \"language\": {\n        \"0\": \"en_US\"\n    }\n}', '115bd297c5321c82bde817637869c434', NULL, '2015-04-26 19:43:12', '2019-02-04 21:20:46', NULL),
('4e2517b8-9f2d-47ed-bc15-1538379df223', 'live', NULL, '/sites/neosdemo/try-me/teaser', '81d761f6-d254-6ba8-8dc1-35c2169a32f4', 200, '{}', 'Neos.Demo:Collection.Content.Teaser', 0, 0, NULL, NULL, 0, '{}', 4, '/sites/neosdemo/try-me', '9a7a82824558c79c05f358271e68708f', '4f534b1eb0c1a785da31e681fb5e91ff', '{\n    \"language\": {\n        \"0\": \"en_US\"\n    }\n}', '115bd297c5321c82bde817637869c434', NULL, '2015-04-26 19:43:12', '2019-02-04 21:20:09', NULL);
