('4efea953-030e-479d-b75b-2213f2fc2ca0', 'live', NULL, '/sites/neosdemo/main/node-i85lwfh1f7qxf/column2', '0c117422-e6f3-7424-a08b-85d196e11d58', 300, '{}', 'Neos.Demo:Collection.Content.Column', 0, 0, NULL, NULL, 0, '{}', 2, '/sites/neosdemo/main/node-i85lwfh1f7qxf', '226b3ddd5f0d1bd4eaa60d24c9980d8f', '4f534b1eb0c1a785da31e681fb5e91ff', '{\n    \"language\": {\n        \"0\": \"en_US\"\n    }\n}', 'f1cd3598be66dbf1535ea590388bce05', NULL, '2022-09-21 11:53:18', '2022-09-21 11:57:55', '2022-09-21 11:57:55'),
('4f9db354-329a-46c7-815c-d188d13eaad6', 'live', NULL, '/sites/neosdemo/the-book/vii-a-mad-tea-party', '8454cc34-70ea-bce5-1ce4-a8783333c159', 900, '{\n    \"title\": \"VII. A Mad Tea-party\",\n    \"chapterDescription\": \"There was a table set out under a tree in front of the house, and the March Hare and the Hatter were having tea at it. \",\n    \"chapterImage\": {\n        \"__flow_object_type\": \"Neos\\\\Media\\\\Domain\\\\Model\\\\ImageVariant\",\n        \"__identifier\": \"f3d0fcad-03e0-c72a-4df2-258f7cfff348\"\n    },\n    \"layout\": \"chapter\",\n    \"uriPathSegment\": \"vii-a-mad-tea-party\"\n}', 'Neos.Demo:Document.Chapter', 0, 0, NULL, NULL, 0, '{}', 13, '/sites/neosdemo/the-book', '112e13a5f955505c481cfb4e3457ddac', '4f534b1eb0c1a785da31e681fb5e91ff', '{\n    \"language\": {\n        \"0\": \"en_US\"\n    }\n}', 'ff7170df62e02ccc62f06663a3689785', NULL, '2015-04-26 19:43:12', '2019-09-05 18:12:50', '2019-09-05 18:12:50'),
('4fa96b05-4777-4627-98e7-f60da70adf5a', 'live', NULL, '/sites/neosdemo/main/node-i85lwfh1f7qxf/column3/node-x0zfdmfp4vbpx', '147dd375-ef2b-49a4-b039-3773165ad3b0', 163, '{\n    \"text\": \"<p>Unser Anliegen ist es, Seniorinnen und Senioren ein aktives<\\/p>\"\n}', 'Neos.Demo:Content.Text', 0, 0, NULL, NULL, 0, '{}', 3, '/sites/neosdemo/main/node-i85lwfh1f7qxf/column3', '72f258b76407f0dbda848ddde64c4dc5', '4f534b1eb0c1a785da31e681fb5e91ff', '{\n    \"language\": {\n        \"0\": \"en_US\"\n    }\n}', '2d6482e5c153c60c8910da201879af37', NULL, '2022-09-21 12:02:15', '2022-09-21 12:03:39', '2022-09-21 12:03:38'),
('502a371c-c4d2-421d-ab0c-caf2259ac1f8', 'live', NULL, '/sites/neosdemo/the-book/viii-the-queen-s-croquet-ground/main/node52a3a07348e91', '6d360cc2-35c9-8af4-a931-265dd86ee09f', 100, '{\n    \"text\": \"<p>A LARGE rose-tree stood near the entrance of the\\n                                            garden: the roses growing on it were white, but there were three gardeners\\n                                            at it, busily painting them red. Alice thought this a very curious thing,\\n                                            and she went nearer to watch them, and just as she came up to them she heard\\n                                            one of them say \\\"Look out now, Five! Don\'t go splashing paint over me\\n                                            like that!\\\"<br\\/>\\\"I couldn\'t help it,\\\" said Five, in a\\n                                            sulky tone. \\\"Seven jogged my elbow.\\\"<br\\/><\\/p><p>On\\n                                            which Seven looked up and said, \\\"That\'s right, Five! Always lay the\\n                                            blame on others!\\\"<br\\/><\\/p><p>\\\"You\'d better not\\n                                            talk!\\\" said Five. \\\"I heard the Queen say only yesterday you\\n                                            deserved to be beheaded!\\\"<br\\/><\\/p><p>\\\"What for?\\\"\\n                                            said the one who had first spoken.<br\\/><\\/p><p>\\\"That\'s\\n                                            none of your business, Two!\\\" said Seven.<br\\/><\\/p><p>\\\"Yes,\\n                                            it is his business!\\\" said Five. \\\"And I\'ll tell him—it was for\\n                                            bringing the cook tulip-roots instead of onions.\\\"<br\\/><\\/p><p>Seven\\n                                            flung down his brush, and had just begun \\\"Well, of all the unjust\\n                                            things——\\\" when his eye chanced to fall upon Alice, as she stood\\n                                            watching them, and he checked himself suddenly: the others looked round\\n                                            also, and all of them bowed low.<br\\/><\\/p><p>\\\"Would\\n                                            you tell me,\\\" said Alice, a little timidly, \\\"why you are painting\\n                                            those roses?\\\"<br\\/><\\/p><p>Five and Seven said nothing,\\n                                            but looked at Two. Two began in a low voice, \\\"Why, the fact is, you\\n                                            see, Miss, this here ought to have been a red rose-tree, and we put a white\\n                                            one in by mistake; and if the Queen was to find it out, we should all have\\n                                            our heads cut off, you know. So you see, Miss, we\'re doing our best, afore\\n                                            she comes, to——\\\" At this moment, Five, who had been anxiously looking\\n                                            across the garden, called out \\\"The Queen! The Queen!\\\" and the\\n                                            three gardeners instantly threw themselves flat upon their faces. There was\\n                                            a sound of many footsteps, and Alice looked round, eager to see the Queen.<br\\/><\\/p><p>First\\n                                            came ten soldiers carrying clubs; these were all shaped like the three\\n                                            gardeners, oblong and flat, with their hands and feet at the corners: next\\n                                            the ten courtiers; these were ornamented all over with diamonds, and walked\\n                                            two and two, as the soldiers did. After these came the royal children; there\\n                                            were ten of them, and the little dears came jumping merrily along hand in\\n                                            hand, in couples; they were all ornamented with hearts. Next came the\\n                                            guests, mostly Kings and Queens, and among them Alice recognised the White\\n                                            Rabbit: it was talking in a hurried, nervous manner, smiling at everything\\n                                            that was said, and went by without noticing her. Then followed the Knave of\\n                                            Hearts, carrying the King\'s crown on a crimson velvet cushion; and last of\\n                                            all this grand procession, came THE KING AND QUEEN OF HEARTS.<br\\/><\\/p><p>Alice\\n                                            was rather doubtful whether she ought not to lie down on her face like the\\n                                            three gardeners, but she could not remember ever having heard of such a rule\\n                                            at processions; \\\"and besides, what would be the use of a procession,\\\"\\n                                            thought she, \\\"if people had to lie down upon their faces, so that they\\n                                            couldn\'t see it?\\\" So she stood still where she was, and waited.<br\\/><\\/p><p>When\\n                                            the procession came opposite to Alice, they all stopped and looked at her,\\n                                            and the Queen said severely, \\\"Who is this?\\\" She said it to the\\n                                            Knave of Hearts, who only bowed and smiled in reply.<br\\/><\\/p><p>\\\"Idiot!\\\"\\n                                            said the Queen, tossing her head impatiently; and turning to Alice, she went\\n                                            on, \\\"What\'s your name, child?\\\"<br\\/><\\/p><p>\\\"My\\n                                            name is Alice, so please your Majesty,\\\" said Alice very politely; but\\n                                            she added, to herself, \\\"Why, they\'re only a pack of cards, after all. I\\n                                            needn\'t be afraid of them!\\\"<br\\/><\\/p><p>\\\"And who\\n                                            are these?\\\" said the Queen, pointing to the three gardeners who were\\n                                            lying round the rose-tree; for, you see, as they were lying on their faces,\\n                                            and the pattern on their backs was the same as the rest of the pack, she\\n                                            could not tell whether they were gardeners, or soldiers, or courtiers, or\\n                                            three of her own children.<br\\/><\\/p><p>\\\"How should I\\n                                            know?\\\" said Alice, surprised at her own courage. \\\"It\'s no business\\n                                            of mine.\\\"<br\\/><\\/p><p>The Queen turned crimson with\\n                                            fury, and, after glaring at her for a moment like a wild beast, screamed\\n                                            \\\"Off with her head! Off——\\\"<br\\/><\\/p><p>\\\"Nonsense!\\\"\\n                                            said Alice, very loudly and decidedly, and the Queen was silent.<br\\/><\\/p><p>The\\n                                            King laid his hand upon her arm, and timidly said \\\"Consider\\n                                            my dear: she is only a child!\\\"<br\\/><\\/p><p>The Queen\\n                                            turned angrily away from him, and said to the Knave \\\"Turn them over!\\\"<br\\/><\\/p><p>The\\n                                            Knave did so, very carefully, with one foot.<br\\/><\\/p><p>\\\"Get\\n                                            up!\\\" said the Queen, in a shrill, loud voice, and the three gardeners\\n                                            instantly jumped up, and began bowing to the King, the Queen, the royal\\n                                            children, and everybody else.<br\\/><\\/p><p>\\\"Leave off\\n                                            that!\\\" screamed the Queen. \\\"You make me giddy.\\\" And then,\\n                                            turning to the rose-tree, she went on, \\\"What have you been doing here?\\\"<br\\/><\\/p><p>\\\"May\\n                                            it please your Majesty,\\\" said Two, in a very humble tone, going down on\\n                                            one knee as he spoke, \\\"we were trying——\\\"<\\/p><p>\\\"I\\n                                            see!\\\" said the Queen, who had meanwhile been examining the roses.\\n                                            \\\"Off with their heads!\\\" and the procession moved on, three of the\\n                                            soldiers remaining behind to execute the unfortunate gardeners, who ran to\\n                                            Alice for protection.<br\\/><\\/p><p>\\\"You shan\'t be\\n                                            beheaded!\\\" said Alice, and she put them into a large flower-pot that\\n                                            stood near. The three soldiers wandered about for a minute or two, looking\\n                                            for them, and then quietly marched off after the others.<br\\/><\\/p><p>\\\"Are\\n                                            their heads off?\\\" shouted the Queen.<br\\/><\\/p><p>\\\"Their\\n                                            heads are gone, if it please your Majesty!\\\" the soldiers shouted in\\n                                            reply.<br\\/><\\/p><p>\\\"That\'s right!\\\" shouted the\\n                                            Queen. \\\"Can you play croquet?\\\"<br\\/><\\/p><p>The\\n                                            soldiers were silent, and looked at Alice, as the question was evidently\\n                                            meant for her.<br\\/><\\/p><p>\\\"Yes!\\\" shouted Alice.<br\\/><\\/p><p>\\\"Come\\n                                            on, then!\\\" roared the Queen, and Alice joined the procession, wondering\\n                                            very much what would happen next.<br\\/><\\/p><p>\\\"It\'s—it\'s\\n                                            a very fine day!\\\" said a timid voice at her side. She was walking by\\n                                            the White Rabbit, who was peeping anxiously into her face.<br\\/><\\/p><p>\\\"Very,\\\"\\n                                            said Alice: \\\"——where\'s the Duchess?\\\"<br\\/><\\/p><p>\\\"Hush!\\n                                            Hush!\\\" said the Rabbit in a low hurried tone. He looked anxiously over\\n                                            his shoulder as he spoke, and then raised himself upon tiptoe, put his mouth\\n                                            close to her ear, and whispered \\\"She\'s under sentence of execution.\\\"<br\\/><\\/p><p>\\\"What\\n                                            for?\\\" said Alice.<br\\/><\\/p><p>\\\"Did you say \'What\\n                                            a pity!\'?\\\" the Rabbit asked.<br\\/><\\/p><p>\\\"No, I\\n                                            didn\'t,\\\" said Alice: \\\"I don\'t think it\'s at all a pity. I said\\n                                            \'What for?\'\\\"<br\\/><\\/p><p>\\\"She boxed the Queen\'s\\n                                            ears—\\\" the Rabbit began. Alice gave a little scream of laughter. \\\"Oh,\\n                                            hush!\\\" the Rabbit whispered in a frightened tone. \\\"The Queen will\\n                                            hear you! You see she came rather late, and the Queen said——\\\"<\\/p><p>\\\"Get\\n                                            to your places!\\\" shouted the Queen in a voice of thunder, and people\\n                                            began running about in all directions, tumbling up against each other;\\n                                            however, they got settled down in a minute or two, and the game began. Alice\\n                                            thought she had never seen such a curious croquet-ground in all her life; it\\n                                            was all ridges and furrows; the balls were live hedgehogs, the mallets live\\n                                            flamingoes, and the soldiers had to double themselves up and to stand upon\\n                                            their hands and feet, to make the arches.<br\\/><\\/p><p>The\\n                                            chief difficulty Alice found at first was in managing her flamingo; she\\n                                            succeeded in getting its body tucked away, comfortably enough, under her\\n                                            arm, with its legs hanging down, but generally, just as she had got its neck\\n                                            nicely straightened out, and was going to give the hedgehog a blow with its\\n                                            head, it would twist itself round and look up in her face, with such a\\n                                            puzzled expression that she could not help bursting out laughing: and when\\n                                            she had got its head down, and was going to begin again, it was very\\n                                            provoking to find that the hedgehog had unrolled itself and was in the act\\n                                            of crawling away: besides all this, there was generally a ridge or a furrow\\n                                            in the way wherever she wanted to send the hedgehog to, and, as the\\n                                            doubled-up soldiers were always getting up and walking off to other parts of\\n                                            the ground, Alice soon came to the conclusion that it was a very difficult\\n                                            game indeed.<br\\/><\\/p><p>The players all played at once\\n                                            without waiting for turns, quarrelling all the while, and fighting for the\\n                                            hedgehogs; and in a very short time the Queen was in a furious passion, and\\n                                            went stamping about, and shouting \\\"Off with his head!\\\" or \\\"Off\\n                                            with her head!\\\" about once in a minute.<br\\/><\\/p><p>Alice\\n                                            began to feel very uneasy: to be sure she had\\n                                            not as yet had any dispute with the Queen, but she knew that it might happen\\n                                            any minute, \\\"and then,\\\" thought she, \\\"what would become of\\n                                            me? They\'re dreadfully fond of beheading people here: the great wonder is\\n                                            that there\'s any one left alive!\\\"<br\\/><\\/p><p>She was\\n                                            looking about for some way of escape, and wondering whether she could get\\n                                            away without being seen, when she noticed a curious appearance in the air:\\n                                            it puzzled her very much at first, but, after watching it a minute or two,\\n                                            she made it out to be a grin, and she said to herself \\\"It\'s the\\n                                            Cheshire Cat: now I shall have somebody to talk to.\\\"<br\\/><\\/p><p>\\\"How\\n                                            are you getting on?\\\" said the Cat, as soon as there was mouth enough\\n                                            for it to speak with.<br\\/><\\/p><p>Alice waited till the\\n                                            eyes appeared, and then nodded. \\\"It\'s no use speaking to it,\\\" she\\n                                            thought, \\\"till its ears have come, or at least one of them.\\\" In\\n                                            another minute the whole head appeared, and then Alice put down her\\n                                            flamingo, and began an account of the game, feeling very glad she had some\\n                                            one to listen to her. The Cat seemed to think that there was enough of it\\n                                            now in sight, and no more of it appeared.<br\\/><\\/p><p>\\\"I\\n                                            don\'t think they play at all fairly,\\\" Alice began, in rather a\\n                                            complaining tone, \\\"and they all quarrel so dreadfully one can\'t hear\\n                                            oneself speak—and they don\'t seem to have any rules in particular; at least,\\n                                            if there are, nobody attends to them—and you\'ve no idea how confusing it is\\n                                            all the things being alive; for instance, there\'s the arch I\'ve got to go\\n                                            through next walking about at the other end of the ground—and I should have\\n                                            croqueted the Queen\'s hedgehog just now, only it ran away when it saw mine\\n                                            coming!\\\"<\\/p><p>\\\"How do you like the Queen?\\\" said\\n                                            the Cat in a low voice.<br\\/><\\/p><p>\\\"Not at all,\\\"\\n                                            said Alice: \\\"she\'s so extremely——\\\" Just then she noticed that the\\n                                            Queen was close behind her listening: so she went on, \\\"——likely to win,\\n                                            that it\'s hardly worth while finishing the game.\\\"<br\\/><\\/p><p>The\\n                                            Queen smiled and passed on.<br\\/><\\/p><p>\\\"Who are you\\n                                            talking to?\\\" said the King, coming up to Alice, and looking at the\\n                                            Cat\'s head with great curiosity.<br\\/><\\/p><p>\\\"It\'s a\\n                                            friend of mine—a Cheshire Cat,\\\" said Alice: \\\"allow me to introduce\\n                                            it.\\\"<br\\/><\\/p><p>\\\"I don\'t like the look of it at\\n                                            all,\\\" said the King: \\\"however, it may kiss my hand if it likes.\\\"<br\\/><\\/p><p>\\\"I\'d\\n                                            rather not,\\\" the Cat remarked.<br\\/><\\/p><p>\\\"Don\'t\\n                                            be impertinent,\\\" said the King, \\\"and don\'t look at me like that!\\\"\\n                                            He got behind Alice as he spoke.<br\\/><\\/p><p>\\\"A cat\\n                                            may look at a king,\\\" said Alice. \\\"I\'ve read that in some book, but\\n                                            I don\'t remember where.\\\"<br\\/><\\/p><p>\\\"Well, it\\n                                            must be removed,\\\" said the King very decidedly, and he called to the\\n                                            Queen, who was passing at the moment, \\\"My dear! I wish you would have\\n                                            this cat removed!\\\"<br\\/><\\/p><p>The Queen had only one\\n                                            way of settling all difficulties, great or small. \\\"Off with his head!\\\"\\n                                            she said, without even looking round.<br\\/><\\/p><p>\\\"I\'ll\\n                                            fetch the executioner myself,\\\" said the King eagerly, and he hurried\\n                                            off.<br\\/><\\/p><p>Alice thought she might as well go back\\n                                            and see how the game was going on, as she heard the Queen\'s voice in the\\n                                            distance, screaming with passion. She had already heard her sentence three\\n                                            of the players to be executed for having missed their turns, and she did not\\n                                            like the look of things at all, as the game was in such confusion that she\\n                                            never knew whether it was her turn or not. So she went in search of her\\n                                            hedgehog.<br\\/><\\/p><p>The hedgehog was engaged in a fight\\n                                            with another hedgehog, which seemed to Alice an excellent opportunity for\\n                                            croqueting one of them with the other: the only difficulty was, that her\\n                                            flamingo was gone across to the other side of the garden, where Alice could\\n                                            see it trying in a helpless sort of way to fly up into one of the trees.<br\\/><\\/p><p>By\\n                                            the time she had caught the flamingo and brought it back, the fight was\\n                                            over, and both the hedgehogs were out of sight: \\\"but it doesn\'t matter\\n                                            much,\\\" thought Alice, \\\"as all the arches are gone from this side\\n                                            of the ground.\\\" So she tucked it under her arm, that it might not\\n                                            escape again, and went back for a little more conversation with her friend.<br\\/><\\/p><p>When\\n                                            she got back to the Cheshire Cat, she was surprised to find quite a large\\n                                            crowd collected round it: there was a dispute going on between the\\n                                            executioner, the King, and\\n                                            the Queen, who were all talking at once, while all the rest were quite\\n                                            silent, and looked very uncomfortable.<br\\/><\\/p><p>The\\n                                            moment Alice appeared, she was appealed to by all three to settle the\\n                                            question, and they repeated their arguments to her, though, as they all\\n                                            spoke at once, she found it very hard indeed to make out exactly what they\\n                                            said.<\\/p><p>The executioner\'s argument was, that you couldn\'t\\n                                            cut off a head unless there was a body to cut it off from: that he had never\\n                                            had to do such a thing before, and he wasn\'t going to begin at his time of\\n                                            life.<br\\/><\\/p><p>The King\'s argument was, that anything\\n                                            that had a head could be beheaded, and that you weren\'t to talk nonsense.<br\\/><\\/p><p>The\\n                                            Queen\'s argument was, that if something wasn\'t done about it in less than no\\n                                            time, she\'d have everybody executed all round. (It was this last remark that\\n                                            had made the whole party look so grave and anxious.)<br\\/><\\/p><p>Alice\\n                                            could think of nothing else to say but \\\"It belongs to the Duchess:\\n                                            you\'d better ask her about it.\\\"<br\\/><\\/p><p>\\\"She\'s\\n                                            in prison,\\\" the Queen said to the executioner; \\\"fetch her here.\\\"\\n                                            And the executioner went off like an arrow.<br\\/><\\/p><p>The\\n                                            Cat\'s head began fading away the moment he was gone, and by the time he had\\n                                            come back with the Duchess, it had entirely disappeared; so the King and the\\n                                            executioner ran wildly up and down looking for it, while the rest of the\\n                                            party went back to the game.<br\\/> <\\/p>\"\n}', 'Neos.Demo:Content.Text', 0, 0, NULL, NULL, 0, '{}', 4, '/sites/neosdemo/the-book/viii-the-queen-s-croquet-ground/main', '39d094ee9e3754434353af01e2973591', '4f534b1eb0c1a785da31e681fb5e91ff', '{\n    \"language\": {\n        \"0\": \"en_US\"\n    }\n}', 'cc988e1330bfe4ce9caa521b2b862e0e', NULL, '2015-04-26 19:43:12', '2019-02-25 17:10:06', NULL);
INSERT INTO `neos_contentrepository_domain_model_nodedata` (`persistence_object_identifier`, `workspace`, `contentobjectproxy`, `path`, `identifier`, `sortingindex`, `properties`, `nodetype`, `removed`, `hidden`, `hiddenbeforedatetime`, `hiddenafterdatetime`, `hiddeninindex`, `accessroles`, `version`, `parentpath`, `pathhash`, `dimensionshash`, `dimensionvalues`, `parentpathhash`, `movedto`, `creationdatetime`, `lastmodificationdatetime`, `lastpublicationdatetime`) VALUES
('506d304e-1566-40f7-b278-f54408a53306', 'live', NULL, '/sites/neosdemo/the-book/vi-pig-and-pepper/main/node52a39a3a68eaf', 'd4bd562b-2bdf-17c5-dc62-417c80b828ef', 100, '{\n    \"text\": \"<p>FOR a minute or two she stood looking at the\\n                                            house, and wondering what to do next, when suddenly a footman in livery came\\n                                            running out of the wood—(she considered him to be a footman because he was\\n                                            in livery: otherwise, judging by his face only, she would have called him a\\n                                            fish)—and rapped loudly at the door with his knuckles. It was opened by\\n                                            another footman in livery, with a round face and large eyes like a frog; and\\n                                            both footmen, Alice noticed, had powdered hair that curled all over their\\n                                            heads. She felt very curious to know what it was all about, and crept a\\n                                            little way out of the wood to listen.<br\\/>The Fish-Footman began by\\n                                            producing from under his arm a great letter, nearly as large as himself, and\\n                                            this he handed over to the other, saying, in a solemn tone, \\\"For the\\n                                            Duchess. An invitation from the Queen to play croquet.\\\" The\\n                                            Frog-Footman repeated, in the same solemn tone, only changing the order of\\n                                            the words a little, \\\"From the Queen. An invitation for the Duchess to\\n                                            play croquet.\\\"<br\\/><\\/p><p>Then they both bowed low,\\n                                            and their curls got entangled together.<br\\/><\\/p><p>Alice\\n                                            laughed so much at this, that she had to run back into the wood for fear of\\n                                            their hearing her; and, when she next peeped out, the Fish-Footman was gone,\\n                                            and the other was sitting on the ground near the door, staring stupidly up\\n                                            into the sky.<br\\/><\\/p><p>Alice went timidly up to the door\\n                                            and knocked.<br\\/><\\/p><p>\\\"There\'s no use in knocking,\\\"\\n                                            said the Footman, \\\"and that for two reasons. First, because I\'m on the\\n                                            same side of the door as you are; secondly, because they\'re making such a\\n                                            noise inside, no one could possibly hear you.\\\" And certainly there was\\n                                            a most extraordinary noise going on within—a constant howling and sneezing,\\n                                            and every now and then a great crash, as if a dish or kettle had been broken\\n                                            to pieces.<br\\/><\\/p><p>\\\"Please, then,\\\" said\\n                                            Alice, \\\"how am I to get in?\\\"<br\\/><\\/p><p>\\\"There\\n                                            might be some sense in your knocking,\\\" the Footman went on without\\n                                            attending to her, \\\"if we had the door between us. For instance, if you\\n                                            were inside, you might knock, and I could let you out, you know.\\\" He\\n                                            was looking up into the sky all the time he was speaking, and this Alice\\n                                            thought decidedly uncivil. \\\"But perhaps he can\'t help it,\\\" she\\n                                            said to herself: \\\"his eyes are so very nearly at the top of his head.\\n                                            But at any rate he might answer questions. How am I to get in?\\\" she\\n                                            repeated aloud.<br\\/><\\/p><p>\\\"I shall sit here,\\\"\\n                                            the Footman remarked, \\\"till to-morrow——\\\"<br\\/><\\/p><p>At\\n                                            this moment the door of the house opened, and a large plate came skimming\\n                                            out, straight at the Footman\'s head: it just grazed his nose, and broke to\\n                                            pieces against one of the trees behind him.<br\\/><\\/p><p>\\\"——or\\n                                            next day, maybe,\\\" the Footman continued in the same tone, exactly as if\\n                                            nothing had happened.<br\\/><\\/p><p>\\\"How am I to get in?\\\"\\n                                            asked Alice again in a louder tone.<\\/p><p>\\\"Are you to get\\n                                            in at all?\\\" said the Footman. \\\"That\'s the first question, you\\n                                            know.\\\"<br\\/><\\/p><p>The Footman and Alice<br\\/>It\\n                                            was, no doubt: only Alice did not like to be told so. \\\"It\'s really\\n                                            dreadful,\\\" she muttered to herself, \\\"the way all the creatures\\n                                            argue. It\'s enough to drive one crazy!\\\"<br\\/><\\/p><p>The\\n                                            Footman seemed to consider this a good opportunity for repeating his remark,\\n                                            with variations. \\\"I shall sit here,\\\" he said, \\\"on and off,\\n                                            for days and days.\\\"<br\\/><\\/p><p>\\\"But what am I to\\n                                            do?\\\" said Alice.<br\\/><\\/p><p>\\\"Anything you like,\\\"\\n                                            said the Footman, and began whistling.<br\\/><\\/p><p>\\\"Oh,\\n                                            there\'s no use in talking to him,\\\" said Alice desperately: \\\"he\'s\\n                                            perfectly idiotic!\\\" And she opened the door and went in.<br\\/><\\/p><p>The\\n                                            door led right into a large kitchen, which was full of smoke from one end to\\n                                            the other: the Duchess was sitting on a three-legged stool in the middle,\\n                                            nursing a baby, the cook was leaning over the fire, stirring a large\\n                                            cauldron which seemed to be full of soup.<br\\/><\\/p><p>\\\"There\'s\\n                                            certainly too much pepper in that soup!\\\" Alice said to herself, as well\\n                                            as she could for sneezing.<br\\/><\\/p><p>There was certainly\\n                                            too much of it in the air. Even the Duchess sneezed occasionally; and the\\n                                            baby was sneezing and howling alternately without a moment\'s pause. The only\\n                                            things in the kitchen that did not sneeze, were the cook, and a large cat\\n                                            which was sitting on the hearth and grinning from ear to ear.<br\\/><\\/p><p>\\\"Please\\n                                            would you tell me,\\\" said Alice a little timidly, for she was not quite\\n                                            sure whether it was good manners for her to speak first, \\\"why your cat\\n                                            grins like that?\\\"<br\\/><\\/p><p>\\\"It\'s a Cheshire\\n                                            cat,\\\" said the Duchess, \\\"and that\'s why. Pig!\\\"<br\\/><\\/p><p>She\\n                                            said the last word with such sudden violence that Alice quite jumped; but\\n                                            she saw in another moment that it was addressed to the baby, and not to her,\\n                                            so she took courage, and went on again:<br\\/><\\/p><p>\\\"I\\n                                            didn\'t know that Cheshire cats always grinned; in fact, I didn\'t know that\\n                                            cats could grin.\\\"<br\\/><\\/p><p>\\\"They all can,\\\"\\n                                            said the Duchess; \\\"and most of \'em do.\\\"<br\\/><\\/p><p>\\\"I\\n                                            don\'t know of any that do,\\\" Alice said very politely, feeling quite\\n                                            pleased to have got into a conversation.<br\\/><\\/p><p>\\\"You\\n                                            don\'t know much,\\\" said the Duchess; \\\"and that\'s a fact.\\\"<br\\/><\\/p><p>Alice\\n                                            did not at all like the tone of this remark, and thought it would be as well\\n                                            to introduce some other subject of conversation. While she was trying to fix\\n                                            on one, the cook took the cauldron of soup off the fire, and at once set to\\n                                            work throwing everything within her reach at the Duchess and the baby—the\\n                                            fire-irons came first; then followed a shower of saucepans, plates, and\\n                                            dishes. The Duchess took no notice of them even when they hit her; and the\\n                                            baby was howling so much already, that it was quite impossible to say\\n                                            whether the blows hurt it or not.<br\\/><\\/p><p>\\\"Oh,\\n                                            please mind what you\'re doing!\\\" cried Alice, jumping up and down in an\\n                                            agony of terror. \\\"Oh, there goes his precious nose\\\"; as an\\n                                            unusually large saucepan flew close by it, and very nearly carried it off.<br\\/><br\\/>\\\"If\\n                                            everybody minded their own business,\\\" the Duchess said in a hoarse\\n                                            growl, \\\"the world would go round a deal faster than it does.\\\"<\\/p><p>\\\"Which\\n                                            would not be an advantage,\\\" said Alice, who felt very glad to get an\\n                                            opportunity of showing off a little of her knowledge. \\\"Just think what\\n                                            work it would make with the day and night! You see the earth takes\\n                                            twenty-four hours to turn round on its axis——\\\"<br\\/><\\/p><p>\\\"Talking\\n                                            of axes,\\\" said the Duchess, \\\"chop off her head.\\\"<br\\/><\\/p><p>Alice\\n                                            glanced rather anxiously at the cook, to see if she meant to take the hint;\\n                                            but the cook was busily engaged in stirring the soup, and did not seem to be\\n                                            listening, so she ventured to go on again: \\\"Twenty-four hours, I think;\\n                                            or is it twelve? I——\\\"<br\\/><\\/p><p>\\\"Oh, don\'t\\n                                            bother me,\\\" said the Duchess; \\\"I never could abide figures!\\\"\\n                                            And with that she began nursing her child again, singing a sort of lullaby\\n                                            to it as she did so, and giving it a violent shake at the end of every line:<br\\/><\\/p><p>\\\"Speak\\n                                            roughly to your little boy,<br\\/>And beat him when he sneezes:<br\\/>He\\n                                            only does it to annoy,<br\\/>Because he knows it teases.\\\"<br\\/><\\/p><p>Chorus<br\\/>(In\\n                                            which the cook and the baby joined):<br\\/>\\\"Wow! wow! wow!\\\"<br\\/>While\\n                                            the Duchess sang the second verse of the song, she kept tossing the baby\\n                                            violently up and down, and the poor little thing howled so, that Alice could\\n                                            hardly hear the words:<br\\/><\\/p><p>\\\"I speak severely\\n                                            to my boy,<br\\/>I beat him when he sneezes;<br\\/>For he can\\n                                            thoroughly enjoy<br\\/>The pepper when he pleases!\\\"<br\\/><\\/p><p>Chorus.<br\\/>\\\"Wow!\\n                                            wow! wow!\\\"<br\\/>\\\"Here! you may nurse it a bit if you like!\\\"\\n                                            the Duchess said to Alice, flinging the baby at her as she spoke. \\\"I\\n                                            must go and get ready to play croquet with the Queen,\\\" and she hurried\\n                                            out of the room. The cook threw a frying-pan after her as she went out, but\\n                                            it just missed her.<br\\/><\\/p><p>Alice caught the baby with\\n                                            some difficulty, as it was a queer-shaped little creature, and held out its\\n                                            arms and legs in all directions, \\\"just like a star-fish,\\\" thought\\n                                            Alice. The poor little thing was snorting like a steam-engine when she\\n                                            caught it, and kept doubling itself up and straightening itself out again,\\n                                            so that altogether, for the first minute or two, it was as much as she could\\n                                            do to hold it.<br\\/><\\/p><p>As soon as she had made out the\\n                                            proper way of nursing it, (which was to twist it up into a knot, and then\\n                                            keep tight hold of its right ear and left foot, so as to prevent its undoing\\n                                            itself,) she carried it out into the open air. \\\"If I don\'t take this\\n                                            child away with me,\\\" thought Alice, \\\"they\'re sure to kill it in a\\n                                            day or two: wouldn\'t it be murder to leave it behind?\\\" She said\\n                                            the last words out loud, and the little thing grunted in reply (it had left\\n                                            off sneezing by this time). \\\"Don\'t grunt,\\\" said Alice; \\\"that\'s\\n                                            not at all a proper way of expressing yourself.\\\"<br\\/><\\/p><p>The\\n                                            baby grunted again, and Alice looked very anxiously into its face to see\\n                                            what was the matter with it. There could be no doubt that it had a very\\n                                            turn-up nose, much more like a snout than a real nose; also its eyes were\\n                                            getting extremely small for a baby: altogether Alice did not like the look\\n                                            of the thing at all. \\\"But perhaps it was only sobbing,\\\" she\\n                                            thought, and looked into its eyes again, to see if there were any tears.<br\\/><\\/p><p>No,\\n                                            there were no tears. \\\"If you\'re going to turn into a pig, my dear,\\\"\\n                                            said Alice, seriously, \\\"I\'ll have nothing more to do with you. Mind\\n                                            now!\\\" The poor little thing sobbed again (or grunted, it was impossible\\n                                            to say which), and they went on for some while in silence.<br\\/><\\/p><p>Alice\\n                                            was just beginning to think to herself, \\\"Now, what am I to do with this\\n                                            creature when I get it home?\\\" when it grunted again, so violently, that\\n                                            she looked down into its face in some alarm. This time there could be no\\n                                            mistake about it: it was neither more nor less than a pig, and she felt that\\n                                            it would be quite absurd for her to carry it any further.<br\\/><\\/p><p>So\\n                                            she set the little creature down, and felt quite relieved to see it trot\\n                                            quietly away into the wood. \\\"If it had grown up,\\\" she said to\\n                                            herself, \\\"it would have made a dreadfully ugly child: but it makes\\n                                            rather a handsome pig, I think.\\\" And she began thinking over other\\n                                            children she knew, who might do very well as pigs, and was just saying to\\n                                            herself, \\\"if one only knew the right way to change them——\\\" when\\n                                            she was a little startled by seeing the Cheshire Cat sitting on a bough of a\\n                                            tree a few yards off.<\\/p><p>The Cat only grinned when it saw\\n                                            Alice. It looked good-natured, she thought: still it had very long claws and\\n                                            a great many teeth, so she felt that it ought to be treated with respect.<br\\/><\\/p><p>Cheshire\\n                                            cat in a tree<br\\/>\\\"Cheshire Puss,\\\" she began, rather\\n                                            timidly, as she did not at all know whether it would like the name: however,\\n                                            it only grinned a little wider. \\\"Come, it\'s pleased so far,\\\"\\n                                            thought Alice, and she went on. \\\"Would you tell me, please, which way I\\n                                            ought to go from here?\\\"<br\\/><\\/p><p>\\\"That depends\\n                                            a good deal on where you want to get to,\\\" said the Cat.<br\\/><\\/p><p>\\\"I\\n                                            don\'t much care where——\\\" said Alice.<br\\/><\\/p><p>\\\"Then\\n                                            it doesn\'t matter which way you go,\\\" said the Cat.<br\\/><\\/p><p>\\\"——\\n                                            so long as I get somewhere,\\\" Alice added as an explanation.<br\\/><\\/p><p>\\\"Oh,\\n                                            you\'re sure to do that,\\\" said the Cat, \\\"if you only walk long\\n                                            enough.\\\"<br\\/><\\/p><p>Alice felt that this could not be\\n                                            denied, so she tried another question. \\\"What sort of people live about\\n                                            here?\\\"<br\\/><\\/p><p>\\\"In that direction,\\\" the\\n                                            Cat said, waving its right paw round, \\\"lives a Hatter: and in that\\n                                            direction,\\\" waving the other paw, \\\"lives a March Hare. Visit\\n                                            either you like: they\'re both mad.\\\"<br\\/><\\/p><p>\\\"But\\n                                            I don\'t want to go among mad people,\\\" Alice remarked.<br\\/><\\/p><p>\\\"Oh,\\n                                            you ca\'n\'t help that,\\\" said the Cat: \\\"we\'re all mad here. I\'m mad.\\n                                            You\'re mad.\\\"<br\\/><\\/p><p>\\\"How do you know I\'m\\n                                            mad?\\\" said Alice.<br\\/><\\/p><p>\\\"You must be,\\\"\\n                                            said the Cat, \\\"or you wouldn\'t have come here.\\\"<br\\/><\\/p><p>Alice\\n                                            didn\'t think that proved it at all; however, she went on. \\\"And how do\\n                                            you know that you\'re mad?\\\"<br\\/><\\/p><p>\\\"To begin\\n                                            with,\\\" said the Cat, \\\"a dog\'s not mad. You grant that?\\\"<br\\/><\\/p><p>\\\"I\\n                                            suppose so,\\\" said Alice.<br\\/><\\/p><p>\\\"Well, then,\\\"\\n                                            the Cat went on, \\\"you see a dog growls when it\'s angry, and wags its\\n                                            tail when it\'s pleased. Now I growl when I\'m pleased, and wag my tail when\\n                                            I\'m angry. Therefore I\'m mad.\\\"<br\\/><\\/p><p>\\\"I\\n                                            call it purring, not growling,\\\" said Alice.<br\\/><\\/p><p>\\\"Call\\n                                            it what you like,\\\" said the Cat. \\\"Do you play croquet with the\\n                                            Queen to-day?\\\"<br\\/><\\/p><p>\\\"I should like it very\\n                                            much,\\\" said Alice, \\\"but I haven\'t been invited yet.\\\"<br\\/><\\/p><p>\\\"You\'ll\\n                                            see me there,\\\" said the Cat and vanished.<br\\/><\\/p><p>Alice\\n                                            was not much surprised at this, she was getting so used to queer\\n                                            things happening. While she was looking at the place where it had been, it\\n                                            suddenly appeared again.<\\/p><p>\\\"By-the-bye, what became of\\n                                            the baby?\\\" said the Cat. \\\"I\'d nearly forgotten to ask.\\\"<br\\/><\\/p><p>\\\"It\\n                                            turned into a pig,\\\" Alice quietly said, just as if it had come back in\\n                                            a natural way.<br\\/><\\/p><p>\\\"I thought it would,\\\"\\n                                            said the Cat, and vanished again.<br\\/><\\/p><p>Alice waited\\n                                            a little, half expecting to see it again, but it did not appear, and after a\\n                                            minute or two she walked on in the direction in which the March Hare was\\n                                            said to live. \\\"I\'ve seen hatters before,\\\" she said to herself;\\n                                            \\\"the March Hare will be much the most interesting, and perhaps as this\\n                                            is May, it won\'t be raving mad—at least not so mad as it was in March.\\\"\\n                                            As she said this, she looked up, and there was the Cat again, sitting on the\\n                                            branch of a tree.<br\\/><\\/p><p>\\\"Did you say pig, or\\n                                            fig?\\\" said the Cat.<br\\/><\\/p><p>\\\"I said pig,\\\"\\n                                            replied Alice; \\\"and I wish you wouldn\'t keep appearing and vanishing so\\n                                            suddenly: you make one quite giddy.\\\"<br\\/><\\/p><p>\\\"All\\n                                            right,\\\" said the Cat; and this time it vanished quite slowly, beginning\\n                                            with the end of the tail, and ending with the grin, which remained some time\\n                                            after the rest of it had gone.<br\\/><\\/p><p>\\\"Well! I\'ve\\n                                            often seen a cat without a grin,\\\" thought Alice; \\\"but a grin\\n                                            without a cat! It\'s the most curious thing I ever saw in all my life.\\\"<\\/p><p>She\\n                                            had not gone much farther before she came in sight of the house of the March\\n                                            Hare: she thought it must be the right house, because the chimneys were\\n                                            shaped like ears and the roof was thatched with fur. It was so large a\\n                                            house, that she did not like to go nearer till she had nibbled some more of\\n                                            the left-hand bit of mushroom, and raised herself, to about two feet high:\\n                                            even then she walked up towards it rather timidly, saying to herself, \\\"Suppose\\n                                            it should be raving mad after all! I almost wish I\'d gone to see the Hatter\\n                                            instead!\\\" <\\/p>\"\n}', 'Neos.Demo:Content.Text', 0, 0, NULL, NULL, 0, '{}', 4, '/sites/neosdemo/the-book/vi-pig-and-pepper/main', '37b63726f393faf90c3ecad8e95b90d7', '4f534b1eb0c1a785da31e681fb5e91ff', '{\n    \"language\": {\n        \"0\": \"en_US\"\n    }\n}', '30db9b96eb2a59675bacdfc7cf683cbd', NULL, '2015-04-26 19:43:12', '2019-02-25 17:10:06', NULL),
