('53787a84-55b1-45ff-ad37-ad0847e6f7ce', 'live', NULL, '/sites/neosdemo/the-book/viii-the-queen-s-croquet-ground', '1d776e0d-f564-6a8e-2918-b85602c3de9b', 1000, '{\n    \"layout\": \"chapter\",\n    \"title\": \"VIII. The Queen\'s Croquet-ground\",\n    \"chapterDescription\": \"A large rose-tree stood near the entrance of the garden: the roses growing on it were white, but there were three gardeners at it, busily painting them red. Alice thought this a very curious thing, and she went nearer to watch them, and just as she came up to them she heard one of them say \\\"Look out now, Five! Don\'t go splashing paint over me like that!\\\"\",\n    \"chapterImage\": {\n        \"__flow_object_type\": \"Neos\\\\Media\\\\Domain\\\\Model\\\\ImageVariant\",\n        \"__identifier\": \"1fd75420-91e2-70b2-4f7e-20d0f5900b3c\"\n    },\n    \"uriPathSegment\": \"viii-the-queen-s-croquet-ground\"\n}', 'Neos.Demo:Document.Chapter', 0, 0, NULL, NULL, 0, '{}', 13, '/sites/neosdemo/the-book', 'cd590c1657578492c363a7b5d0a2ec75', '4f534b1eb0c1a785da31e681fb5e91ff', '{\n    \"language\": {\n        \"0\": \"en_US\"\n    }\n}', 'ff7170df62e02ccc62f06663a3689785', NULL, '2015-04-26 19:43:12', '2019-09-05 18:12:50', '2019-09-05 18:12:50'),
