('5dfced1c-a73f-4a79-ab80-d779f91fdf3b', 'live', NULL, '/sites/neosdemo/footer', '037aba4f-10c1-a349-e816-352f11ad2f22', 300, '{}', 'Neos.Demo:Collection.Content.Footer', 0, 0, NULL, NULL, 0, '{}', 14, '/sites/neosdemo', '72445d94e411957ef161b9aa18e630c6', '4f534b1eb0c1a785da31e681fb5e91ff', '{\n    \"language\": {\n        \"0\": \"en_US\"\n    }\n}', 'a5c067917eca93271eb74d257aaf128d', NULL, '2015-04-26 19:43:11', '2022-09-21 09:27:14', '2022-09-21 09:27:14'),
('5f7ace41-924d-44a5-b4f6-1fd1b9c7c476', 'live', NULL, '/sites/neosdemo/features/multiple-columns/main/node524a9d2ab69b0/column0/node524a9d3c133b4', 'c2273444-4cb0-2af8-6fcd-8c0101cf6b47', 100, '{\n    \"text\": \"<p>First it marked out a race-course, in a\\n                                                    sort of circle, (\\\"the exact shape\\n                                                    doesn\'t matter,\\\" it said,) and then all the party were placed\\n                                                    along the\\n                                                    course, here and there. There was no \\\"One, two, three, and\\n                                                    away,\\\" but\\n                                                    they began running when they liked, and left off when they liked, so\\n                                                    that it was\\n                                                    not easy to know when the race was over. However, when they had been\\n                                                    running\\n                                                    half an hour or so, and were quite dry again, the Dodo suddenly\\n                                                    called \\\"The\\n                                                    race is over!\\\" and they all crowded round it, panting, and\\n                                                    asking \\\"But\\n                                                    who has won?\\\"<\\/p>\"\n}', 'Neos.Demo:Content.Text', 0, 0, NULL, NULL, 0, '{}', 5, '/sites/neosdemo/features/multiple-columns/main/node524a9d2ab69b0/column0', '89bd4816f600b1e82d01947de12b480a', '4f534b1eb0c1a785da31e681fb5e91ff', '{\n    \"language\": {\n        \"0\": \"en_US\"\n    }\n}', 'cddd2fe79633b8d93b67f10b8d44f97f', NULL, '2015-04-26 19:43:11', '2019-02-25 17:10:06', NULL),
