('640cecb6-c849-476d-ba70-2a1ef277875b', 'live', NULL, '/sites/neosdemo/features/main/node524d96f6b1348/column0/node524da24645828', 'de9ecb77-46df-02b2-0c71-405c9e6afd5d', 200, '{\n    \"text\": \"<p>\\n                                                <\\/p><p>Neos can easily be extended with plugins, which are\\n                                                just standard packages of Flow with a little extra configuration.  The\\n                                                same works for backend modules. By using convention over configuration,\\n                                                the required settings you need to do boils down to a minimum.<\\/p><p>Of\\n                                                course we know that the there\'s one thing where you need full control:\\n                                                The rendering of your website. In Neos, a custom package called\\n                                                Fusion powers the rendering process, allowing for fine-grained\\n                                                control over the output. No need to override complete templates or hack\\n                                                the source.<\\/p>\"\n}', 'Neos.Demo:Content.Text', 0, 0, NULL, NULL, 0, '{}', 5, '/sites/neosdemo/features/main/node524d96f6b1348/column0', '61a4427e2b3dc742861a0bd48f2e166d', '4f534b1eb0c1a785da31e681fb5e91ff', '{\n    \"language\": {\n        \"0\": \"en_US\"\n    }\n}', '0831c95e7d0104d13bcac740b6e72557', NULL, '2015-04-26 19:43:11', '2019-02-25 17:10:06', NULL),
