('66309576-00d7-4fb0-bbc4-e251f0486001', 'live', NULL, '/sites/neosdemo/features/other-elements/main/node-53a1fc469bc10/column0/node-53a1fd21d6a5c', 'b8585c3b-6e2b-75f1-855e-3d14f042366f', 200, '{\n    \"text\": \"<p>You can add an \'Asset List\' element to\\n                                                    show a list of files that are uploaded to the\\n                                                    server.<\\/p>\"\n}', 'Neos.Demo:Content.Text', 0, 0, NULL, NULL, 0, '{}', 5, '/sites/neosdemo/features/other-elements/main/node-53a1fc469bc10/column0', '7341bc27389a7c280128a2ca5036c16c', '4f534b1eb0c1a785da31e681fb5e91ff', '{\n    \"language\": {\n        \"0\": \"en_US\"\n    }\n}', '6fb01f0c21205794684aaf54a7ca87fd', NULL, '2015-04-26 19:43:11', '2019-02-25 17:10:06', '2015-07-15 09:28:41'),
