('6792856e-19b8-4953-83f2-062e81bec833', 'live', NULL, '/sites/neosdemo/notfound/teaser', 'a0709c7d-2398-d98e-421d-060afb023669', 400, '{}', 'Neos.Demo:Collection.Content.Teaser', 0, 0, NULL, NULL, 0, '{}', 1, '/sites/neosdemo/notfound', '391511fc7542ca8a38969f48e4a53614', '8f21da181f6ce38197fcb78d49f5384e', '{\n    \"language\": {\n        \"0\": \"fr\"\n    }\n}', '6e6f4ac6f8bff45ca67bcaad07e13eea', NULL, '2019-03-22 17:37:13', '2019-03-22 17:37:13', NULL),
