INSERT INTO `neos_contentrepository_domain_model_nodedata` (`persistence_object_identifier`, `workspace`, `contentobjectproxy`, `path`, `identifier`, `sortingindex`, `properties`, `nodetype`, `removed`, `hidden`, `hiddenbeforedatetime`, `hiddenafterdatetime`, `hiddeninindex`, `accessroles`, `version`, `parentpath`, `pathhash`, `dimensionshash`, `dimensionvalues`, `parentpathhash`, `movedto`, `creationdatetime`, `lastmodificationdatetime`, `lastpublicationdatetime`) VALUES
('67e4c480-b167-4575-8a84-e45bde345874', 'live', NULL, '/sites/neosdemo/the-book/ii-the-pool-of-tears/main/node52a3769634249', 'd68180c8-446c-e3c4-074d-9a135eec6b3a', 100, '{\n    \"text\": \"<p>CURIOUSER and curiouser!\\\" cried Alice (she\\n                                            was so much surprised, that for a moment she quite forgot how to speak good\\n                                            English); \\\"now I\'m opening out like the largest telescope that ever\\n                                            was! Good-bye, feet!\\\" (for when she looked down at her feet, they\\n                                            seemed to be almost out of sight, they were getting so far off). \\\"Oh,\\n                                            my poor little feet, I wonder who will put on your shoes and stockings for\\n                                            you now, dears? I\'m sure I sha\'n\'t be able! I shall be a great deal too far\\n                                            off to trouble myself about you: you must manage the best way you can—but I\\n                                            must be kind to them,\\\" thought Alice, \\\"or perhaps they won\'t walk\\n                                            the way I want to go! Let me see: I\'ll give them a new pair of boots every\\n                                            Christmas.\\\"<br\\/>And she went on planning to herself how she would\\n                                            manage it. \\\"They must go by the carrier,\\\" she thought; \\\"and\\n                                            how funny it\'ll seem, sending presents to one\'s own feet! And how odd the\\n                                            directions will look!<\\/p><p>Alice\'s Right Foot, Esq.<br\\/>Hearthrug,<br\\/>near\\n                                            the Fender,<br\\/>(with Alice\'s love).<\\/p><p> Oh dear, what\\n                                            nonsense I\'m talking!\\\"<br\\/>Just then her head struck against the\\n                                            roof of the hall: in fact she was now rather more than nine feet high, and\\n                                            she at once took up the little golden key and hurried off to the garden\\n                                            door.<br\\/><\\/p><p>Poor Alice! It was as much as she could\\n                                            do, lying down on one side, to look through into the garden with one eye;\\n                                            but to get through was more hopeless than ever: she sat down and began to\\n                                            cry again.<br\\/><\\/p><p>\\\"You ought to be ashamed of\\n                                            yourself,\\\" said Alice, \\\"a great girl like you\\\" (she might\\n                                            well say this), \\\"to go on crying in this way! Stop this moment, I tell\\n                                            you!\\\" But she went on all the same, shedding gallons of tears, until\\n                                            there was a large pool all round her, about four inches deep and reaching\\n                                            half down the hall.<br\\/><\\/p><p>Curiouser and Curiouser\\n                                            Curiouser and Curiouser<br\\/>After a time she heard a little pattering\\n                                            of feet in the distance, and she hastily dried her eyes to see what was\\n                                            coming. It was the White Rabbit returning, splendidly dressed, with a pair\\n                                            of white kid gloves in one hand and a large fan in the other: he came\\n                                            trotting along in a great hurry, muttering to himself as he came, \\\"Oh!\\n                                            the Duchess, the Duchess! Oh! won\'t she be savage if I\'ve kept her waiting!\\\"\\n                                            Alice felt so desperate that she was ready to ask help of any one; so, when\\n                                            the Rabbit came near her, she began, in a low, timid voice, \\\"If you\\n                                            please, sir——\\\" The Rabbit started violently, dropped the white kid\\n                                            gloves and the fan, and scurried away into the darkness as hard as he could\\n                                            go.<br\\/><\\/p><p>Alice took up the fan and gloves, and, as\\n                                            the hall was very hot, she kept fanning herself all the time she went on\\n                                            talking! \\\"Dear, dear! How queer everything is to-day! And yesterday\\n                                            things went on just as usual. I wonder if I\'ve been changed during the\\n                                            night? Let me think: was I the same when I got up this morning? I almost\\n                                            think I can remember feeling a little different. But if I\'m not the same,\\n                                            the next question is, who in the world am I? Ah, that\'s the great puzzle!\\\"\\n                                            And she began thinking over all the children she knew that were of the same\\n                                            age as herself, to see if she could have been changed for any of them.<br\\/><\\/p><p>\\\"I\'m\\n                                            sure I\'m not Ada,\\\" she said, \\\"for her hair goes in such long\\n                                            ringlets, and mine doesn\'t go in ringlets at all; and I\'m sure I can\'t be\\n                                            Mabel, for I know all sorts of things, and she, oh! she knows such a very\\n                                            little! Besides, she\'s she, and I\'m I, and—oh dear, how puzzling it all is!\\n                                            I\'ll try if I know all the things I used to know. Let me see: four times\\n                                            five is twelve, and four times six is thirteen, and four times seven is—oh\\n                                            dear! I shall never get to twenty at that rate! However, the Multiplication\\n                                            Table doesn\'t signify: let\'s try Geography. London is the capital of Paris,\\n                                            and Paris is the capital of Rome, and Rome—no, that\'s all wrong, I\'m\\n                                            certain! I must have been changed for Mabel! I\'ll try and say \'How doth the\\n                                            little——\'\\\" and she crossed her hands on her lap as if she were saying\\n                                            lessons, and began to repeat it, but her voice sounded hoarse and strange,\\n                                            and the words did not come the same as they used to do:—<\\/p><p>\\\"How\\n                                            doth the little crocodile<br\\/>Improve his shining tail,<br\\/>And\\n                                            pour the waters of the Nile<br\\/>On every golden scale!<br\\/><\\/p><p>\\\"How\\n                                            cheerfully he seems to grin,<br\\/>How neatly spreads his claws,<br\\/>And\\n                                            welcomes little fishes in,<br\\/>With gently smiling jaws!\\\"<\\/p><p>\\n                                            <\\/p><p>\\\"I\'m sure those are not the right words,\\\" said\\n                                            poor Alice, and her eyes filled with tears again as she went on.\\n                                            \\\"I must be Mabel, after all, and I shall have to go and live in that\\n                                            poky little house, and have next to no toys to play with, and oh! ever so\\n                                            many lessons to learn! No, I\'ve made up my mind about it; if I\'m Mabel, I\'ll\\n                                            stay down here! It\'ll be no use their putting their heads down and saying,\\n                                            \'Come up again, dear!\' I shall only look up and say, \'Who am I then? Tell me\\n                                            that first, and then, if I like being that person, I\'ll come up: if not,\\n                                            I\'ll stay down here till I\'m somebody else\'—but, oh dear!\\\" cried Alice\\n                                            with a sudden burst of tears, \\\"I do wish they would put their heads\\n                                            down! I am so very tired of being all alone here!\\\"<\\/p><p>As\\n                                            she said this she looked down at her hands, and was surprised to see that\\n                                            she had put on one of the Rabbit\'s little white kid gloves while she was\\n                                            talking. \\\"How can I have done that?\\\" she thought. \\\"I must be\\n                                            growing small again.\\\" She got up and went to the table to measure\\n                                            herself by it, and found that, as nearly as she could guess, she was now\\n                                            about two feet high, and was<a><\\/a> going on shrinking rapidly:\\n                                            she soon found out that the cause of this was the fan she was holding, and\\n                                            she dropped it hastily, just in time to avoid shrinking away altogether.<\\/p><p>\\\"That was a\\n                                            narrow escape!\\\" said Alice, a good deal frightened at the sudden\\n                                            change, but very glad to find herself still in existence; \\\"and now for\\n                                            the garden!\\\" and she ran with all speed back to the little door: but\\n                                            alas! the little door was shut again, and the little golden key was lying on\\n                                            the glass table as before, \\\"and things are worse than ever,\\\"\\n                                            thought the poor child, \\\"for I never was so small as this before,\\n                                            never! And I declare it\'s too bad, that it is!\\\"<\\/p><p>As\\n                                            she said these words her foot slipped, and in another moment, splash! she\\n                                            was up to her chin in salt water. Her first idea was that she had somehow\\n                                            fallen into the sea, \\\"and in that case I can go back by railway,\\\"\\n                                            she said to herself. (Alice had been to the seaside once in her life, and\\n                                            had come to the general conclusion, that wherever you go to on the English\\n                                            coast you find a number of bathing machines in the sea, some children\\n                                            digging in the sand with wooden spades, then<a><\\/a> a row of\\n                                            lodging houses, and behind them a railway station.) However, she soon made\\n                                            out that she was in the pool of tears which she had wept when she was nine\\n                                            feet high.<\\/p><p>\\\"I wish I hadn\'t cried so much!\\\" said\\n                                            Alice, as she swam about, trying to find her way out. \\\"I shall be\\n                                            punished for it now, I suppose, by being drowned in my own tears!\\n                                            That will be a queer thing, to be sure! However, everything is queer to-day.\\\"<\\/p><p>Just\\n                                            then she heard something splashing about in the pool a little way off, and\\n                                            she swam nearer to make out what it was: at first she thought it must be a\\n                                            walrus or hippopotamus, but then she remembered how small she was now, and\\n                                            she soon made out that it was only a mouse that had slipped in like herself.<\\/p><p>\\\"Would\\n                                            it be of any use now,\\\" thought Alice, \\\"to speak to this mouse?\\n                                            Everything is so out-of-the-way down here, that I should think very likely\\n                                            it can talk: at any rate, there\'s no harm in trying.\\\" So she began:\\n                                            \\\"O Mouse, do you know the way out of this pool? I am very tired of\\n                                            swimming about here, O Mouse!\\\" (Alice thought this must<a><\\/a>\\n                                            be the right way of speaking to a mouse; she had never done such a thing\\n                                            before, but she remembered having seen in her brother\'s Latin Grammar,\\n                                            \\\"A mouse—of a mouse—to a mouse—a mouse—O mouse!\\\") The Mouse looked\\n                                            at her rather inquisitively, and seemed to her to wink with one of its\\n                                            little eyes, but it said nothing.<\\/p><p>\\\"Perhaps it doesn\'t\\n                                            understand English,\\\" thought Alice; \\\"I daresay it\'s a French\\n                                            mouse, come over with William the Conqueror.\\\" (For, with all her\\n                                            knowledge of history, Alice had no very clear notion how long ago anything\\n                                            had happened.) So she began again: \\\"Où est ma chatte?\\\" which was\\n                                            the first sentence in her French lesson-book. The Mouse gave a sudden leap\\n                                            out of the water, and seemed to quiver all over with fright. \\\"Oh, I beg\\n                                            your pardon!\\\" cried Alice hastily, afraid that she had hurt the poor\\n                                            animal\'s feelings. \\\"I quite forgot you didn\'t like cats.\\\"<\\/p><p>\\\"Not\\n                                            like cats!\\\" cried the Mouse, in a shrill, passionate voice. \\\"Would you like\\n                                            cats if you were me?\\\"<\\/p><p>\\\"Well, perhaps not,\\\"\\n                                            said Alice in a soothing tone: \\\"don\'t be angry about it. And yet<a><\\/a>\\n                                            I wish I could show you our cat Dinah: I think you\'d take a fancy to cats if\\n                                            you could only see her. She is such a dear quiet thing,\\\" Alice went on,\\n                                            half to herself, as she swam lazily about in the pool, \\\"and\\n                                            she sits purring so nicely by the fire, licking her paws and washing her\\n                                            face—and she is such a nice soft thing to nurse—and she\'s such a capital one\\n                                            for catching mice——oh, I beg your pardon!\\\" cried Alice again, for this\\n                                            time the Mouse was bristling all over, and she felt certain it must be\\n                                            really offended. \\\"We won\'t talk about her any more if you\'d rather not.\\\"<\\/p><p>\\\"We,\\n                                            indeed!\\\" cried the Mouse, who was trembling down to the end of his\\n                                            tail. \\\"As if I would talk on such a subject! Our family\\n                                            always hated cats: nasty, low, vulgar things! Don\'t let me hear the name\\n                                            again!\\\"<\\/p><p>\\\"I won\'t indeed!\\\" said Alice, in a\\n                                            great hurry to change the subject of conversation. \\\"Are you—are you\\n                                            fond—of—of dogs?\\\" The Mouse did not answer, so Alice went on eagerly:\\n                                            \\\"There is such a nice little dog near our house I should like to show\\n                                            you! A little bright-eyed terrier, you know, with oh, such long curly brown\\n                                            hair! And it\'ll fetch things when you throw them, and it\'ll sit up and beg\\n                                            for its dinner, and all sorts of things—I can\'t remember half of them—and it\\n                                            belongs to a farmer, you know, and he says it\'s so useful, it\'s worth a\\n                                            hundred pounds! He says it kills all the rats and—oh dear!\\\" cried Alice\\n                                            in a sorrowful tone, \\\"I\'m afraid I\'ve offended it again!\\\" For the\\n                                            Mouse was swimming away from her as hard as it could go, and making quite a\\n                                            commotion in the pool as it went.<br\\/><\\/p><p>So she called\\n                                            softly after it, \\\"Mouse dear! Do come back again, and we won\'t talk\\n                                            about cats or dogs either, if you don\'t like them!\\\"<br\\/><\\/p><p>When\\n                                            the Mouse heard this, it turned round and swam slowly back to her: its face\\n                                            was quite pale (with passion, Alice thought), and it said in a low trembling\\n                                            voice, \\\"Let us get to the shore, and then I\'ll tell you my history, and\\n                                            you\'ll understand why it is I hate cats and dogs.\\\"<br\\/><\\/p><p>It\\n                                            was high time to go, for the pool was getting quite crowded with the birds\\n                                            and animals that had fallen into it: there were a Duck and a Dodo, a Lory\\n                                            and an Eaglet, and several other curious creatures. Alice led the way, and\\n                                            the whole party swam to the shore.<br\\/> <\\/p>\"\n}', 'Neos.Demo:Content.Text', 0, 0, NULL, NULL, 0, '{}', 4, '/sites/neosdemo/the-book/ii-the-pool-of-tears/main', '59bebb223313a59eb4fbadd56fb6cfe5', '4f534b1eb0c1a785da31e681fb5e91ff', '{\n    \"language\": {\n        \"0\": \"en_US\"\n    }\n}', 'bb897c1e523648c82918c7186f0c65cb', NULL, '2015-04-26 19:43:11', '2019-02-25 17:10:06', NULL),
('68259a9e-4d94-4ff2-9f82-03ae7f2b9384', 'live', NULL, '/sites/neosdemo/notfound/main', '1f9645bb-53ba-ab52-43ef-e42e8dd57ff2', 900, '{}', 'Neos.Demo:Collection.Content.Main', 0, 0, NULL, NULL, 0, '{}', 1, '/sites/neosdemo/notfound', '743ddbeb2c960ff2aa50346dc0ecfe7b', '74fef9b79f12e578c9e7af76f2ed7aaa', '{\n    \"language\": {\n        \"0\": \"lv\"\n    }\n}', '6e6f4ac6f8bff45ca67bcaad07e13eea', NULL, '2019-03-22 17:37:13', '2019-03-22 17:37:13', NULL),
('68801753-ea76-4b96-951a-aaa4b2dd63bd', 'live', NULL, '/sites/neosdemo/features/imagetext/main/node524c186f12740/column2', '58b9a4a7-03d3-229e-c15d-5485f582c7c1', 300, '{}', 'Neos.Demo:Collection.Content.Column', 0, 0, NULL, NULL, 0, '{}', 6, '/sites/neosdemo/features/imagetext/main/node524c186f12740', 'f43534bdfaf48dce259d0d0e157d9b2f', '4f534b1eb0c1a785da31e681fb5e91ff', '{\n    \"language\": {\n        \"0\": \"en_US\"\n    }\n}', '036667df677942db27a2f99b46877d5c', NULL, '2015-04-26 19:43:11', '2019-03-08 09:29:18', NULL),
('68fc9ab4-c016-4cc1-9cfd-b094078a2fa0', 'live', NULL, '/sites/neosdemo/the-book/iii-a-caucus-race-and-a-long-tale/main/node52a378165cec3', 'c0f1e17e-2fb6-08e2-21fb-ad3a1dfbe9df', 100, '{\n    \"text\": \"<p>T HEY were indeed a queer-looking party that\\n                                            assembled on the bank—the birds with draggled feathers, the animals with\\n                                            their fur clinging close to them, and all dripping wet, cross, and\\n                                            uncomfortable.<br\\/>The first question of course was, how to get dry\\n                                            again: they had a consultation about this, and after a few minutes it seemed\\n                                            quite natural to Alice to find herself talking familiarly with them, as if\\n                                            she had known them all her life. Indeed, she had quite a long argument with\\n                                            the Lory, who at last turned sulky, and would only say, \\\"I am older\\n                                            than you, and must know better;\\\" and this Alice would not allow without\\n                                            knowing how old it was, and, as the Lory positively refused to tell its age,\\n                                            there was no more to be said.<br\\/><\\/p><p>At last the\\n                                            Mouse, who seemed to be a person of authority among them, called out \\\"Sit\\n                                            down, all of you, and listen to me! I\'ll soon make you dry enough!\\\"\\n                                            They all sat down at once, in a large ring, with the Mouse in the middle.\\n                                            Alice kept her eyes anxiously fixed on it, for she felt sure she would catch\\n                                            a bad cold if she did not get dry very soon.<br\\/><\\/p><p>\\\"Ahem!\\\"\\n                                            said the Mouse with an important air. \\\"Are you all ready? This is the\\n                                            driest thing I know. Silence all round, if you please! \'William the\\n                                            Conqueror, whose cause was favoured by the pope, was soon submitted to by\\n                                            the English, who wanted leaders, and had been of late much accustomed to\\n                                            usurpation and conquest. Edwin and Morcar, the earls of Mercia and\\n                                            Northumbria—\'\\\"<br\\/><\\/p><p>\\\"Ugh!\\\" said the\\n                                            Lory, with a shiver.<br\\/><\\/p><p>\\\"I beg your pardon!\\\"\\n                                            said the Mouse, frowning, but very politely. \\\"Did you speak?\\\"<br\\/><\\/p><p>\\\"Not\\n                                            I!\\\" said the Lory hastily.<br\\/><\\/p><p>\\\"I thought\\n                                            you did,\\\" said the Mouse, \\\"—I proceed. \'Edwin and Morcar, the\\n                                            earls of Mercia and Northumbria, declared for him: and even Stigand, the\\n                                            patriotic Archbishop of Canterbury, found it advisable—\'\\\"<br\\/><\\/p><p>\\\"Found\\n                                            what?\\\" said the Duck.<br\\/><\\/p><p>\\\"Found it,\\\"\\n                                            the Mouse replied rather crossly: \\\"of course you know what \'it\' means.\\\"<br\\/><\\/p><p>\\\"I\\n                                            know what \'it\' means well enough, when I find a thing,\\\" said the Duck;\\n                                            \\\"it\'s generally a frog or a worm. The question is, what did the\\n                                            archbishop find?\\\"<br\\/><\\/p><p>The Mouse did not notice\\n                                            this question, but hurriedly went on, \\\"\'—found it advisable to go with\\n                                            Edgar Atheling to meet William and offer him the crown. William\'s conduct at\\n                                            first was moderate. But the insolence of his Normans—\' How are you getting\\n                                            on now, my dear?\\\" it continued, turning to Alice as it spoke.<br\\/><\\/p><p>\\\"As\\n                                            wet as ever,\\\" said Alice in a melancholy tone; \\\"doesn\'t seem to\\n                                            dry me at all.\\\"<br\\/><\\/p><p>\\\"In that case,\\\"\\n                                            said the Dodo solemnly, rising to its feet, \\\"I move that the meeting\\n                                            adjourn, for the immediate adoption of more energetic remedies——\\\"<br\\/><\\/p><p>\\\"Speak\\n                                            English!\\\" said the Eaglet. \\\"I don\'t know the meaning of half those\\n                                            long words, and, what\'s more, I don\'t believe you do either!\\\" And the\\n                                            Eaglet bent down its head to hide a smile: some of the other birds tittered\\n                                            audibly.<br\\/><\\/p><p>\\\"What I was going to say,\\\"\\n                                            said the Dodo in an offended tone, \\\"was that the best thing to get us\\n                                            dry would be a Caucus-race.\\\"<br\\/><\\/p><p>\\\"What is\\n                                            a Caucus-race?\\\" said Alice; not that she much wanted to know, but the\\n                                            Dodo had paused as if it thought that somebody ought to speak, and no one\\n                                            else seemed inclined to say anything.<br\\/><\\/p><p>\\\"Why,\\\"\\n                                            said the Dodo, \\\"the best way to explain it is to do it.\\\" (And, as\\n                                            you might like to try the thing yourself some winter day, I will tell you\\n                                            how the Dodo managed it.)<br\\/><\\/p><p>First it marked out a\\n                                            race-course, in a sort of circle, (\\\"the exact shape doesn\'t matter,\\\"\\n                                            it said,) and then all the party were placed along the course, here and\\n                                            there. There was no \\\"One, two, three, and away,\\\" but they began\\n                                            running when they liked, and left off when they liked, so that it was not\\n                                            easy to know when the race was over. However, when they had been running\\n                                            half an hour or so, and were quite dry again, the Dodo suddenly called\\n                                            \\\"The race is over!\\\" and they all crowded round it, panting, and\\n                                            asking \\\"But who has won?\\\"<br\\/><\\/p><p>This\\n                                            question the Dodo could not answer without a great deal of thought, and it\\n                                            stood for a long time with one finger pressed upon its forehead (the\\n                                            position in which you usually see Shakespeare, in the pictures of\\n                                            him), while the rest waited in silence. At last the Dodo said \\\"Everybody\\n                                            has won, and all must have prizes.\\\"<br\\/><\\/p><p>\\\"But\\n                                            who is to give the prizes?\\\" quite a chorus of voices asked.<br\\/><\\/p><p>\\\"Why,\\n                                            she, of course,\\\" said the Dodo, pointing to Alice with one finger; and\\n                                            the whole party at once crowded round her, calling out in a confused way,\\n                                            \\\"Prizes! Prizes!\\\"<br\\/><\\/p><p>Alice had no idea\\n                                            what to do, and in despair she put her hand in her pocket, and pulled out a\\n                                            box of comfits (luckily the salt water had not got into it), and handed them\\n                                            round as prizes. There was exactly one apiece all round.<\\/p><p>\\n                                            \\\"But she must have a prize herself, you know,\\\" said the Mouse.<br\\/><\\/p><p>\\\"Of\\n                                            course,\\\" the Dodo replied very gravely.<br\\/><\\/p><p>\\\"What\\n                                            else have you got in your pocket?\\\" it went on, turning to Alice.<br\\/><\\/p><p>\\\"Only\\n                                            a thimble,\\\" said Alice sadly.<br\\/><\\/p><p>\\\"Hand\\n                                            it over here,\\\" said the Dodo.<br\\/><\\/p><p>Then they\\n                                            all crowded round her once more, while the Dodo solemnly presented the\\n                                            thimble, saying \\\"We beg your acceptance of this elegant thimble;\\\"\\n                                            and, when it had finished this short speech, they all cheered.<br\\/><\\/p><p>Alice\\n                                            thought the whole thing very absurd, but they all looked so grave that she\\n                                            did not dare to laugh; and, as she could not think of anything to say, she\\n                                            simply bowed, and took the thimble, looking as solemn as she could.<br\\/><\\/p><p>The\\n                                            next thing was to eat the comfits; this caused some noise and confusion, as\\n                                            the large birds complained that they could not taste theirs, and the small\\n                                            ones choked and had to be patted on the back. However, it was over at last,\\n                                            and they sat down again in a ring, and begged the Mouse to tell them\\n                                            something more.<br\\/><\\/p><p>\\\"You promised to tell me\\n                                            your history, you know,\\\" said Alice, \\\"and why it is you hate—C and\\n                                            D,\\\" she added in a whisper, half afraid that it would be offended\\n                                            again.<\\/p><p><a><\\/a>\\\"Mine is a long and sad\\n                                            tale!\\\" said the Mouse, turning to Alice and sighing.<br\\/><\\/p><p>\\\"It\\n                                            is a long tail, certainly,\\\" said Alice, looking down with wonder at the\\n                                            Mouse\'s tail; \\\"but why do you call it sad?\\\" And she kept on\\n                                            puzzling about it while the Mouse was speaking, so that her idea of the tale\\n                                            was something like this:—<\\/p><p>\\\"Fury said to <br\\/>a\\n                                            mouse, That <br\\/>he met in the <br\\/>house, \'Let <br\\/>us\\n                                            both go <br\\/>to law: I <br\\/>will prose-<br\\/>cute you. —\\n                                            <br\\/>Come, I\'ll <br\\/>take no de-<br\\/>nial: We <br\\/>must\\n                                            have<br\\/>the trial;<br\\/>For really<br\\/>this morn-<br\\/>ing\\n                                            I\'ve<br\\/>nothing<br\\/>to do.\'<br\\/>Said the<br\\/>mouse\\n                                            to<br\\/>the cur,<br\\/>\'Such a<br\\/>trial, dear<br\\/>sir,\\n                                            With<br\\/>no jury<br\\/>or judge,<br\\/>would<br\\/>be\\n                                            wast-<br\\/>ing our<br\\/>breath.\'<br\\/>\'I\'ll be<br\\/>judge,<br\\/>I\'ll\\n                                            be<br\\/>jury,\'<br\\/>said<br\\/>cun-<br\\/>ning<br\\/>old<br\\/>Fury:<br\\/>\'I\'ll<br\\/>try<br\\/>the<br\\/>whole<br\\/>cause,<br\\/>and<br\\/>con-<br\\/>demn<br\\/>you\\n                                            to<br\\/>death.\'<br\\/><\\/p><p>\\\"You are not\\n                                            attending!\\\" said the Mouse to Alice severely. \\\"What are you\\n                                            thinking of?\\\"<br\\/><\\/p><p>\\\"I beg your pardon,\\\"\\n                                            said Alice very humbly: \\\"you had got to the fifth bend, I think?\\\"<br\\/><\\/p><p>\\\"I\\n                                            had not!\\\" cried the Mouse, angrily.<br\\/><\\/p><p>\\\"A\\n                                            knot!\\\" said Alice, always ready to make herself useful, and looking\\n                                            anxiously about her. \\\"Oh, do let me help to undo it!\\\"<br\\/><\\/p><p>\\\"I\\n                                            shall do nothing of the sort,\\\" said the Mouse, getting up and walking\\n                                            away. \\\"You insult me by talking such nonsense!\\\"<br\\/><\\/p><p>\\\"I\\n                                            didn\'t mean it!\\\" pleaded poor Alice. \\\"But you\'re so easily\\n                                            offended, you know!\\\"<br\\/><\\/p><p>The Mouse only\\n                                            growled in reply.<br\\/><\\/p><p>\\\"Please come back and\\n                                            finish your story!\\\" Alice called after it. And the others all joined in\\n                                            chorus, \\\"Yes, please do!\\\" but the Mouse only shook its head\\n                                            impatiently and walked a little quicker.<br\\/><\\/p><p>\\\"What\\n                                            a pity it wouldn\'t stay!\\\" sighed the Lory, as soon as it was quite out\\n                                            of sight; and an old Crab took the opportunity of saying to her daughter,\\n                                            \\\"Ah, my dear! Let this be a lesson to you never to lose your temper!\\\"\\n                                            \\\"Hold your\\n                                            tongue, Ma!\\\" said the young Crab, a little snappishly. \\\"You\'re\\n                                            enough to try the patience of an oyster!\\\"<br\\/><\\/p><p>\\\"I\\n                                            wish I had our Dinah here, I know I do!\\\" said Alice aloud, addressing\\n                                            nobody in particular. \\\"She\'d soon fetch it back!\\\"<br\\/><\\/p><p>\\\"And\\n                                            who is Dinah, if I might venture to ask the question?\\\" said the Lory.<br\\/><\\/p><p>Alice\\n                                            replied eagerly, for she was always ready to talk about her pet: \\\"Dinah\'s\\n                                            our cat. And she\'s such a capital one for catching mice, you ca\'n\'t think!\\n                                            And oh, I wish you could see her after the birds! Why, she\'ll eat a little\\n                                            bird as soon as look at it!\\\"<br\\/><\\/p><p>This speech\\n                                            caused a remarkable sensation among the party. Some of the birds hurried off\\n                                            at once; one old Magpie began wrapping itself up very carefully, remarking\\n                                            \\\"I really must be getting home; the night-air doesn\'t suit my throat!\\\"\\n                                            and a Canary called out in a trembling voice to its children \\\"Come\\n                                            away, my dears! It\'s high time you were all in bed!\\\" On various\\n                                            pretexts they all moved off, and Alice was soon left alone. <\\/p><p>\\\"I\\n                                            wish I hadn\'t mentioned Dinah!\\\" she said to herself in a melancholy\\n                                            tone. \\\"Nobody seems to like her, down here, and I\'m sure she\'s the best\\n                                            cat in the world! Oh, my dear Dinah! I wonder if I shall ever see you any\\n                                            more!\\\" And here poor Alice began to cry again, for she felt very lonely\\n                                            and low-spirited. In a little while, however, she again heard a little\\n                                            pattering of footsteps in the distance, and she looked up eagerly, half\\n                                            hoping that the Mouse had changed his mind, and was coming back to finish\\n                                            his story.<br\\/><\\/p><p> <\\/p><p>\\n                                            <\\/p>\"\n}', 'Neos.Demo:Content.Text', 0, 0, NULL, NULL, 0, '{}', 4, '/sites/neosdemo/the-book/iii-a-caucus-race-and-a-long-tale/main', '542564f79b1045484fe8114549a39a43', '4f534b1eb0c1a785da31e681fb5e91ff', '{\n    \"language\": {\n        \"0\": \"en_US\"\n    }\n}', 'a2a1fe489b0d5f6b6f42e18146aaae42', NULL, '2015-04-26 19:43:11', '2019-02-25 17:10:06', NULL),
