('6ed556ea-dd73-4ed1-8457-cb42dd103e44', 'live', NULL, '/sites/neosdemo', '995c9174-ddd6-4d5c-cfc0-1ffc82184677', 100, '{\n    \"title\": \"Home\",\n    \"uriPathSegment\": \"home\",\n    \"image\": {\n        \"__flow_object_type\": \"Neos\\\\Media\\\\Domain\\\\Model\\\\Image\",\n        \"__identifier\": \"c4464c6a-372a-4800-ac04-497a82700ee4\"\n    },\n    \"imageTitleText\": \"Photo by Mr. Coffee\"\n}', 'Neos.Demo:Document.Homepage', 0, 0, NULL, NULL, 0, '{}', 13, '/sites', 'a5c067917eca93271eb74d257aaf128d', '8f21da181f6ce38197fcb78d49f5384e', '{\n    \"language\": {\n        \"0\": \"fr\"\n    }\n}', 'dbd87ae51cbf5240fea77283585e69d5', NULL, '2015-07-31 19:04:50', '2019-12-14 15:43:34', '2019-12-14 15:43:34'),
