('7824ea8e-8613-4f1f-98bf-64ac5283a2c6', 'live', NULL, '/sites/neosdemo/the-book/iii-a-caucus-race-and-a-long-tale', '8eb77a5d-de92-1889-2eff-8eaf2a1d0bfe', 500, '{\n    \"title\": \"III. A Caucus-race and a Long Tale\",\n    \"chapterDescription\": \"They were indeed a queer-looking party that assembled on the bank—the birds with draggled feathers, the animals with their fur clinging close to them, and all dripping wet, cross, and uncomfortable. \",\n    \"chapterImage\": {\n        \"__flow_object_type\": \"Neos\\\\Media\\\\Domain\\\\Model\\\\ImageVariant\",\n        \"__identifier\": \"310de05c-479b-e16b-dd8e-db1fd4f56d28\"\n    },\n    \"layout\": \"chapter\",\n    \"uriPathSegment\": \"iii-a-caucus-race-and-a-long-tale\"\n}', 'Neos.Demo:Document.Chapter', 0, 0, NULL, NULL, 0, '{}', 13, '/sites/neosdemo/the-book', '29001f792b92e811870d1ef64428cb29', '4f534b1eb0c1a785da31e681fb5e91ff', '{\n    \"language\": {\n        \"0\": \"en_US\"\n    }\n}', 'ff7170df62e02ccc62f06663a3689785', NULL, '2015-04-26 19:43:11', '2019-09-05 18:12:50', '2019-09-05 18:12:50'),
('7a924cb3-d97a-43f9-8572-93ef661ea30c', 'live', NULL, '/sites/neosdemo/features/multiple-columns/main/node5249b021e9b20/column0', 'b4a0c575-a6d6-4c49-e156-453cd1c26b63', 100, '{}', 'Neos.Demo:Collection.Content.Column', 0, 0, NULL, NULL, 0, '{}', 6, '/sites/neosdemo/features/multiple-columns/main/node5249b021e9b20', '35cd0b9db882e09da751d7e5c244976a', '4f534b1eb0c1a785da31e681fb5e91ff', '{\n    \"language\": {\n        \"0\": \"en_US\"\n    }\n}', '8733cc9bf60c18a1a8af0c56970b9ee6', NULL, '2015-04-26 19:43:11', '2019-03-08 09:29:18', NULL),
('7adeb536-7aaf-4224-aede-3c709f66530f', 'live', NULL, '/sites/neosdemo/the-book/x-the-lobster-quadrille', '23f35ab0-0d82-21e7-0006-dd63c5b3dce8', 1200, '{\n    \"layout\": \"chapter\",\n    \"title\": \"X. The Lobster Quadrille\",\n    \"chapterDescription\": \"The Mock Turtle sighed deeply, and drew the back of one flapper across his eyes. He looked at Alice, and tried to speak, but, for a minute or two, sobs choked his voice. \\\"Same as if he had a bone in his throat,\\\" said the Gryphon: and it set to work shaking him and punching him in the back. \",\n    \"chapterImage\": {\n        \"__flow_object_type\": \"Neos\\\\Media\\\\Domain\\\\Model\\\\ImageVariant\",\n        \"__identifier\": \"24ba5744-8475-c519-9dcb-e6ef740bc0d3\"\n    },\n    \"uriPathSegment\": \"x-the-lobster-quadrille\"\n}', 'Neos.Demo:Document.Chapter', 0, 0, NULL, NULL, 0, '{}', 13, '/sites/neosdemo/the-book', '5c5e18c0d2f3de2713fb50738b0d74ed', '4f534b1eb0c1a785da31e681fb5e91ff', '{\n    \"language\": {\n        \"0\": \"en_US\"\n    }\n}', 'ff7170df62e02ccc62f06663a3689785', NULL, '2015-04-26 19:43:12', '2019-09-05 18:12:50', '2019-09-05 18:12:50'),
('7b38ae3f-5d52-48cf-980f-ab81d3f3bee1', 'live', NULL, '/sites/neosdemo/main/node-9wg6sn534bo0w/column0/node-zxxmamobqjwrp', 'e899e52c-48c1-49bb-9d10-5855a462ad53', 150, '{\n    \"text\": \"<p>Wer wir sind? Aktiver Leoben ist ein ehrenamtlich organisierter Verein zur positiven Alltags- und Freizeitgestaltung für ältere Menschen.<br>Was das bedeutet? Unser Anliegen ist es, Seniorinnen und Senioren ein aktives, lebensfrohes und gemeinschaftliches Leben zu ermöglichen. Und das gelingt uns mit Ausflügen, Tagesfahrten, Vorträgen - und natürlich mit unserem wöchentlichen Beisammensein.<\\/p>\"\n}', 'Neos.Demo:Content.Text', 0, 0, NULL, NULL, 0, '{}', 50, '/sites/neosdemo/main/node-9wg6sn534bo0w/column0', '21bed44cdec9f2de7587a85c0584d279', '4f534b1eb0c1a785da31e681fb5e91ff', '{\n    \"language\": {\n        \"0\": \"en_US\"\n    }\n}', 'c9fb414a8c133ebbaf5ffa5cb255968f', NULL, '2022-09-20 15:09:14', '2022-09-20 15:11:34', '2022-09-20 15:11:33'),
