('92077eae-0903-4e56-aeba-81dbbd09b09d', 'live', NULL, '/sites/neosdemo/features/multiple-columns/main/node524a9dc707b81/column0/node524a9e0880aa0', 'bade4900-afef-dc24-698a-77945917ddf1', 100, '{\n    \"text\": \"<p>Alice replied eagerly, for she was always\\n                                                    ready to talk about her pet: \\\"Dinah\'s\\n                                                    our cat. And she\'s such a capital one for catching mice, you ca\'n\'t\\n                                                    think! And\\n                                                    oh, I wish you could see her after the birds! Why, she\'ll eat a\\n                                                    little bird as\\n                                                    soon as look at it!\\\"<\\/p>\"\n}', 'Neos.Demo:Content.Text', 0, 0, NULL, NULL, 0, '{}', 5, '/sites/neosdemo/features/multiple-columns/main/node524a9dc707b81/column0', 'e69ba2641c1d9b8282bef733aa89a234', '4f534b1eb0c1a785da31e681fb5e91ff', '{\n    \"language\": {\n        \"0\": \"en_US\"\n    }\n}', 'c21c2c275dcea37b73efdc2d3ea6cfa0', NULL, '2015-04-26 19:43:11', '2019-02-25 17:10:06', NULL),
