('988e526d-8217-465c-a2cf-e5bbb9ee9849', 'live', NULL, '/sites/neosdemo/features/multiple-columns/main/node524a9d2ab69b0/column1/node524a9df3b6389', '6285ae7b-9e37-58ec-99fc-f637db95318e', 100, '{\n    \"text\": \"<p>This question the Dodo could not answer\\n                                                    without a great deal of thought, and\\n                                                    it stood for a long time with one finger pressed upon its forehead\\n                                                    (the position\\n                                                    in which you usually see Shakespeare, in the pictures of him), while\\n                                                    the rest\\n                                                    waited in silence. At last the Dodo said \\\"Everybody has won,\\n                                                    and all must\\n                                                    have prizes.\\\"<\\/p>\"\n}', 'Neos.Demo:Content.Text', 0, 0, NULL, NULL, 0, '{}', 5, '/sites/neosdemo/features/multiple-columns/main/node524a9d2ab69b0/column1', 'f98acfebc764b9d3d212bd1ad5afc62b', '4f534b1eb0c1a785da31e681fb5e91ff', '{\n    \"language\": {\n        \"0\": \"en_US\"\n    }\n}', '1973e0a32ab1970e7511d49b22dc67f5', NULL, '2015-04-26 19:43:11', '2019-02-25 17:10:06', NULL),
