('ad058570-ac84-4f4d-bc4e-6316e9121184', 'live', NULL, '/sites/neosdemo/the-book/v-advice-from-a-caterpillar', 'a0d4a0f6-bb04-1805-6e43-c76a948383ed', 700, '{\n    \"title\": \"V. Advice from a Caterpillar\",\n    \"chapterDescription\": \"The Caterpillar and Alice looked at each other for some time in silence: at last the Caterpillar took the hookah out of its mouth, and addressed her in a languid, sleepy voice. \",\n    \"chapterImage\": {\n        \"__flow_object_type\": \"Neos\\\\Media\\\\Domain\\\\Model\\\\ImageVariant\",\n        \"__identifier\": \"cddbc6af-2f54-2d43-d0af-810cbd3c8bee\"\n    },\n    \"layout\": \"chapter\",\n    \"uriPathSegment\": \"v-advice-from-a-caterpillar\"\n}', 'Neos.Demo:Document.Chapter', 0, 0, NULL, NULL, 0, '{}', 13, '/sites/neosdemo/the-book', '123d429efaec0e0e4e8108312c938b4a', '4f534b1eb0c1a785da31e681fb5e91ff', '{\n    \"language\": {\n        \"0\": \"en_US\"\n    }\n}', 'ff7170df62e02ccc62f06663a3689785', NULL, '2015-04-26 19:43:12', '2019-09-05 18:12:50', '2019-09-05 18:12:50'),
('ad753f1c-00ce-42c2-baae-31218b23c921', 'live', NULL, '/sites/neosdemo', '995c9174-ddd6-4d5c-cfc0-1ffc82184677', 100, '{\n    \"title\": \"Home\",\n    \"uriPathSegment\": \"home\",\n    \"image\": {\n        \"__flow_object_type\": \"Neos\\\\Media\\\\Domain\\\\Model\\\\Image\",\n        \"__identifier\": \"c4464c6a-372a-4800-ac04-497a82700ee4\"\n    },\n    \"imageTitleText\": \"Photo by Mr. Coffee\"\n}', 'Neos.Demo:Document.Homepage', 0, 0, NULL, NULL, 0, '{}', 15, '/sites', 'a5c067917eca93271eb74d257aaf128d', '00f3cd3ea8f2654d5c7e4c27146b525a', '{\n    \"language\": {\n        \"0\": \"da\"\n    }\n}', 'dbd87ae51cbf5240fea77283585e69d5', NULL, '2015-07-31 18:54:02', '2019-12-14 15:42:44', '2019-12-14 15:42:44'),
('ad8db847-fc9e-419a-95bf-3cadd94b64e9', 'live', NULL, '/sites/neosdemo/the-book/teaser/node52a3147fd7aae', '27bca31b-c966-5b59-2a6a-c681bc4ec23a', 100, '{\n    \"title\": \"<h1>Project Gutenberg\'s Alice\'s Adventures in\\n                                        Wonderland, by Lewis Carroll<\\/h1>\"\n}', 'Neos.Demo:Content.Headline', 0, 0, NULL, NULL, 0, '{}', 4, '/sites/neosdemo/the-book/teaser', 'b117afe6fc5ae417aa31c12c98dc7eb3', '4f534b1eb0c1a785da31e681fb5e91ff', '{\n    \"language\": {\n        \"0\": \"en_US\"\n    }\n}', '172b9b7368364403df056ba15362bb8a', NULL, '2015-04-26 19:43:12', '2019-02-25 17:10:06', NULL),
('aeb27409-7d14-4250-ad79-99251d4fb60b', 'live', NULL, '/sites/neosdemo/the-book/v-advice-from-a-caterpillar/main/node52a37c39c22dd', '0559d0ad-4472-c00e-9ab7-373674afdf3b', 100, '{\n    \"text\": \"<p>THE Caterpillar and Alice looked at each other\\n                                            for some time in silence: at last the Caterpillar took the hookah out of its\\n                                            mouth, and addressed her in a languid, sleepy voice.<br\\/>\\\"Who are\\n                                            you?\\\" said the Caterpillar.<br\\/><\\/p><p>This was not\\n                                            an encouraging opening for a conversation. Alice replied, rather shyly,\\n                                            \\\"I hardly know, sir, just at present—at least I know who I was when I\\n                                            got up this morning, but I think I must have been changed several times\\n                                            since then.\\\"<br\\/><\\/p><p>\\\"What do you mean by\\n                                            that?\\\" said the Caterpillar sternly. \\\"Explain yourself!\\\"<\\/p><p>\\\"I\\n                                            can\'t explain myself, I\'m afraid, sir,\\\" said Alice, \\\"because I\'m\\n                                            not myself, you see.\\\"<br\\/><\\/p><p>\\\"I don\'t see,\\\"\\n                                            said the Caterpillar.<br\\/><\\/p><p>\\\"I\'m afraid I can\'t\\n                                            put it more clearly,\\\" Alice replied very politely, \\\"for I can\'t\\n                                            understand it myself to begin with; and being so many different sizes in a\\n                                            day is very confusing.\\\"<br\\/><\\/p><p>\\\"It isn\'t,\\\"\\n                                            said the Caterpillar.<br\\/><\\/p><p>\\\"Well, perhaps you\\n                                            haven\'t found it so yet,\\\" said Alice, \\\"but when you have to turn\\n                                            into a chrysalis—you will some day, you know—and then after that into a\\n                                            butterfly, I should think you\'ll feel it a little queer, won\'t you?\\\"<br\\/><\\/p><p>\\\"Not\\n                                            a bit,\\\" said the Caterpillar.<br\\/><\\/p><p>\\\"Well,\\n                                            perhaps your feelings may be different,\\\" said Alice; \\\"all I know\\n                                            is, it would feel very queer to me.\\\"<br\\/><\\/p><p>\\\"You!\\\"\\n                                            said the Caterpillar contemptuously. \\\"Who are you?\\\"<br\\/><\\/p><p>Which\\n                                            brought them back again to the beginning of the conversation. Alice felt a\\n                                            little irritated at the Caterpillar\'s making such very short remarks, and\\n                                            she drew herself up and said, very gravely, \\\"I think you ought to tell\\n                                            me who you are, first.\\\"<br\\/><\\/p><p>\\\"Why?\\\"\\n                                            said the Caterpillar.<\\/p><p>Here was another puzzling question;\\n                                            and as Alice could not think of any good reason, and as the Caterpillar\\n                                            seemed to be in a very unpleasant state of mind, she turned away.<br\\/><\\/p><p>\\\"Come\\n                                            back!\\\" the Caterpillar called after her. \\\"I\'ve something important\\n                                            to say!\\\"<br\\/><\\/p><p>This sounded promising,\\n                                            certainly: Alice turned and came back again.<br\\/><\\/p><p>\\\"Keep\\n                                            your temper,\\\" said the Caterpillar.<br\\/><\\/p><p>\\\"Is\\n                                            that all?\\\" said Alice, swallowing down her anger as well as she could.<br\\/><\\/p><p>\\\"No,\\\"\\n                                            said the Caterpillar.<br\\/><\\/p><p>Alice thought she might\\n                                            as well wait, as she had nothing else to do, and perhaps after all it might\\n                                            tell her something worth hearing. For some minutes it puffed away without\\n                                            speaking, but at last it unfolded its arms, took the hookah out of its mouth\\n                                            again, and said, \\\"So you think you\'re changed, do you?\\\"<br\\/><\\/p><p>\\\"I\'m\\n                                            afraid I am, sir,\\\" said Alice; \\\"I can\'t remember things as I\\n                                            used—and I don\'t keep the same size for ten minutes together!\\\"<br\\/><\\/p><p>\\\"Can\'t\\n                                            remember what things?\\\" said the Caterpillar.<br\\/><\\/p><p>\\\"Well,\\n                                            I\'ve tried to say \'How doth the little busy bee,\' but it all came different!\\\"\\n                                            Alice replied in a very melancholy voice.<br\\/><\\/p><p>\\\"Repeat\\n                                            \'You are old, Father William,\'\\\" said the Caterpillar.<br\\/><\\/p><p>Alice\\n                                            folded her hands, and began:—<\\/p><p>\\\"You are old, Father\\n                                            William,\\\" the young man said,<br\\/>\\\"And your hair has become\\n                                            very white;<br\\/>And yet you incessantly stand on your head—<br\\/>Do\\n                                            you think, at your age, it is right?\\\"<br\\/><\\/p><p>\\\"In\\n                                            my youth,\\\" Father William replied to his son,<br\\/>\\\"I feared\\n                                            it might injure the brain;<br\\/>But, now that I\'m perfectly sure I have\\n                                            none,<br\\/>Why, I do it again and again.\\\"<br\\/><\\/p><p>\\\"You\\n                                            are old,\\\" said the youth, \\\"as I mentioned before,<br\\/>And\\n                                            have grown most uncommonly fat;<br\\/>Yet you turned a back-somersault\\n                                            in at the door—<br\\/>Pray, what is the reason of that?\\\"<br\\/><\\/p><p>\\\"In\\n                                            my youth,\\\" said the sage, as he shook his grey locks,<br\\/>\\\"I\\n                                            kept all my limbs very supple<br\\/>By the use of this ointment—one\\n                                            shilling the box—<br\\/>Allow me to sell you a couple?\\\"<br\\/><\\/p><p>\\\"You\\n                                            are old,\\\" said the youth, \\\"and your jaws are too weak<br\\/>For\\n                                            anything tougher than suet;<br\\/>Yet you finished the goose, with\\n                                            the bones and the beak—<br\\/>Pray, how did you manage to do it?\\\"<br\\/><\\/p><p>\\\"In\\n                                            my youth,\\\" said his father, \\\"I took to the law<br\\/>And\\n                                            argued each case with my wife;<br\\/>And the muscular strength, which it\\n                                            gave to my jaw,<br\\/>Has lasted the rest of my life.\\\"<br\\/><\\/p><p>\\\"You\\n                                            are old,\\\" said the youth, \\\"one would hardly suppose<br\\/>That\\n                                            your eye was as steady as ever;<br\\/>Yet you balanced an eel on the end\\n                                            of your nose—<br\\/>What made you so awfully clever?\\\"<br\\/><\\/p><p>\\\"I\\n                                            have answered three questions, and that is enough,\\\"<br\\/>Said his\\n                                            father; \\\"don\'t give yourself airs!<br\\/>Do you think I can listen\\n                                            all day to such stuff?<br\\/>Be off, or I\'ll kick you down stairs!\\\"<\\/p><p>\\\"That\\n                                            is not said right,\\\" said the Caterpillar.<br\\/><\\/p><p>\\\"Not\\n                                            quite right, I\'m afraid,\\\" said Alice, timidly; \\\"some of the words\\n                                            have got altered.\\\"<br\\/><\\/p><p>\\\"It is wrong from\\n                                            beginning to end,\\\" said the Caterpillar, decidedly, and there was\\n                                            silence for some minutes.<br\\/><\\/p><p>The Caterpillar was\\n                                            the first to speak.<br\\/><\\/p><p>\\\"What size do you want\\n                                            to be?\\\" it asked.<br\\/><\\/p><p>\\\"Oh, I\'m not\\n                                            particular as to size,\\\" Alice hastily replied; \\\"only one doesn\'t\\n                                            like changing so often, you know.\\\"<br\\/><\\/p><p>\\\"I\\n                                            don\'t know,\\\" said the Caterpillar.<br\\/><\\/p><p>Alice\\n                                            said nothing: she had never been so much contradicted in all her life\\n                                            before, and she felt that she was losing her temper.<br\\/><\\/p><p>\\\"Are\\n                                            you content now?\\\" said the Caterpillar.<br\\/><\\/p><p>\\\"Well,\\n                                            I should like to be a little larger, sir, if you wouldn\'t mind,\\\" said\\n                                            Alice: \\\"three inches is such a wretched height to be.\\\"<br\\/><\\/p><p>\\\"It\\n                                            is a very good height indeed!\\\" said the Caterpillar angrily, rearing\\n                                            itself upright as it spoke (it was exactly three inches high).<br\\/><\\/p><p>\\\"But\\n                                            I\'m not used to it!\\\" pleaded poor Alice in a piteous tone. And she\\n                                            thought to herself, \\\"I wish the creatures wouldn\'t be so easily\\n                                            offended!\\\"<br\\/><\\/p><p>\\\"You\'ll get used to it in\\n                                            time,\\\" said the Caterpillar; and it put its hookah into its mouth and\\n                                            began smoking again.<br\\/><\\/p><p>This time Alice waited\\n                                            patiently until it chose to speak again. In a minute or two the Caterpillar\\n                                            took the hookah out of its mouth and yawned once or twice, and shook itself.\\n                                            Then it got down off the mushroom, and crawled away into the grass, merely\\n                                            remarking as it went, \\\"One side will make you grow taller, and the\\n                                            other side will make you grow shorter.\\\"<br\\/><\\/p><p>\\\"One\\n                                            side of what? The other side of what?\\\" thought Alice to herself.<br\\/><\\/p><p>\\\"Of\\n                                            the mushroom,\\\" said the Caterpillar, just as if she had asked it aloud;\\n                                            and in another moment it was out of sight.<br\\/><\\/p><p>Alice\\n                                            remained looking thoughtfully at the mushroom for a minute, trying to make\\n                                            out which were the two sides of it; and as it was perfectly round, she found\\n                                            this a very difficult question. However, at last she stretched her arms\\n                                            round it as far as they would go, and broke off a bit of the edge with each\\n                                            hand.<br\\/><\\/p><p>\\\"And now which is which?\\\" she\\n                                            said to herself, and nibbled a little of the right-hand bit to try the\\n                                            effect: the next moment she felt a violent blow underneath her chin: it had\\n                                            struck her foot!<\\/p><p>She was a good deal frightened by this\\n                                            very sudden change, but she felt that there was no time to be lost, as she\\n                                            was shrinking rapidly; so she set to work at once to eat some of the other\\n                                            bit. Her chin was pressed so closely against her foot that there was hardly\\n                                            room to open her mouth; but she did it at last, and managed to swallow a\\n                                            morsel of the left-hand bit.<\\/p><p> \\\"Come, my head\'s free\\n                                            at last!\\\" said Alice in a tone of delight, which changed into alarm in\\n                                            another moment, when she found that her shoulders were nowhere to be found:\\n                                            all she could see, when she looked down, was an immense length of neck,\\n                                            which seemed to rise like a stalk out of a sea of green leaves that lay far\\n                                            below her.<br\\/><\\/p><p>\\\"What can all that green stuff\\n                                            be?\\\" said Alice. \\\"And where have my shoulders got to? And oh, my\\n                                            poor hands, how is it I ca\'n\'t see you?\\\" She was moving them about as\\n                                            she spoke, but no result seemed to follow, except a little shaking among the\\n                                            distant green leaves.<br\\/><\\/p><p>As there seemed to be no\\n                                            chance of getting her hands up to her head, she tried to\\n                                            get her head down to them, and was delighted to find that her neck would\\n                                            bend about easily in any direction, like a serpent. She had just succeeded\\n                                            in curving it down into a graceful zigzag, and was going to dive in among\\n                                            the leaves, which she found to be nothing but the tops of the trees under\\n                                            which she had been wandering, when a sharp hiss made her draw back in a\\n                                            hurry: a large pigeon had flown into her face, and was beating her violently\\n                                            with its wings.<br\\/><\\/p><p>\\\"Serpent!\\\" screamed\\n                                            the Pigeon.<br\\/><\\/p><p>\\\"I\'m not a serpent!\\\" said\\n                                            Alice indignantly. \\\"Let me alone!\\\"<br\\/><\\/p><p>\\\"Serpent,\\n                                            I say again!\\\" repeated the Pigeon, but in a more subdued tone, and\\n                                            added with a kind of a sob, \\\"I\'ve tried every way, and nothing seems to\\n                                            suit them!\\\"<br\\/><\\/p><p>\\\"I haven\'t the least idea\\n                                            what you\'re talking about,\\\" said Alice.<br\\/><\\/p><p>\\\"I\'ve\\n                                            tried the roots of trees, and I\'ve tried banks, and I\'ve tried hedges,\\\"\\n                                            the Pigeon went on, without attending to her; \\\"but those serpents!\\n                                            There\'s no pleasing them!\\\"<br\\/><\\/p><p>Alice was more\\n                                            and more puzzled, but she thought there was no use in saying anything more\\n                                            till the Pigeon had finished.<br\\/><\\/p><p>\\\"As if it\\n                                            wasn\'t trouble enough hatching the eggs,\\\" said the Pigeon; \\\"but I\\n                                            must be on the look-out for serpents night and day! Why, I haven\'t had a\\n                                            wink of sleep these three weeks!\\\"<br\\/><\\/p><p>\\\"I\'m\\n                                            very sorry you\'ve been annoyed,\\\" said Alice, who was beginning to see\\n                                            its meaning.<\\/p><p>\\\"And just as I\'d taken the highest tree\\n                                            in the wood,\\\" continued the Pigeon, raising its voice to a shriek,\\n                                            \\\"and just as I was thinking I should be free of them at last, they must\\n                                            needs come wriggling down from the sky! Ugh, Serpent!\\\"<br\\/><\\/p><p>\\\"But\\n                                            I\'m not a serpent, I tell you!\\\" said Alice. \\\"I\'m a—— I\'m a ——\\\"<br\\/><\\/p><p>\\\"Well!\\n                                            What are you?\\\" said the Pigeon. \\\"I can see you\'re trying to invent\\n                                            something!\\\"<br\\/><\\/p><p>\\\"I—I\'m a little girl,\\\"\\n                                            said Alice, rather doubtfully, as she remembered the number of changes she\\n                                            had gone through that day.<br\\/><\\/p><p>\\\"A likely story\\n                                            indeed!\\\" said the Pigeon in a tone of the deepest contempt. \\\"I\'ve\\n                                            seen a good many little girls in my time, but never one with such a neck as\\n                                            that! No, no! You\'re a serpent; and there\'s no use denying it. I suppose\\n                                            you\'ll be telling me next that you never tasted an egg!\\\"<br\\/><\\/p><p>\\\"I\\n                                            have tasted eggs, certainly,\\\" said Alice, who was a very truthful\\n                                            child; \\\"but little girls eat eggs quite as much as serpents do, you\\n                                            know.\\\"<br\\/><\\/p><p>\\\"I don\'t believe it,\\\"\\n                                            said the Pigeon; \\\"but if they do, why then they\'re a kind of serpent,\\n                                            that\'s all I can say.\\\"<br\\/><\\/p><p>This was such a new\\n                                            idea to Alice, that she was quite silent for a minute or two, which gave the\\n                                            Pigeon the opportunity of adding, \\\"You\'re looking for eggs, I know that\\n                                            well enough; and what does it matter to me whether you\'re a little girl or a\\n                                            serpent?\\\"<br\\/><\\/p><p>\\\"It matters a good deal to\\n                                            me,\\\" said Alice hastily; \\\"but I\'m not looking for eggs, as it\\n                                            happens; and if I was, I shouldn\'t want yours: I don\'t like them raw.\\\"<br\\/><\\/p><p>\\\"Well,\\n                                            be off, then!\\\" said the Pigeon in a sulky tone, as it settled down\\n                                            again into its nest. Alice crouched down among the trees as well as she\\n                                            could, for her neck kept getting entangled among the branches, and every now\\n                                            and then she had to stop and untwist it. After a while she remembered that\\n                                            she still held the pieces of mushroom in her hands, and she set to work very\\n                                            carefully, nibbling first at one and then at the other, and growing\\n                                            sometimes taller and sometimes shorter, until she had succeeded in bringing\\n                                            herself down to her usual height.<\\/p><p>It was so long since she\\n                                            had been anything near the right size, that it felt quite strange at first;\\n                                            but she got used to it in a few minutes, and began talking to herself, as\\n                                            usual. \\\"Come, there\'s half my plan done now! How puzzling all these\\n                                            changes are! I\'m never sure what I\'m going to be, from one minute to\\n                                            another! However, I\'ve got back to my right size: the next thing is, to get\\n                                            into that beautiful garden—how is that to be done, I wonder?\\\" As she\\n                                            said this, she came suddenly upon an open place, with a little house in it\\n                                            about four feet high. \\\"Whoever lives there,\\\" thought Alice, \\\"it\'ll\\n                                            never do to come upon them this size: why, I should frighten them out of\\n                                            their wits!\\\" So she began nibbling at the right-hand bit again, and did\\n                                            not venture to go near the house till she had brought herself down to nine\\n                                            inches high. <\\/p>\"\n}', 'Neos.Demo:Content.Text', 0, 0, NULL, NULL, 0, '{}', 4, '/sites/neosdemo/the-book/v-advice-from-a-caterpillar/main', 'c72d092567f6897a28dd82c0a8e4104f', '4f534b1eb0c1a785da31e681fb5e91ff', '{\n    \"language\": {\n        \"0\": \"en_US\"\n    }\n}', 'bf5113c35b32c99d816edfa78c42fd8b', NULL, '2015-04-26 19:43:12', '2019-02-25 17:10:06', NULL),
