('c3344f20-8049-4b6e-a4f5-f6b3a8eb5069', 'live', NULL, '/sites/neosdemo/the-book/xii-alice-s-evidence', 'f1fbb253-1851-805a-c2fa-f4692458faeb', 1400, '{\n    \"layout\": \"chapter\",\n    \"title\": \"XII. Alice\'s Evidence\",\n    \"chapterDescription\": \"\\\"There!\\\" cried Alice, quite forgetting in the flurry of the moment how large she had grown in the last few minutes, and she jumped up in such a hurry that she tipped over the jury-box with the edge of her skirt, upsetting all the jurymen on to the heads of the crowd below, and there they lay sprawling about, ... \",\n    \"chapterImage\": {\n        \"__flow_object_type\": \"Neos\\\\Media\\\\Domain\\\\Model\\\\ImageVariant\",\n        \"__identifier\": \"e4abd49b-c36b-7892-d0f4-a8441b799b85\"\n    },\n    \"uriPathSegment\": \"xii-alice-s-evidence\"\n}', 'Neos.Demo:Document.Chapter', 0, 0, NULL, NULL, 0, '{}', 13, '/sites/neosdemo/the-book', '9dae1fa4629a41042fab2971fc1a461c', '4f534b1eb0c1a785da31e681fb5e91ff', '{\n    \"language\": {\n        \"0\": \"en_US\"\n    }\n}', 'ff7170df62e02ccc62f06663a3689785', NULL, '2015-04-26 19:43:12', '2019-09-05 18:12:47', '2019-09-05 18:12:47'),
('c376fe44-c222-4cc5-90f3-9dd7aced3ea3', 'live', NULL, '/sites/neosdemo/the-book/vi-pig-and-pepper', '65179278-97cc-7794-4182-5a80ab6f1bc9', 800, '{\n    \"title\": \"VI. Pig and Pepper\",\n    \"chapterDescription\": \"For a minute or two she stood looking at the house, and wondering what to do next, when suddenly a footman in livery came running out of the wood—(she considered him to be a footman because he was in livery: otherwise, judging by his face only, she would have called him a fish)—and rapped loudly at the door with his knuckles. \",\n    \"chapterImage\": {\n        \"__flow_object_type\": \"Neos\\\\Media\\\\Domain\\\\Model\\\\ImageVariant\",\n        \"__identifier\": \"cc7a55e2-70f2-4a73-4856-07e9db6734b1\"\n    },\n    \"layout\": \"chapter\",\n    \"uriPathSegment\": \"vi-pig-and-pepper\"\n}', 'Neos.Demo:Document.Chapter', 0, 0, NULL, NULL, 0, '{}', 13, '/sites/neosdemo/the-book', 'f0a82e9707546cfec8bebff802be72ac', '4f534b1eb0c1a785da31e681fb5e91ff', '{\n    \"language\": {\n        \"0\": \"en_US\"\n    }\n}', 'ff7170df62e02ccc62f06663a3689785', NULL, '2015-04-26 19:43:12', '2019-09-05 18:12:50', '2019-09-05 18:12:50'),
