('c868e81f-c85b-4bcd-af17-9782bb583daf', 'live', NULL, '/sites/neosdemo/features/imagetext/main/node524c21d53285a/column0/node524c21dc90666', '5a085bc7-5c51-39c8-62d8-90d079200f9c', 100, '{\n    \"caption\": \"<p><br\\/><\\/p>\",\n    \"text\": \"<p>\\n                                                    <\\/p><p>Either the well was very deep, or she fell very\\n                                                    slowly, for she had plenty of time as she went down to look about\\n                                                    her, and to wonder what was going to happen next. First, she tried\\n                                                    to look down and make out what she was coming to, but it was too\\n                                                    dark to see anything; then she looked at the sides of the well and\\n                                                    noticed that they were filled with cupboards and book-shelves: here\\n                                                    and there she saw maps and pictures hung upon pegs. She took down a\\n                                                    jar from one of the shelves as she passed; it was labelled \\\"ORANGE\\n                                                    MARMALADE,\\\" but to her disappointment it was empty; she did not\\n                                                    like to drop the jar for fear of killing somebody underneath, so\\n                                                    managed to put it into one of the cupboards as she fell past it.\\n                                                    <\\/p>\",\n    \"image\": {\n        \"__flow_object_type\": \"Neos\\\\Media\\\\Domain\\\\Model\\\\ImageVariant\",\n        \"__identifier\": \"f1aed746-643b-74f4-c4e9-02a52e889f08\"\n    }\n}', 'Neos.Demo:Content.TextWithImage', 0, 0, NULL, NULL, 0, '{}', 6, '/sites/neosdemo/features/imagetext/main/node524c21d53285a/column0', '4f9eda143c02890745c48f2fef67ea26', '4f534b1eb0c1a785da31e681fb5e91ff', '{\n    \"language\": {\n        \"0\": \"en_US\"\n    }\n}', '1e97f9ac45c100fe963558a2c6c0202f', NULL, '2015-04-26 19:43:11', '2019-03-08 09:22:04', NULL),
('cf1b64ee-e21c-42f0-ad5b-bb3df55c0a21', 'live', NULL, '/sites/neosdemo/notfound/teaser', 'a0709c7d-2398-d98e-421d-060afb023669', 600, '{}', 'Neos.Demo:Collection.Content.Teaser', 0, 0, NULL, NULL, 0, '{}', 1, '/sites/neosdemo/notfound', '391511fc7542ca8a38969f48e4a53614', 'e28daf5b04394a7b506534acc0ad491a', '{\n    \"language\": {\n        \"0\": \"nl\"\n    }\n}', '6e6f4ac6f8bff45ca67bcaad07e13eea', NULL, '2019-03-22 17:37:13', '2019-03-22 17:37:13', NULL),
('d293d7dd-498a-44a2-ac56-c4b90f7e285a', 'live', NULL, '/sites/neosdemo/features/main/node524c37db511d4/column2/node524c390fb3cd2', '0143d9ce-d20d-f7ef-39f4-910386f213eb', 200, '{\n    \"text\": \"<p>\\n                                                <\\/p><p>If Neos was a car, <a href=\\\"https:\\/\\/flow.neos.io\\\">Flow<\\/a>\\n                                                were its main engine. It powers many foundational features for building\\n                                                extensible and adjustable web applications of today, such as Dependency\\n                                                Injection, Aspect-Oriented Programming and a unique\\n                                                Model-View-Controller Framework. And best of all: Everything is usable\\n                                                directly in Neos, should you ever need it.<\\/p><p>Flow has\\n                                                first-class support for Domain-Driven Design: It helps you to focus on\\n                                                the problem domain of your customer, shielding you from implementation\\n                                                details until you need them. Worried about form validation, security,\\n                                                file-uploads or logging? All directly built into Flow. Couple that with\\n                                                powerful, composer-based package management and a doctrine-based\\n                                                persistence layer, and you can build on the shoulders of giants.<\\/p><p>You\\n                                                might wonder whether it was worth to develop Flow from scratch. But if\\n                                                you try it out and experience the flow-feeling of development, you will\\n                                                see what we mean with it.<\\/p>\"\n}', 'Neos.Demo:Content.Text', 0, 0, NULL, NULL, 0, '{}', 5, '/sites/neosdemo/features/main/node524c37db511d4/column2', '0cd51880a8f5e28bfeeb477574d51487', '4f534b1eb0c1a785da31e681fb5e91ff', '{\n    \"language\": {\n        \"0\": \"en_US\"\n    }\n}', '45328d9a54395dde0c04b32732c313fc', NULL, '2015-04-26 19:43:11', '2019-02-25 17:10:06', NULL),
('d307d750-7637-47f4-a530-1c7b16f3f51c', 'live', NULL, '/sites/neosdemo/features/imagetext/main/node524c21d53285a', '0e70da10-fc24-6459-19e9-254f76734e1b', 300, '{}', 'Neos.Demo:Content.Columns.Two', 0, 0, NULL, NULL, 0, '{}', 4, '/sites/neosdemo/features/imagetext/main', '60da23720a86846aae922b661087e79f', '4f534b1eb0c1a785da31e681fb5e91ff', '{\n    \"language\": {\n        \"0\": \"en_US\"\n    }\n}', '653e468ba5b5133603a206805c7a987a', NULL, '2015-04-26 19:43:11', '2019-02-25 17:17:22', NULL),
('d4eda9ac-2a80-474e-b887-025bb945957a', 'live', NULL, '/sites/neosdemo/features/main/node524d971adfa12/column1/node524dac66a8765', 'ab9d7e80-ad51-dab9-fbd8-6ead57b061b2', 200, '{\n    \"text\": \"<p>\\n                                                <\\/p><p>Check out the <a href=\\\"node:\\/\\/517ad799-35df-4324-9429-5c75629a8b34\\\">download<\\/a>\\n                                                yourself, and try it out. Make sure to give us some feedback, either on\\n                                                our Mailing Lists or in IRC.<\\/p>\"\n}', 'Neos.Demo:Content.Text', 0, 0, NULL, NULL, 0, '{}', 5, '/sites/neosdemo/features/main/node524d971adfa12/column1', 'd47b851fa4588faf03c5227c548bedde', '4f534b1eb0c1a785da31e681fb5e91ff', '{\n    \"language\": {\n        \"0\": \"en_US\"\n    }\n}', 'eb75d21fe2109eecb17d2d68665cde80', NULL, '2015-04-26 19:43:11', '2019-02-25 17:10:06', NULL),
('d5249c92-6e1f-4b2c-b045-24bf47681f9a', 'live', NULL, '/sites/neosdemo/main/node-9wg6sn534bo0w', '531b9e60-95dd-4c28-af79-f8216f18c414', 200, '{}', 'Neos.Demo:Content.Columns.TwoCenter', 0, 0, NULL, NULL, 0, '{}', 3, '/sites/neosdemo/main', '066c5b6c0cba17d1c79ed67abff2f69a', '4f534b1eb0c1a785da31e681fb5e91ff', '{\n    \"language\": {\n        \"0\": \"en_US\"\n    }\n}', '35390fe0d8755802290753862b2026a5', NULL, '2022-09-20 14:42:20', '2022-09-20 14:54:42', '2022-09-20 14:54:41'),
('d5a752c2-cc0d-4453-a7dc-3d9d9517a58f', 'live', NULL, '/sites/neosdemo/features/frontend-user-login/main/node-5511c91755625', 'a96a1759-3196-33e0-f769-97216b659b0b', 75, '{\n    \"text\": \"<p>This is a simple plugin demonstrating a <strong>Login\\n                                            Form for \\\"Frontend Users\\\".<\\/strong><br\\/>Once logged\\n                                            in, you should be able to access the exemplary <a href=\\\"node:\\/\\/fee74676-c42f-89da-208e-1741a66525d4\\\"\\n                                            data-gentics-aloha-repository=\\\"node-repository\\\"\\n                                            data-gentics-aloha-object-id=\\\"fee74676-c42f-89da-208e-1741a66525d4\\\">Member\\n                                            Area<\\/a>.<br\\/><br\\/>If you installed the demo site\\n                                            yourself, you can create a Frontend User via the command:<\\/p><pre>.\\/flow\\n                                            user:create --authentication-provider \\\"Flowpack.Neos.FrontendLogin:Frontend\\\"\\n                                            --roles \\\"Flowpack.Neos.FrontendLogin:User\\\"<br\\/><\\/pre><p>On\\n                                            our demo installations there is a user setup with a username \\\"<strong>member<\\/strong>\\\"\\n                                            and a password \\\"<strong>password<\\/strong>\\\".<br\\/><strong><br\\/><em>Note:<\\/em><\\/strong><em> In\\n                                            the demo site we use the same User domain model for Frontend and Backend,\\n                                            but the Login\\/Logout plugin is agnostic to the user implementation and you\\n                                            should consider creating a custom User model.<\\/em><\\/p>\"\n}', 'Neos.Demo:Content.Text', 0, 0, NULL, NULL, 0, '{}', 9, '/sites/neosdemo/features/frontend-user-login/main', '520c8147ab632edb8513213ba0f1c6ef', '4f534b1eb0c1a785da31e681fb5e91ff', '{\n    \"language\": {\n        \"0\": \"en_US\"\n    }\n}', '5c7cd6dfd611289bbae0586fc2c29ea7', NULL, '2015-04-30 23:15:00', '2019-02-25 17:10:06', NULL),
('d6213463-993b-4aca-80cb-3e604e247a41', 'live', NULL, '/sites/neosdemo/features/multiple-columns/main/node524a9d2ab69b0/column2', '2d1615d6-f313-1e98-eba1-ba22d288f2ba', 300, '{}', 'Neos.Demo:Collection.Content.Column', 0, 0, NULL, NULL, 0, '{}', 6, '/sites/neosdemo/features/multiple-columns/main/node524a9d2ab69b0', '644854830b787877f7222029e3c29fef', '4f534b1eb0c1a785da31e681fb5e91ff', '{\n    \"language\": {\n        \"0\": \"en_US\"\n    }\n}', 'ddbe20e51667dc55c85eb5623078bb56', NULL, '2015-04-26 19:43:11', '2019-03-08 09:29:18', NULL),
('d6b80b0d-197b-405e-ba5c-ccfaa2df8587', 'live', NULL, '/sites/neosdemo/features/frontend-user-login/teaser', '1559605e-d706-d68f-15cd-27f8d9e28ee3', 200, '{}', 'Neos.Demo:Collection.Content.Teaser', 0, 0, NULL, NULL, 0, '{}', 4, '/sites/neosdemo/features/frontend-user-login', '1e1ee1e478df433a5b177a3135359b11', '4f534b1eb0c1a785da31e681fb5e91ff', '{\n    \"language\": {\n        \"0\": \"en_US\"\n    }\n}', '25085ad3c853743d4898dae825c64d0d', NULL, '2015-04-30 23:15:00', '2019-02-04 21:20:09', NULL),
