('d9773206-5f64-4d01-b7b1-ddc06151072f', 'live', NULL, '/sites/neosdemo/main/node-i85lwfh1f7qxf/column0/node-2vaxcv9ww9mib', '39d2301f-c3bc-4e9d-b620-5db745b2e12a', 150, '{\n    \"title\": \"<h4>Aktiver Kreativer<\\/h4>\"\n}', 'Neos.Demo:Content.Headline', 0, 0, NULL, NULL, 0, '{}', 7, '/sites/neosdemo/main/node-i85lwfh1f7qxf/column0', 'cb04aa407056d14bad6bd35c2796a1d3', '4f534b1eb0c1a785da31e681fb5e91ff', '{\n    \"language\": {\n        \"0\": \"en_US\"\n    }\n}', '9d2152261eeffba3bf5869db44a67413', NULL, '2022-09-21 12:00:49', '2022-09-21 12:03:39', '2022-09-21 12:03:38'),
('da875088-4aa1-4484-8029-b031c6314d89', 'live', NULL, '/sites/neosdemo/the-book', '1ce0d7b3-250c-5254-a94e-cbcaca5534eb', 800, '{\n    \"title\": \"The book\",\n    \"uriPathSegment\": \"the-book\"\n}', 'Neos.Demo:Document.LandingPage', 0, 0, NULL, NULL, 0, '{}', 12, '/sites/neosdemo', 'ff7170df62e02ccc62f06663a3689785', '4f534b1eb0c1a785da31e681fb5e91ff', '{\n    \"language\": {\n        \"0\": \"en_US\"\n    }\n}', 'a5c067917eca93271eb74d257aaf128d', NULL, '2015-04-26 19:43:11', '2019-03-08 09:22:05', NULL),
('dac9665a-263a-4715-bf7c-3bac6485d2b4', 'live', NULL, '/sites/neosdemo/teaser', '7005c7cf-4d19-ce36-0873-476b6cadb71a', 250, '{}', 'Neos.Demo:Collection.Content.Teaser', 0, 0, NULL, NULL, 0, '{}', 2, '/sites/neosdemo', 'e5ea20241ea6bb2b1a36eb13100ce2ac', '0359ed5c416567b8bc2e5ade0f277b36', '{\n    \"language\": {\n        \"0\": \"en_UK\"\n    }\n}', 'a5c067917eca93271eb74d257aaf128d', NULL, '2019-12-14 15:40:12', '2019-12-14 15:40:33', '2019-12-14 15:40:32'),
('dbacb06d-f64d-4f34-8cc0-56264e55a626', 'live', NULL, '/sites/neosdemo/the-book/x-the-lobster-quadrille/main/node52a3a543ad9e2', 'c30d4851-6cc8-03ff-d526-1e5a02025293', 100, '{\n    \"text\": \"<p>THE Mock Turtle sighed deeply, and drew the back\\n                                            of one flapper across his eyes. He looked at Alice, and tried to speak, but,\\n                                            for a minute or two, sobs choked his voice. \\\"Same as if he had a bone\\n                                            in his throat,\\\" said the Gryphon: and it set to work shaking him and\\n                                            punching him in the back. At last the Mock Turtle recovered his voice, and,\\n                                            with tears running down his cheeks, went on again:<br\\/>\\\"You may\\n                                            not have lived much under the sea—\\\" (\\\"I haven\'t,\\\" said Alice)\\n                                            \\\"and perhaps you were never even introduced to a lobster—\\\" (Alice\\n                                            began to say \\\"I once tasted——\\\" but checked herself hastily, and\\n                                            said \\\"No, never,) \\\"—so you can have no idea what a delightful\\n                                            thing a Lobster Quadrille is!\\\"<br\\/><\\/p><p>\\\"No,\\n                                            indeed,\\\" said Alice. \\\"What sort of a dance is it?\\\"<br\\/><\\/p><p>\\\"Why,\\\"\\n                                            said the Gryphon, \\\"you first form into a line along the sea-shore——\\\"<br\\/><\\/p><p>\\\"Two\\n                                            lines!\\\" cried the Mock Turtle. \\\"Seals, turtles, and so on; then,\\n                                            when you\'ve cleared the jelly-fish out of the way——\\\"<br\\/><\\/p><p>\\\"That\\n                                            generally takes some time,\\\" interrupted the Gryphon.<br\\/><\\/p><p>\\\"—you\\n                                            advance twice——\\\"<br\\/><\\/p><p>\\\"Each with a lobster\\n                                            as a partner!\\\" cried the Gryphon.<br\\/><\\/p><p>\\\"Of\\n                                            course,\\\" the Mock Turtle said: \\\"advance twice, set to partners——\\\"<br\\/><\\/p><p>\\\"—change\\n                                            lobsters, and retire in same order,\\\" continued the Gryphon.<br\\/><\\/p><p>\\\"Then,\\n                                            you know,\\\" the Mock Turtle went on, \\\"you throw the——\\\"<br\\/><\\/p><p>\\\"The\\n                                            lobsters!\\\" shouted the Gryphon, with a bound into the air.<br\\/><\\/p><p>\\\"—as\\n                                            far out to sea as you can——\\\"<br\\/><\\/p><p>\\\"Swim,\\n                                            after them!\\\" screamed the Gryphon.<br\\/><\\/p><p>\\\"Turn\\n                                            a somersault in the sea!\\\" cried the Mock Turtle, capering wildly about.<br\\/><\\/p><p>\\\"Change\\n                                            lobsters again!\\\" yelled the Gryphon.<br\\/><\\/p><p>\\\"Back\\n                                            to land again, and—that\'s all the first figure,\\\" said the Mock Turtle,\\n                                            suddenly dropping his voice; and the two creatures, who had been jumping\\n                                            about like mad things all this time, sat down again very sadly and quietly,\\n                                            and looked at Alice.<br\\/><\\/p><p>\\\"It must be a very\\n                                            pretty dance,\\\" said Alice, timidly.<br\\/><\\/p><p>\\\"Would\\n                                            you like to see a little of it?\\\" said the Mock Turtle.<br\\/><\\/p><p>\\\"Very\\n                                            much indeed,\\\" said Alice.<br\\/><\\/p><p>\\\"Come,\\n                                            let\'s try the first figure!\\\" said the Mock Turtle to the Gryphon.\\n                                            \\\"We can do it without lobsters, you know. Which shall sing?\\\"<br\\/><\\/p><p>\\\"Oh,\\n                                            you sing,\\\" said the Gryphon. \\\"I\'ve forgotten the words.\\\"<br\\/><\\/p><p>So\\n                                            they began solemnly dancing round and round Alice, every now and then\\n                                            treading on her toes when they passed too close, and waving their forepaws\\n                                            to mark the time, while the Mock Turtle sang this, very slowly and sadly:—<\\/p><p>\\\"Will\\n                                            you walk a little faster?\\\" said a whiting to a snail,<br\\/>\\\"There\'s\\n                                            a porpoise close behind us, and he\'s treading on my tail.<br\\/>See how\\n                                            eagerly the lobsters and the turtles all advance!<br\\/>They are waiting\\n                                            on the shingle—will you come and join the dance?<br\\/>Will you, won\'t\\n                                            you, will you, won\'t you, will you join the dance?<br\\/>Will you, won\'t\\n                                            you, will you, won\'t you, won\'t you join the dance?<br\\/><\\/p><p>\\\"You\\n                                            can really have no notion how delightful it will be,<br\\/>When they\\n                                            take us up and throw us, with the lobsters, out to sea!\\\"<br\\/>But\\n                                            the snail replied: \\\"Too far, too far!\\\" and gave a look askance—<br\\/>Said\\n                                            he thanked the whiting kindly, but he would not join the dance.<br\\/>Would\\n                                            not, could not, would not, could not, would not join the dance.<br\\/>Would\\n                                            not, could not, would not, could not, could not join the dance.<br\\/><\\/p><p>\\\"What\\n                                            matters it how far we go?\\\" his scaly friend replied;<br\\/>\\\"There\\n                                            is another shore, you know, upon the other side.<br\\/>The further off\\n                                            from England the nearer is to France—<br\\/>Then turn not pale, beloved\\n                                            snail, but come and join the dance.<br\\/>Will you, won\'t you, will you,\\n                                            won\'t you, will you join the dance?<br\\/>Will you, won\'t you, will you,\\n                                            won\'t you, won\'t you join the dance?\\\"<br\\/>\\\"Thank you, it\'s a\\n                                            very interesting dance to watch,\\\" said Alice, feeling very glad that it\\n                                            was over at last: \\\"and I do so like that curious song about the\\n                                            whiting!\\\"<br\\/><\\/p><p>\\\"Oh, as to the whiting,\\\"\\n                                            said the Mock Turtle, \\\"they—you\'ve seen them, of course?\\\"<br\\/><\\/p><p>\\\"Yes,\\\"\\n                                            said Alice, \\\"I\'ve often seen them at dinn——\\\" she checked herself\\n                                            hastily.<br\\/><\\/p><p>\\\"I don\'t know where Dinn may be,\\\"\\n                                            said the Mock Turtle, \\\"but if you\'ve seen them so often, of course you\\n                                            know what they\'re like.\\\"<br\\/><\\/p><p>\\\"I believe\\n                                            so,\\\" Alice replied thoughtfully. \\\"They have their tails in their\\n                                            mouths—and they\'re all over crumbs.\\\"<br\\/><\\/p><p>\\\"You\'re\\n                                            wrong about the crumbs,\\\" said the Mock Turtle: \\\"crumbs would all\\n                                            wash off in the sea. But they have their tails in their mouths; and the\\n                                            reason is—\\\" here the Mock Turtle yawned and shut his eyes. \\\"Tell\\n                                            her about the reason and all that,\\\" he said to the Gryphon.<br\\/><\\/p><p>\\\"The\\n                                            reason is,\\\" said the Gryphon, \\\"that they would go with the\\n                                            lobsters to the dance. So they got thrown out to sea. So they had to fall a\\n                                            long way. So they got their tails fast in their mouths. So they couldn\'t get\\n                                            them out again. That\'s all.\\\"<br\\/><\\/p><p>\\\"Thank\\n                                            you,\\\" said Alice. \\\"It\'s very interesting. I never knew so much\\n                                            about a whiting before.\\\"<br\\/><\\/p><p>\\\"I can tell\\n                                            you more than that, if you like,\\\" said the Gryphon. \\\"Do you know\\n                                            why it\'s called a whiting?\\\"<br\\/><\\/p><p>\\\"I never\\n                                            thought about it,\\\" said Alice. \\\"Why?\\\"<br\\/><\\/p><p>\\\"It\\n                                            does the boots and shoes,\\\" the Gryphon replied very solemnly.<\\/p><p>Alice\\n                                            was thoroughly puzzled. \\\"Does the boots and shoes!\\\" she repeated\\n                                            in a wondering tone.<br\\/><\\/p><p>\\\"Why, what are your\\n                                            shoes done with?\\\" said the Gryphon. \\\"I mean, what makes them so\\n                                            shiny?\\\"<br\\/><\\/p><p>Alice looked down at them, and\\n                                            considered a little before she gave her answer. \\\"They\'re done with\\n                                            blacking, I believe.\\\"<br\\/><\\/p><p>\\\"Boots and\\n                                            shoes under the sea,\\\" the Gryphon went on in a deep voice, \\\"are\\n                                            done with whiting. Now you know.\\\"<br\\/><\\/p><p>\\\"And\\n                                            what are they made of?\\\" Alice asked in a tone of great curiosity.<br\\/><\\/p><p>\\\"Soles\\n                                            and eels, of course,\\\" the Gryphon replied rather impatiently: \\\"any\\n                                            shrimp could have told you that.\\\"<br\\/><\\/p><p>\\\"If\\n                                            I\'d been the whiting,\\\" said Alice, whose thoughts were still running on\\n                                            the song, \\\"I\'d have said to the porpoise, \'Keep back, please: we don\'t\\n                                            want you with us!\'\\\"<br\\/><\\/p><p>\\\"They were\\n                                            obliged to have him with them,\\\" the Mock Turtle said: \\\"no wise\\n                                            fish would go anywhere without a porpoise.\\\"<br\\/><\\/p><p>\\\"Wouldn\'t\\n                                            it really?\\\" said Alice in a tone of great surprise.<br\\/><\\/p><p>\\\"Of\\n                                            course not,\\\" said the Mock Turtle: \\\"why, if a fish came to me, and\\n                                            told me he was going a journey, I should say, \'With what porpoise?\'\\\"<br\\/><\\/p><p>\\\"Don\'t\\n                                            you mean \'purpose\'?\\\" said Alice.<br\\/><\\/p><p>\\\"I\\n                                            mean what I say,\\\" the Mock Turtle replied in an offended tone. And the\\n                                            Gryphon added, \\\"Come, let\'s hear some of your adventures.\\\"<\\/p><p>\\\"I\\n                                            could tell you my adventures—beginning from this morning,\\\" said Alice a\\n                                            little timidly: \\\"but it\'s no use going back to yesterday, because I was\\n                                            a different person then.\\\"<br\\/><\\/p><p>\\\"Explain\\n                                            all that,\\\" said the Mock Turtle.<br\\/><\\/p><p>\\\"No,\\n                                            no! The adventures first,\\\" said the Gryphon in an impatient tone:\\n                                            \\\"explanations take such a dreadful time.\\\"<br\\/><\\/p><p>So\\n                                            Alice began telling them her adventures from the time when she first saw the\\n                                            White Rabbit. She was a little nervous about it just at first, the two\\n                                            creatures got so close to her, one on each side, and opened their eyes and\\n                                            mouths so very wide, but she gained courage as she went on. Her listeners\\n                                            were perfectly quiet till she got to the part about her repeating \\\"You\\n                                            are old, Father William,\\\" to the Caterpillar, and the words all coming\\n                                            different, and then the Mock Turtle drew a long breath, and said, \\\"That\'s\\n                                            very curious.\\\"<br\\/><\\/p><p>\\\"It\'s all about as\\n                                            curious as it can be,\\\" said the Gryphon.<br\\/><\\/p><p>\\\"It\\n                                            all came different!\\\" the Mock Turtle repeated thoughtfully. \\\"I\\n                                            should like to hear her repeat something now. Tell her to begin.\\\" He\\n                                            looked at the Gryphon as if he thought it had some kind of authority over\\n                                            Alice.<br\\/><\\/p><p>\\\"Stand\\n                                            up and repeat \'\'Tis the voice of the sluggard,\'\\\" said the Gryphon.<br\\/><\\/p><p>\\\"How\\n                                            the creatures order one about, and make one repeat lessons!\\\" thought\\n                                            Alice. \\\"I might as well be at school at once.\\\" However, she got\\n                                            up, and began to repeat it, but her head was so full of the Lobster\\n                                            Quadrille, that she hardly knew what she was saying, and the words came very\\n                                            queer indeed:—<br\\/><\\/p><p>\\\"\'Tis the voice of the\\n                                            Lobster; I heard him declare,<br\\/>\'You have baked me too brown, I must\\n                                            sugar my hair.\'<br\\/>As a duck with its eyelids, so he with his nose<br\\/>Trims\\n                                            his belt and his buttons, and turns out his toes.<br\\/>When the sands\\n                                            are all dry, he is gay as a lark,<br\\/>And will talk in contemptuous\\n                                            tones of the Shark:<br\\/>But, when the tide rises and sharks are\\n                                            around,<br\\/>His voice has a timid and tremulous sound.\\\"<br\\/>\\\"That\'s\\n                                            different from what I used to say when I was a child,\\\" said the\\n                                            Gryphon.<br\\/><\\/p><p>\\\"Well, I never heard it before,\\\"\\n                                            said the Mock Turtle: \\\"but it sounds uncommon nonsense.\\\"<br\\/><\\/p><p>Alice\\n                                            said nothing; she had sat down with her face in her hands, wondering if\\n                                            anything would ever happen in a natural way again.<br\\/><\\/p><p>\\\"I\\n                                            should like to have it explained,\\\" said the Mock Turtle.<br\\/><\\/p><p>\\\"She\\n                                            ca\'n\'t explain it,\\\" hastily said the Gryphon. \\\"Go on with the next\\n                                            verse.\\\"<br\\/><\\/p><p>\\\"But about his toes?\\\"\\n                                            the Mock Turtle persisted. \\\"How could he turn them out with his nose,\\n                                            you know?\\\"<br\\/><\\/p><p>\\\"It\'s the first position\\n                                            in dancing,\\\" Alice said; but was dreadfully puzzled by the whole thing,\\n                                            and longed to change the subject.<br\\/><\\/p><p>\\\"Go on\\n                                            with the next verse,\\\" the Gryphon repeated: \\\"it begins \'I passed\\n                                            by his garden.\'\\\"<br\\/><\\/p><p>Alice did not dare to\\n                                            disobey, though she felt sure it would all come wrong, and she went on in a\\n                                            trembling voice:<\\/p><p>\\\"I passed by his garden, and marked,\\n                                            with one eye,<br\\/>How the Owl and the Panther were sharing a pie:<br\\/>The\\n                                            Panther took pie-crust, and gravy, and meat,<br\\/>While the Owl had the\\n                                            dish as its share of the treat.<br\\/>When the pie was all finished, the\\n                                            Owl, as a boon,<br\\/>Was kindly permitted to pocket the spoon:<br\\/>While\\n                                            the Panther received knife and fork with a growl,<br\\/>And concluded\\n                                            the banquet by——\\\"<br\\/>Mock turtle<br\\/>\\\"What is the use\\n                                            of repeating all that stuff,\\\" the Mock Turtle interrupted, \\\"if you\\n                                            don\'t explain it as you go on? It\'s by far the most confusing thing I ever\\n                                            heard!\\\"<br\\/><\\/p><p>\\\"Yes, I think you\'d better\\n                                            leave off,\\\" said the Gryphon: and Alice was only too glad to do so.<br\\/><\\/p><p>\\\"Shall\\n                                            we try another figure of the Lobster Quadrille?\\\" the Gryphon went on.\\n                                            \\\"Or would you like the Mock Turtle to sing you another song?\\\"<br\\/><\\/p><p>\\\"Oh,\\n                                            a song, please, if the Mock Turtle would be so kind,\\\" Alice replied, so\\n                                            eagerly that the Gryphon said, in a rather offended tone, \\\"H\'m! No\\n                                            accounting for tastes! Sing her \'Turtle Soup,\' will you, old fellow?\\\"<br\\/><\\/p><p>The\\n                                            Mock Turtle sighed deeply, and began, in a voice choked with sobs, to sing\\n                                            this:—<br\\/><\\/p><p>\\\"Beautiful Soup, so rich and green,<br\\/>Waiting\\n                                            in a hot tureen!<br\\/>Who for such dainties would not stoop?<br\\/>Soup\\n                                            of the evening, beautiful Soup!<br\\/>Soup of the evening, beautiful\\n                                            Soup!<br\\/>Beau—ootiful Soo—oop!<br\\/>Beau—ootiful Soo—oop!<br\\/>Soo—oop\\n                                            of the e—e—evening,<br\\/>Beautiful, beautiful Soup!<br\\/><\\/p><p>\\\"Beautiful\\n                                            Soup! Who cares for fish,<br\\/>Game, or any other dish?<br\\/>Who\\n                                            would not give all else for two<br\\/>Pennyworth only of beautiful Soup?<br\\/>Pennyworth\\n                                            only of beautiful Soup?<br\\/>Beau—ootiful Soo—oop!<br\\/>Beau—ootiful\\n                                            Soo—oop!<br\\/>Soo—oop of the e—e—evening,<br\\/>Beautiful,\\n                                            beauti—FUL SOUP!\\\"<br\\/>\\\"Chorus again!\\\" cried the\\n                                            Gryphon, and the Mock Turtle had just begun to repeat it, when a cry of\\n                                            \\\"The trial\'s beginning!\\\" was heard in the distance.<br\\/><\\/p><p>\\\"Come\\n                                            on!\\\" cried the Gryphon, and, taking Alice by the hand, it hurried off,\\n                                            without waiting for the end of the song.<br\\/><\\/p><p>\\\"What\\n                                            trial is it?\\\" Alice panted as she ran; but the Gryphon only answered\\n                                            \\\"Come on!\\\" and ran the faster, while more and more faintly came,\\n                                            carried on the breeze that followed them, the melancholy words:—<br\\/><\\/p><p>\\\"Soo—oop\\n                                            of the e—e—evening,<br\\/>Beautiful, beautiful Soup!\\\"<br\\/>\\n                                            <\\/p>\"\n}', 'Neos.Demo:Content.Text', 0, 0, NULL, NULL, 0, '{}', 4, '/sites/neosdemo/the-book/x-the-lobster-quadrille/main', '7f428f3f92690e06b66c06f4593df0bc', '4f534b1eb0c1a785da31e681fb5e91ff', '{\n    \"language\": {\n        \"0\": \"en_US\"\n    }\n}', '28c1573b196a370672d250916a98db92', NULL, '2015-04-26 19:43:12', '2019-02-25 17:10:06', NULL),
