('df8207cc-e030-4bc0-8e17-942535569594', 'live', NULL, '/sites/neosdemo/the-book/ix-the-mock-turtle-s-story', '50d505ea-6703-d959-550a-4a7f879607f9', 1100, '{\n    \"layout\": \"chapter\",\n    \"title\": \"IX. The Mock Turtle\'s Story\",\n    \"chapterDescription\": \"You can\'t think how glad I am to see you again, you dear old thing!\\\" said the Duchess, as she tucked her arm affectionately into Alice\'s, and they walked off together. Alice was very glad to find her in such a pleasant temper, and thought to herself that perhaps it was only the pepper that had made her so savage when they met in the kitchen. \",\n    \"chapterImage\": {\n        \"__flow_object_type\": \"Neos\\\\Media\\\\Domain\\\\Model\\\\ImageVariant\",\n        \"__identifier\": \"b23052f2-bd58-854c-b613-ea76f7d4a401\"\n    },\n    \"uriPathSegment\": \"ix-the-mock-turtle-s-story\"\n}', 'Neos.Demo:Document.Chapter', 0, 0, NULL, NULL, 0, '{}', 13, '/sites/neosdemo/the-book', '7b4fb74d336b426d5ff8415e9bd3af70', '4f534b1eb0c1a785da31e681fb5e91ff', '{\n    \"language\": {\n        \"0\": \"en_US\"\n    }\n}', 'ff7170df62e02ccc62f06663a3689785', NULL, '2015-04-26 19:43:12', '2019-09-05 18:12:50', '2019-09-05 18:12:50'),
