('fbefaef2-b50e-4431-8855-1852089fc5ad', 'live', NULL, '/sites/neosdemo/features/imagetext/main/node524c21d53285a/column1/node524c2887753b8', 'afe00cb9-4166-c3d0-8ba3-6e9edad2cbe9', 100, '{\n    \"caption\": \"<p><br\\/><\\/p>\",\n    \"text\": \"<p>\\n                                                    <\\/p><p>Five and Seven said nothing, but looked at Two.\\n                                                    Two began in a low voice, \\\"Why, the fact is, you see, Miss,\\n                                                    this here ought to have been a red rose-tree, and we put a white one\\n                                                    in by mistake; and if the Queen was to find it out, we should all\\n                                                    have our heads cut off, you know. So you see, Miss, we\'re doing our\\n                                                    best, afore she comes, to——\\\" At this moment, Five, who had been\\n                                                    anxiously looking across the garden, called out \\\"The Queen! The\\n                                                    Queen!\\\" and the three gardeners instantly threw themselves flat\\n                                                    upon their faces. There[98] was a sound of many footsteps, and Alice\\n                                                    looked round, eager to see the Queen. <\\/p>\",\n    \"image\": {\n        \"__flow_object_type\": \"Neos\\\\Media\\\\Domain\\\\Model\\\\ImageVariant\",\n        \"__identifier\": \"b8062715-0885-8df4-3a19-508a1429c04a\"\n    }\n}', 'Neos.Demo:Content.TextWithImage', 0, 0, NULL, NULL, 0, '{}', 6, '/sites/neosdemo/features/imagetext/main/node524c21d53285a/column1', '2f8d44c19697af7773596b2d077775fd', '4f534b1eb0c1a785da31e681fb5e91ff', '{\n    \"language\": {\n        \"0\": \"en_US\"\n    }\n}', '7143dda1476f4be0888fb754e083f1f5', NULL, '2015-04-26 19:43:11', '2019-03-08 09:22:04', NULL),
