('fda0085f-443d-4eab-81ae-2b9cc9a85f1b', 'live', NULL, '/sites/neosdemo/features/main/node524c37db511d4/column1/node524c38e478450', '732d2a69-6f2e-dbf0-67ac-632879f3f8fc', 200, '{\n    \"text\": \"<p>\\n                                                <\\/p><p>We know that a website does not only contain static\\n                                                parts. In today\'s world, you often integrate external services, have to\\n                                                model complex business logic or tweak the output of the website in a\\n                                                very fine-grained way. That\'s why our main goal is developer happiness.\\n                                                We want you to be effective, being able to re-use concepts and code\\n                                                across your websites.<\\/p><p>Of course, that is no free ride:\\n                                                You need to learn the concepts used in Neos. However, by implementing\\n                                                established practices in software development, your knowledge can be\\n                                                applied to a wide variety of languages, frameworks and use-cases. We\\n                                                want to help you become better programmers!<\\/p><div>The\\n                                                Learn Once, Run Everywhere Philosophy is the main guidance principle for\\n                                                the development of Neos: All components are usable inside the CMS\\n                                                context, but also in stand-alone web applications. That of course also\\n                                                includes your own components.<\\/div>\"\n}', 'Neos.Demo:Content.Text', 0, 0, NULL, NULL, 0, '{}', 5, '/sites/neosdemo/features/main/node524c37db511d4/column1', '0f9770a20a86b330ebc57de8f69001ac', '4f534b1eb0c1a785da31e681fb5e91ff', '{\n    \"language\": {\n        \"0\": \"en_US\"\n    }\n}', 'b95ea764248d305805f2946653afab0e', NULL, '2015-04-26 19:43:11', '2019-02-25 17:10:06', NULL),
('ff3943d0-156a-4c26-b99a-827743ea5dba', 'live', NULL, '/sites/neosdemo/the-book/ii-the-pool-of-tears', '7697f046-e514-7bdc-7bda-95ab8d05eeaf', 400, '{\n    \"title\": \"II. The Pool of Tears\",\n    \"chapterImage\": {\n        \"__flow_object_type\": \"Neos\\\\Media\\\\Domain\\\\Model\\\\ImageVariant\",\n        \"__identifier\": \"1d0d4e41-bc2a-2cad-c495-21a46ffecdb8\"\n    },\n    \"chapterDescription\": \"Curiouser and curiouser!\\\" cried Alice (she was so much surprised, that for a moment she quite forgot how to speak good English); \\\"now I\'m opening out like the largest telescope that ever was! Good-bye, feet!\\\" (for when she looked down at her feet, they seemed to be almost out of sight, they were getting so far off). \",\n    \"layout\": \"chapter\",\n    \"uriPathSegment\": \"ii-the-pool-of-tears\"\n}', 'Neos.Demo:Document.Chapter', 0, 0, NULL, NULL, 0, '{}', 13, '/sites/neosdemo/the-book', 'e347f0dffe3abeffca72055c85066c38', '4f534b1eb0c1a785da31e681fb5e91ff', '{\n    \"language\": {\n        \"0\": \"en_US\"\n    }\n}', 'ff7170df62e02ccc62f06663a3689785', NULL, '2015-04-26 19:43:11', '2019-09-05 18:12:50', '2019-09-05 18:12:50'),
